    [1278] = {id=1278,en="This thick silk is spun from rare\ntwincoons. When woven into cloth, the\nthread's unequal thickness causes\ndiffused reflection.",ja="ハベトロットの繭をつむいだ太い絹糸。\n太さが不均一で、織られた布は光を乱反射する。"},
    [1279] = {id=1279,en="This soft, lustrous cloth has been\nwoven using extremely complex\ntechniques originating from countries\nin the Far South.",ja="複雑な工程を経て織られた光り輝く柔らかい織物。\n南方の国から伝来したもの。"},
    [1280] = {id=1280,en="This finely textured cloth has been\nwoven using extremely complex\ntechniques originating from countries\nin the Far East.",ja="複雑な工程を経て織られた木目細かな感触の織物。\n東方の国から伝来したもの。"},
    [1281] = {id=1281,en="This soft cloth is woven from a rare\ntype of wool, using techniques\noriginating from an island\nin the Far West.",ja="珍しい羊の毛から織られた柔らかい織物。\n西方の島から伝来したもの。"},
    [1282] = {id=1282,en="A whisker cut from the Flauros. These\nwhiskers are said to detect future wind\ndirection.",ja="「フラウロス」から切り取られたヒゲ。\n未来の風を読むと伝えられる。"},
