    [1449] = {id=1449,en="This ancient Windurstian currency,\nvaluing 1 mumu, dates back to C.E.\n294. The engraving commemorates the\njoining of the Tarutaru tribes and the\nestablishment of the Federation.",ja="ウィンダスの旧通貨 1ムム。C.E.294年発行。\n星の神子トゥククが、タルタル諸部族を融和させ、\n連邦制に移行した記念に製作された初のムム貨幣。"},
    [1450] = {id=1450,en="This ancient Windurstian currency,\nvaluing 100 mumus, dates back to C.E.\n373. The engraving commemorates the\nwarlord Lungo-Nango's invasion of\nElvaan occupied Southern Quon.",ja="ウィンダスの旧通貨百ムム。C.E.373年発行。\nエルヴァーン領に侵攻したルンゴナンゴ元帥が\nクォン大陸の南端に到達した記念に製作された。"},
    [1451] = {id=1451,en="This ancient Windurstian currency,\nvaluing 10,000 mumus, dates back to\nC.E. 719. The engraving commemorates\nthe 500 year anniversary of Star\nSibyl Rimilala's discovery of magic.",ja="ウィンダスの旧通貨 1万ムム。C.E.719年発行。\n星の神子リミララが魔法を発見してから\n500年を記念して製作された。縞は魔法の調和を表す。"},
    [1452] = {id=1452,en="This ancient San d'Orian currency,\nvaluing 1 noit, dates back to C.E. 491.\nIt commemorates the Royal Knights\nand the knights' first captain, Lord\nFainevlure Ordelle.",ja="サンドリアの旧通貨 1ノワ。C.E.491年発行。\n王立騎士団結成 100年を記念して鋳造された。\n名は初代団長フェンブルール・オルデール卿から。"},
    [1453] = {id=1453,en="This ancient San d'Orian currency,\nvaluing 100 noits, dates back to C.E.\n563. It commemorates the hero of the\nFirst Battle of Konschtat, Lady\nEldie Montiont.",ja="サンドリアの旧通貨百ノワ。C.E.563年発行。\n第一次コンシュタット会戦の勝利を記念して鋳造。\n名は一番槍をつけた騎士エルディ・モニヨンから。"},
    [1454] = {id=1454,en="This ancient San d'Orian currency,\nvaluing 10,000 noits, dates back to\nC.E. 830. It commemorates the slaying\nof the evil black dragon by Ranperre\nd'Oraguille.",ja="サンドリアの旧通貨 1万ノワ。C.E.830年発行。\n王都を襲った黒龍が退治された記念として鋳造。\n名は止めを刺したランペール・ドラギーユに由来。"},
    [1455] = {id=1455,en="This ancient Bastokan currency dates\nback to C.E. 857. It commemorates the\nopening of the ferry route between\nMhaura and Selbina. A musket and a\nGalkan soldier are portrayed.",ja="C.E.857年発行のバストゥークの旧通貨。\nセルビナ-マウラ機船定期便就航の記念紙幣。\n表にはつるはしと鉄砲、裏にはガルカの兵士を印刷。"},
    [1456] = {id=1456,en="This ancient Bastokan currency dates\nback to C.E. 857. It commemorates the\nopening of the ferry route between\nMhaura and Selbina. A machine cog and\na Hume technician are portrayed.",ja="C.E.857年発行のバストゥークの旧通貨。\nセルビナ-マウラ機船定期便就航の記念紙幣。\n表には歯車、裏にはヒュームの技術者を印刷。"},
    [1457] = {id=1457,en="This ancient Bastokan currency dates\nback to C.E. 857. It commemorates the\nopening of the ferry route between\nMhaura and Selbina. The Metalworks\nand a laborer's raised fist are\nportrayed.",ja="C.E.857年発行のバストゥークの旧通貨。\nセルビナ-マウラ機船定期便就航の記念紙幣。\n表には大工房、裏には手を掲げる労働者たちを印刷。"},
    [1458] = {id=1458,en="The tusks of the legendary mammoth\nare prized by bonecrafters across\nVana'diel.",ja="最高の骨材と呼ばれる伝説の巨大獣の門歯。\n"},
    [1459] = {id=1459,en="Remarkably light and sturdy\ngriffon leather.",ja="丈夫だが驚くほど軽いグリフィンのなめし革。\n"},
    [1460] = {id=1460,en="This transparent jewel is larger than\na bird egg.",ja="巨大な透明の宝石。\n"},
    [1461] = {id=1461,en="Wootz ore was added during this\nsteel's smelting process.",ja="ウーツ鉱を交えつつ加炭した鋼の塊。\n"},
    [1462] = {id=1462,en="Processed lancewood lumber.",ja="ランスウッドの材木。\n"},
    [1463] = {id=1463,en="An enormous petrified tooth.",ja="半ば化石化した巨大な臼歯。\n"},
    [1464] = {id=1464,en="A rough-cut log of lancewood timber.",ja="未加工のランスウッドの材木。\n"},
    [1465] = {id=1465,en="A large, smooth piece of\nspeckled granite.",ja="花崗岩の石材。\n"},
    [1466] = {id=1466,en="These unidentifiable iron items were\nforged centuries ago.",ja="はるか古に作られた鉄製品。\n"},
    [1467] = {id=1467,en="This type of steel is formed by\nrefining piles of relic iron.",ja="精練した古鉄の塊。\n"},
    [1468] = {id=1468,en="Applying this lubricant drastically\nimproves the performance of all\nfirearms.",ja="鉄砲の操作性を飛躍的に向上させる専用の潤滑油。\n"},
    [1469] = {id=1469,en="This ore contains a natural form of\nthe wootz alloy.",ja="天然のウーツ合金を含有する鉱石。\n"},
    [1470] = {id=1470,en="Translucent gems are embedded in\nthis large stone.",ja="透明の宝石を含んでいることがある石。\n"},
    [1471] = {id=1471,en="This grain is imported from a land far\nto the east. When cooked, it has a\nconsistency slightly more glutinous\nthan normal Tarutaru rice.",ja="東方から輸入されている米。\nタルタルライスより粘りがある。"},
    [1472] = {id=1472,en="This spice is used to make dyes and\nward off evil spirits.",ja="染料や魔除けとして用いられるスパイス。\n"},
    [1473] = {id=1473,en="The quality of this scorpion shell is\nbeyond compare.",ja="状態のよい大サソリの甲殻。\n"},
    [1474] = {id=1474,en="The heart of a simulacrum.",ja="「動く巨像」の体内から取り出した心臓。\n"},
    [1475] = {id=1475,en="Over eleven herbs and spices have\nbeen blended to form this pungent\npowder. The mixture is said to have\noriginated in a land far to the south.",ja="二十一種の南方のスパイスを混ぜ合わせた調味料。\n"},
    [1476] = {id=1476,en="These animal hairs are bound to the\nbody of the instrument known as the\nxhifhut. The sound created by the\nxhifhut closely resembles the fricative\nnoises made within the Antica's necks.",ja="シフートと云う楽器の一部。共鳴箱に張る獣毛。\nアンティカ頸部の摩擦音に似た擬音を出せるため\n他種族が彼らと直接対話する際に用いられる。"},
    [1477] = {id=1477,en="This hollow wooden case is the body\nof the instrument known as the\nxhifhut. The sound created by the\nxhifhut closely resembles the fricative\nnoises made within the Antica's necks.",ja="シフートと云う楽器の本体。中空の木箱。\nアンティカ頸部の摩擦音に似た擬音を出せるため\n他種族が彼らと直接対話する際に用いられる。"},
    [1478] = {id=1478,en="This bow is used when playing the\ninstrument known as the xhifhut. The\nsound created by the xhifhut closely\nresembles the fricative noises made\nwithin the Antica's necks.",ja="シフートと云う楽器の演奏に用いられる道具。\nアンティカ頸部の摩擦音に似た擬音を出せるため\n他種族が彼らと直接対話する際に用いられる。"},
    [1479] = {id=1479,en="This tuning device is attached to the\nbody of the instrument known as the\nxhifhut. The sound created by the\nxhifhut closely resembles the fricative\nnoises made within the Antica's necks.",ja="シフートと云う楽器の一部。調音に用いるパーツ。\nアンティカ頸部の摩擦音に似た擬音を出せるため\n他種族が彼らと直接対話する際に用いられる。"},
    [1480] = {id=1480,en="This shrunken head is often mistaken\nfor that of a mermaid. However, it is\nsimply the mummified remains of an\nOpo-opo, used by the Sahagin when\nbartering with the pirates of Norg.",ja="ヒュームの伝説の人魚を思わせる、干からびた頭。\n実はサハギンが海賊と物々交換する商品として、\nオポオポの死体から製作した精巧な細工物。"},
    [1481] = {id=1481,en="This shriveled body is often mistaken\nfor that of a mermaid. However, it is\nsimply the mummified remains of an\nOpo-opo, used by the Sahagin when\nbartering with the pirates of Norg.",ja="ヒュームの伝説の人魚を思わせる、干からびた体。\n実はサハギンが海賊と物々交換する商品として、\nオポオポの死体から製作した精巧な細工物。"},
    [1482] = {id=1482,en="These shrunken hands are often\nmistaken for those of a mermaid.\nHowever, they are simply the\nmummified remains of an Opo-opo,\nused by the Sahagin when bartering\nwith the pirates of Norg.",ja="ヒュームの伝説の人魚を思わせる、干からびた手。\n実はサハギンが海賊と物々交換する商品として、\nオポオポの死体から製作した精巧な細工物。"},
    [1483] = {id=1483,en="This shriveled tail is often mistaken\nfor that of a mermaid. However, it is\nsimply the mummified remains of a\npugil, used by the Sahagin when\nbartering with the pirates of Norg.",ja="ヒュームの伝説の人魚を思わせる、干からびた尾。\n実はサハギンが海賊と物々交換する商品として、\nプギルの死体から製作した精巧な細工物。"},
    [1484] = {id=1484,en="This type of weblike mantle is used in\nthe lanterns of Tonberry assassins. The\nlantern's mysterious light is said to\nhave hypnotic powers.",ja="蜘蛛の網のようなトンベリランタンの発光筒。\nトンベリのアサシン（暗殺者）専用のタイプで、\nその光で敵に催眠術をかけることができると云う。"},
    [1485] = {id=1485,en="This globe, constructed from thin\nbeetle shells, is found on the lanterns\nof Tonberry assassins. The lantern's\nmysterious light is said to have\nhypnotic powers.",ja="甲虫の甲殻から作られたトンベリランタンの火屋。\nトンベリのアサシン（暗殺者）専用のタイプで、\nその光で敵に催眠術をかけることができると云う。"},
    [1486] = {id=1486,en="This putrid-smelling tank is found on\nthe lanterns of Tonberry assassins. The\nlantern's mysterious light is said to\nhave hypnotic powers.",ja="悪臭を発するトンベリランタンの油壺。\nトンベリのアサシン（暗殺者）専用のタイプで、\nその光で敵に催眠術をかけることができると云う。"},
    [1487] = {id=1487,en="This Hume bone lid and handle is found\non the lanterns of Tonberry assassins.\nThe lantern's mysterious light is said\nto have hypnotic powers.",ja="人骨から作られたトンベリランタンの排気傘。\nトンベリのアサシン（暗殺者）専用のタイプで、\nその光で敵に催眠術をかけることができると云う。"},
    [1488] = {id=1488,en="This bird egg has a small \"A\" printed\non the bottom.",ja="底に小さく“A”と記された鳥の卵。\n"},
