    [1513] = {id=1513,en="This bird egg has a small \"Z\" printed\non the bottom.",ja="底に小さく“Z”と記された鳥の卵。\n"},
    [1514] = {id=1514,en="This \"free ride\" ticket is part of a\ncampaign by the chocobo stables to\nencourage more adventurers to utilize\ntheir services.",ja="チョコボ厩舎が騎行普及のために発行している\n無料乗鳥券。"},
    [1515] = {id=1515,en="The striking tips of fang arrows.\n",ja="ファングアローの先端にとりつけるパーツ。\n"},
    [1516] = {id=1516,en="The lustrous hide of a griffon.",ja="きらきらしたグリフィンの毛皮。\n"},
    [1517] = {id=1517,en="The head of what looks like an\nenormous mammal lies encased within\nthis block of ice.",ja="何か巨大な生物の頭が入った凍土の塊。\n"},
    [1518] = {id=1518,en="This giant, half-petrified skull closely\nresembles that of a Hume.",ja="半ば化石化した巨大な頭蓋骨。\nヒュームのそれに似ている。"},
    [1519] = {id=1519,en="This pungent liver was only recently\ncut out of a healthy Orc.",ja="頑健なオークから切り取られた肝の臓。\n"},
    [1520] = {id=1520,en="A Goblin Alchemist has brewed this\nlubricant from a secret recipe.",ja="ゴブリンの錬金術師が調合した秘伝の潤滑剤。\n"},
    [1521] = {id=1521,en="Only certain, rare species of slime\nproduce this highly sought-after fluid.",ja="珍種のスライムから抽出した希少な体液。\n"},
    [1522] = {id=1522,en="When dried, this spice is useful for\ngetting rid of unpleasant odors.",ja="消臭効果があるスパイス。\n"},
    [1523] = {id=1523,en="This herb is said to have relaxing\nproperties as well as assist digestion.\nIt has a light, apple scent.",ja="鎮静・消化促進効果があるハーブ。\nリンゴに似た香りがする。"},
    [1524] = {id=1524,en="When dried, this spice is said to assist\ndigestion.",ja="消化促進効果があるスパイス。\n"},
    [1525] = {id=1525,en="The tiny egg of an adamantoise.\nDue to the traces of metal found\nin their shells, these eggs are often\nmistaken for chunks of ore.",ja="巨亀アダマンタスの小さな卵。\n殻に金属が混じっていて、鉱石のように見える。"},
    [1526] = {id=1526,en="This beard of the legendary wyrm is\nactually an overgrown scale taken from\nunder its chin.",ja="真龍ウィルムの逆さまに生えたウロコ。\n顎の下に1枚だけある。"},
    [1527] = {id=1527,en="This giant tongue of the behemoth is\ncovered with hundreds of tiny lumps.",ja="恐獣ベヒーモスの巨大な舌。\n無数の突起が表面にびっしりと生えている。"},
    [1528] = {id=1528,en="A red stone used by the Orcs to\ndeliver orders. The red color signifies\n\"Ronfaure,\" and the number of nails\nimbedded in its surface signifies\n\"Attack.\"",ja="オークが軍令伝達に使う色のついた石。\n赤い色より「ロンフォール」\n打ち込まれた釘の数より「襲撃」と読みとれる。"},
    [1529] = {id=1529,en="A sheet of darksteel used by the\nQuadav to deliver orders. Upon it is a\nmap of Gustaberg with arrows\nindicating an invasion route.",ja="ダーク板でできたクゥダフの作戦指令書。\n「グスタベルグ」らしき地図が刻まれており\nその上から進撃ルートが描き込まれている。"},
    [1530] = {id=1530,en="A knotted rope used by the Yagudo to\ndeliver orders. The type of knot\nsignifies the order (attack), while the\nnumber of knots signifies the location\n(Sarutabaruta).",ja="ヤグードの伝令が携える、結び縄文字の教書。\n結び方が行動、間隔が時、数が場所を表すとされ、\n「7」が「サルタバルタ」を\n「仲仕結び」が「攻略」を指している。"},
    [1531] = {id=1531,en="A fang-filled bag used by Goblin\nthieves to relay messages. It is\nbelieved that the type of fang (Galka)\nrepresents the place of meeting\n(Zulkheim).",ja="ゴブリンの盗賊団が通信に用いる麻袋。\n中には、たくさんの獣歯に混じって\n「ザルクヘイム」を意味すると云われる\n穿孔されたガルカの牙が入っている。"},
    [1532] = {id=1532,en="A green stone used by the Orcs to\ndeliver orders. The green color\nsignifies \"Norvallen,\" and the number\nof nails imbedded in its surface\nsignifies \"Attack.\"",ja="オークが軍令伝達に使う色のついた石。\n緑色より「ノルバレン」\n打ち込まれた釘の数より「襲撃」と読みとれる。"},
    [1533] = {id=1533,en="A sheet of silver used by the\nQuadav to deliver orders. Upon it\nis a map of Derfland with arrows\nindicating an invasion route.",ja="銀板でできたクゥダフの作戦指令書。\n「デルフラント」らしき地図が刻まれており\nその上から進撃ルートが描き込まれている。"},
    [1534] = {id=1534,en="A fang-filled bag used by Goblin\nthieves to relay messages. It is \nbelieved that the type of fang (Mithra)\nrepresents the place of meeting\n(Kolshushu).",ja="ゴブリンの盗賊団が通信に用いる麻袋。\n中には、たくさんの獣歯に混じって\n「コルシュシュ」を意味すると云われる\n穿孔されたミスラの牙が入っている。"},
    [1535] = {id=1535,en="A knotted rope used by the Yagudo to\ndeliver orders. The type of knot\nsignifies the order (attack), while the\nnumber of knots signifies the location\n(Aragoneu).",ja="ヤグードの伝令が携える、結び縄文字の教書。\n結び方が行動、間隔が時、数が場所を表すとされ、\n「13」が「アラゴーニュ」を\n「仲仕結び」が「攻略」を指している。"},
    [1536] = {id=1536,en="These secret communications were\nwidely used by the beastmen during\nthe Great War to signal attacks.\nThe pictographs drawn upon this\nmissive represent the region of\nFauregandi.",ja="かつて獣人軍で用いられていた、なめし革の密書。\n象形文字で書かれているが、\n一部の解読法は冒険者にも知られており\n「フォルガンディ」と読める。"},
    [1537] = {id=1537,en="These secret communications were\nwidely used by the beastmen during\nthe Great War to signal attacks.\nThe pictographs drawn upon this\nmissive represent the region of\nValdeaunia.",ja="かつて獣人軍で用いられていた、なめし革の密書。\n象形文字で書かれているが、\n一部の解読法は冒険者にも知られており\n「バルドニア」と読める。"},
