    [1593] = {id=1593,en="This item first appeared long ago in a\nHume epic poem. It is written that the\nemperor who lights this candle is\nplagued with misfortune.",ja="ヒュームの叙事詩に登場する悪魔の蝋燭。\n主人公の皇帝は、この蝋燭を灯したが故に、\n数々の災厄に見舞われてしまう。"},
    [1594] = {id=1594,en="This item first appeared long ago in a\nHume epic poem. It is written that the\nempress who lights this candle has the\nlife essence slowly drained from her.",ja="ヒュームの叙事詩に登場する死神の蝋燭。\n主人公の女帝は、この蝋燭を灯したが故に、\n己の命脈を縮めることになってしまう。"},
    [1595] = {id=1595,en="Used in Elvaan rituals, this forbidden\nparchment lists worldly sins.\nHowever, it is rumored that the souls\nof those who read it are damned\nfor eternity.",ja="エルヴァーンの誓いの儀式に用いられる禁書。\n現世のあらゆる快楽が記されているとされている。\nただし、誘惑に勝てず覗き見た者は、\n死後、魂の獄に囚われると云う。"},
    [1596] = {id=1596,en="Used in Elvaan rituals, this forbidden\nastrological document is said to\nreveal the future. However, it is\nrumored that the souls of those\nwho read it are damned for eternity.",ja="エルヴァーンの誓いの儀式に用いられる占星書。\n読むと、自分の未来が分かるとされている。\nただし、誘惑に勝てず覗き見た者は、\n死後、魂の獄に囚われると云う。"},
    [1597] = {id=1597,en="A Tarutaru lullaby warns that bad\nchildren who forget their chores will\nbe visited by the snickering skull,\nand those who have heard the skull's\nsnickering cannot stop laughing\nthemselves.",ja="タルタルの子守唄に登場する頭蓋骨。\nいつまでも遊んでる悪い子には、\nゲラゲラドクロがやってくる。\nつい貰い笑いしたら止まらなくなるという怖い唄。"},
    [1598] = {id=1598,en="A Tarutaru lullaby warns that bad\nchildren who do not go to bed\nearly will be visited by the sniffling\nskull, and those who have heard\nthe skull's sniffling cannot stop crying\nthemselves.",ja="タルタルの子守唄に登場する頭蓋骨。\nいつまでも起きてる悪い子には、\nシクシクドクロがやってくる。\nつい貰い泣きしたら止まらなくなるという怖い唄。"},
    [1599] = {id=1599,en="Mithran urban myth states that if\nbitten by the legendary Yhoator flea,\none's entire body will itch for days.",ja="ミスラの噂話で怖れられているノミ。\nこのノミに刺されると、\n全身が痒くなり、数日間眠れなくなるらしい。"},
    [1600] = {id=1600,en="Galkan ghost stories tell grim tales of\nthose who had the misfortune to come\nacross these dreaded cutters.\nTails lopped off by the tool are said\nto never grow back... ",ja="ガルカの怪談に登場する呪われた包丁。\nこの包丁で尻尾を切断されると、\n二度と生えてこないと云う。"},
