    [1652] = {id=1652,en="A traditional Eastern vinegar made by\nfermenting rice.",ja="米から作られた東方伝来の酢。\n"},
    [1653] = {id=1653,en="This magical pen is made from the\nfinger of a Demon. When placed on\na piece of parchment, it will\nwrite one's diary for him.",ja="デーモンの指で作られたペン。\n血がインクに、爪がペン先になる。\n紙に置くと、ひとりでに動いて日誌を書きつける。"},
    [1654] = {id=1654,en="This rock is formed when magma cools.\n",ja="マグマが固まってできた岩石。\n"},
    [1655] = {id=1655,en="A small bag made from sheep leather.\n",ja="羊のなめし革で作られた小さな袋。\n"},
    [1656] = {id=1656,en="This tank made from brass sheets is\nmainly used to store liquids.",ja="ブラス板で作られた液体用の密閉容器。\n"},
    [1657] = {id=1657,en="This twine is used by members\nof the Carpenters' Guild to\nbundle logs together.",ja="木工ギルドで原木を束ねるのに使用されるロープ。\n"},
    [1658] = {id=1658,en="A sealion is engraved into the handle\nof this brass key.",ja="海獅子の紋章が刻印された黄銅の鍵。\n"},
    [1659] = {id=1659,en="A branch of coral is engraved into the\nhandle of this brass key.",ja="珊瑚の紋章が刻印された黄銅の鍵。\n"},
    [1660] = {id=1660,en="A simple key forged from bronze.\n",ja="青銅でできた単純なつくりの鍵。\n"},
    [1661] = {id=1661,en="This variety of garlic, known for\nits pungent odor and high level of\nnutrition, is only found on the\nTavnazian Archipelago.",ja="独特の臭いと滋養強壮を備えたスパイス。\n"},
    [1662] = {id=1662,en="Said to have been used by a\nformer saint, this tapestry has\nbeen recognized by the San d'Orian\nCathedral as an authentic relic.",ja="聖人が生前に使用していた布。\nサンドリア国教会により認定済みの品。"},
    [1663] = {id=1663,en="When ground into a powder and\nserved with hot water, the\nroot of the arnica has the\nability to cure various ailments.",ja="多年草アルニカの根。\n傷の治癒や解熱の効能がある。"},
    [1664] = {id=1664,en="These flat, round jade stones are\ntreasured in lands to the Far East.",ja="東方で珍重される平たく円い翡翠。\n"},
    [1665] = {id=1665,en="A tiny key made of pure copper.\n",ja="純銅でできた単純なつくりの鍵。\n"},
    [1666] = {id=1666,en="This rare diamond changes color\ndepending on the surrounding air\ntemperature.",ja="周囲の温度によって色を変えるダイアモンド。\n"},
    [1667] = {id=1667,en="The molten center of a cluster.\n",ja="クラスターの燃えさかる魂。\n"},
    [1668] = {id=1668,en="This fastwater fishing rod has been\nsnapped perfectly in two--almost\ntoo perfectly.",ja="折れてしまった『渓流竿』。\n折れ口が不自然なほど鮮やかだ。"},
    [1669] = {id=1669,en="The burnt remains of an ancient bomb.",ja="「エンシェントボム」の燃えカス。\n"},
    [1670] = {id=1670,en="Enhanced by the power of anima,\nthe hardness of this orichalcum\ningot has more than doubled.",ja="アニマによって硬化されたオリハルコン塊。\n"},
    [1671] = {id=1671,en="Enhanced by the power of anima,\nthis ash has the ability to break\npowerful curses.",ja="アニマによって呪文を解くアッシュ材。\n"},
    [1672] = {id=1672,en="Enhanced by the power of anima,\nthis oak has the ability to reflect\nmagic.",ja="アニマによって魔法を跳ね返すホワイトオーク材。\n"},
    [1673] = {id=1673,en="Enhanced by the power of anima,\nthis oak has the ability to teleport.",ja="アニマによって転移するホワイトオーク材。\n"},
    [1674] = {id=1674,en="Enhanced by the power of anima,\nthis gold's hardness has more than\ndoubled.",ja="アニマによって硬度の増した金の塊。\n"},
    [1675] = {id=1675,en="Enhanced by the power of anima,\nthis silver has the ability to\nneutralize even the strongest of\npoisons.",ja="アニマによって解毒効果を得た銀の塊。\n"},
    [1676] = {id=1676,en="Enhanced by the power of anima, the\ntemperature of this orichalcum ingot\nhas been pushed well below freezing.",ja="アニマによって冷却されたオリハルコン塊。\n"},
    [1677] = {id=1677,en="Enhanced by the power of anima,\nthis orichalcum has the power to\ncall forth the spirits of water.",ja="アニマによって水を呼ぶオリハルコンの塊。\n"},
    [1678] = {id=1678,en="Enhanced by the power of anima,\nthis silver shines brighter than\nmost precious metals.",ja="アニマによって輝きの増した銀の塊。\n"},
    [1679] = {id=1679,en="Enhanced by the power of anima,\nthis gold has the ability to break\npowerful curses.",ja="アニマによって呪文を解く金の塊。\n"},
    [1680] = {id=1680,en="This bugard skin is in excellent\ncondition.",ja="状態のよいブガードの皮。\n"},
    [1681] = {id=1681,en="Enhanced by the power of anima,\nthis steel weighs half that of a\nnormal ingot.",ja="アニマによって軽量化された鋼の塊。\n"},
    [1682] = {id=1682,en="The Kingdom of San d'Oria stores\nthese ingots in the heavily guarded\nroyal treasury. The mark of the griffon\nis imbedded in the center of each bar.",ja="サンドリア王国の備蓄金として鋳造された金の塊。\n中央に小さくグリフィンが刻印されている。"},
    [1683] = {id=1683,en="This medicinal root only grows in\nthe arid soil of the Attohwa\nChasm. Its rarity makes it quite\nexpensive.",ja="アットワ地溝にのみ自生する薬用人参。\n滋養強壮の効能があり、高値で取引される。"},
    [1684] = {id=1684,en="An elaborately designed solid gold key.\n",ja="黄金製の精巧なつくりの鍵。\n"},
    [1685] = {id=1685,en="Members of the Quadav patrol use this\npungent oil in their lamps. It is said\nthat the strong odor the oil emits\nwhen lit repels even the most terrible\nof beasts.",ja="クゥダフの夜警が用いる灯油。\n燃焼する時に発する独特の芳香が、怪物を退ける。"},
    [1686] = {id=1686,en="This grimy letter has been sealed\nwith red wax.",ja="ロウで封印された封筒。\n汚れてしまっている。"},
    [1687] = {id=1687,en="A fully suspended memory from one\nof the Empty.",ja="かなり記憶をとどめた「虚ろなるもの」の断片。\n"},
    [1688] = {id=1688,en="A fully suspended memory from one\nof the Empty.",ja="かなり記憶をとどめた「虚ろなるもの」の断片。\n"},
    [1689] = {id=1689,en="A fully suspended memory from one\nof the Empty.",ja="かなり記憶をとどめた「虚ろなるもの」の断片。\n"},
    [1690] = {id=1690,en="This feather grows on the tail of\na hippogryph.",ja="ヒポグリフの尾に生えている羽根。\n"},
    [1691] = {id=1691,en="This faintly glowing scale is thought\nto have been taken from the body of\na colossal wyrm.",ja="巨大な真龍のものと思われる1枚の鱗。\n淡い光を放っている。"},
    [1692] = {id=1692,en="This translucent carmine chip is shaped\nlike a tiny hexagon. A strange light\nis emitted from its sparkling center.",ja="半透明な紅色の小さな六角形の板。\n中を覗くと、瞬く無数のラインが見える。"},
    [1693] = {id=1693,en="This translucent cyan chip is shaped\nlike a tiny hexagon. A strange light\nis emitted from its sparkling center.",ja="半透明な青緑色の小さな六角形の板。\n中を覗くと、瞬く無数のラインが見える。"},
    [1694] = {id=1694,en="This translucent gray chip is shaped\nlike a tiny hexagon. A strange light\nis emitted from its sparkling center.",ja="半透明な灰白色の小さな六角形の板。\n中を覗くと、瞬く無数のラインが見える。"},
    [1695] = {id=1695,en="Molten hot peppers famous for being\nmore \"stimulating\" than the renowned\nblazing peppers.",ja="「刺激がらし」より辛いと評判のスパイス。\n"},
    [1696] = {id=1696,en="This special steel has been forged with\na magical flame.",ja="魔炎の燃え盛る炉で精製された特殊な鋼。\n"},
    [1697] = {id=1697,en="Processed spruce lumber.\n",ja="トウヒの材木。\n"},
    [1698] = {id=1698,en="It is said Demons use these files to\nsharpen their horns and claws.",ja="非常に細かい目のヤスリ。\nデーモンが爪を研ぐのに使っているらしい。"},
    [1699] = {id=1699,en="Cloth woven from linen\nand bloodthread.",ja="血糸と亜麻糸を編んで作った布。\n"},
    [1700] = {id=1700,en="This scarlet thread is produced by a\nvariety of diremite. Much like a\nspider's web, it is extremely light,\nbut unbelievably strong.",ja="ダイアマイトの一種が吐く、血のように赤い糸。\n風に流して獲物を捕えるため、軽いがとても丈夫。"},
    [1701] = {id=1701,en="Enhanced by the power of anima,\nthis linen is twice as thin as that\nof a normal square.",ja="アニマによって薄くなった亜麻布。\n"},
    [1702] = {id=1702,en="Enhanced by the power of anima,\nthis velvet is extremely soft and\nsmooth.",ja="アニマによって滑らかになったビロード。\n"},
    [1703] = {id=1703,en="This ore contains traces of the metal\nkunwu iron.",ja="金属の昆吾鉄を含有する鉱石。\n"},
    [1704] = {id=1704,en="A chunk of kunwu iron, smelted using\na traditional Far Eastern method.",ja="東方の製法による昆吾鉄の塊。\n"},
    [1705] = {id=1705,en="Kunwu iron forged into a sheet.\n",ja="昆吾鉄の板。\n"},
    [1706] = {id=1706,en="The main character from the\nridiculously popular \"Nyumomo, the\nTwirling Taru\" comics. There is not\na girl in Jeuno who has not begged\nher father to buy her one of these\ndolls.",ja="ジュノで爆発的ブームを呼んでいる、女児用玩具。\nおしゃまで気まぐれな架空のタルタル少女の\n活躍を描いた同名絵草子のキャラクターグッズ。"},
    [1707] = {id=1707,en="This high-quality paper has been made\nwith advanced methods known only\nto those living in the Eastern empire.",ja="東方の優れた製紙技術で作られた高級紙。\n"},
    [1708] = {id=1708,en="It is rumored the Goblins make these\nreplicas of real gil. However, because\nthey cannot duplicate the magic\nimprint cast by the Vana'diel Treasury,\nmost shopkeeps can easily spot one.",ja="ゴブリンが偽造した精巧なギル貨幣。\nただし、魔法の透かし彫が入っていないため、\n商人なら本物と見分けるのは容易い。"},
    [1709] = {id=1709,en="Naphille is known around Jeuno for\nbeing on the cutting edge of fashion\ntrends. Anyone who's who in the duchy\ncan be seen carrying one of her\noutrageously expensive pochettes.",ja="高級皮革ブランド、ナフィル製のハンドバッグ。\nブランド名は、創業者の伝説的革工ナフィルから。\nジュノ社交界必携のアイテム。"},
    [1710] = {id=1710,en="This biography portrays a day in the\nlife of Jeuno's most popular actor,\nFernan. From witty quotes to\ntrue-to-life drawings, there is enough\nmaterial in this book to make any fan\ndrool.",ja="ジュノで大人気の舞台俳優の密着取材記。\n彼が1日に発した言葉から何気ない仕草まで、\n写実的なイラストと共に綴るファン垂涎の1冊。"},
    [1711] = {id=1711,en="An ingot of smelted molybdenum ore.\n",ja="製錬したモリブデン鋼の塊。\n"},
    [1712] = {id=1712,en="This lustrous wool is found on a\nrare variety of sheep bred only in Near\nEastern nations.",ja="鮮やかな光沢の大羊の長毛。\n近東に生息する大羊の一種からのみ採れる。"},
    [1713] = {id=1713,en="Thread spun from cashmere wool.\n",ja="カシミヤ毛をつむいだ糸。\n"},
    [1714] = {id=1714,en="Luxurious cloth woven from the\nhighest quality cashmere thread.\nIt retains heat better than any of\nthe more common wools.",ja="カシミヤ糸を編んで作った最高級の毛織物。\nとても柔軟で、保温性に優れる。"},
    [1715] = {id=1715,en="Enhanced by the power of anima,\nthis coral has begun to grow again.",ja="アニマによって蘇生し始めた珊瑚のかけら。\n"},
    [1716] = {id=1716,en="Enhanced by the power of anima,\nthis beetle jaw creates almost no\nfriction.",ja="アニマによって滑らかになった甲虫のアゴ。\n"},
    [1717] = {id=1717,en="This fully materialized quasispirit\nemits the auras of all eight elements.",ja="すべての属性を帯び、実体化した擬似魂。\n"},
    [1718] = {id=1718,en="The twisted tusk of a megalobugard.\n",ja="「メガロブガード」の湾曲した巨大な牙。\n"},
    [1719] = {id=1719,en="This hard shell protects the harajnite\nfrom predators.",ja="「ハラジナイト」の背負っている巨大な貝殻。\n"},
    [1720] = {id=1720,en="The crystallized remains of one of\nthe Empty. It emits a soft blue glow.",ja="結晶化した「虚ろなるもの」の断片。\n水色にゆらめく光を放っている。"},
    [1721] = {id=1721,en="The crystallized remains of one of\nthe Empty. It emits a soft green glow.",ja="結晶化した「虚ろなるもの」の断片。\n緑色にゆらめく光を放っている。"},
    [1722] = {id=1722,en="The crystallized remains of one of\nthe Empty. It emits a soft indigo glow.",ja="結晶化した「虚ろなるもの」の断片。\n青色にゆらめく光を放っている。"},
    [1723] = {id=1723,en="The crystallized remains of one of\nthe Empty. It emits a soft white glow.",ja="結晶化した「虚ろなるもの」の断片。\n白色にゆらめく光を放っている。"},
    [1724] = {id=1724,en="A long silk robe once worn by a\nsoulflayer.\nCannot be equipped by people.",ja="ソウルフレアの絹の長衣。\n人間には装備不可能。"},
    [1725] = {id=1725,en="This rare type of high-altitude lily\nblooms even in the harshest of\nconditions.",ja="雪の中に咲く、珍しい高山性の百合。\n"},
    [1726] = {id=1726,en="The Fishermen's Guild no longer\ncarries this high-quality fishing\nrod. Unfortunately, this one is broken.",ja="昔、漁師ギルドで扱っていた超高級ブランド釣竿。\n折れてしまっている。"},
    [1727] = {id=1727,en="A processed piece of lumber made from\na rare tree only found on the southern\nisland of Garhada.",ja="南方のガラダヤ島産の高級材木。\n"},
    [1728] = {id=1728,en="This legendary ore is rumored to\nharbor an unimaginable amount of\nenergy. When held up to the light,\nit glows brightly.",ja="莫大なエネルギーを生むと伝えられる鉱石。\n太陽にかざすと、淡い光を放つ。"},
    [1729] = {id=1729,en="When rubbed, this smooth stone\nbecomes unbearably hot. Essential\nfor cooking and heating in the areas\nof Movalpolos where the use of\nflammable materials is restricted.",ja="こすると高熱を発する不思議な石。\n火気厳禁の坑内で、モブリンが調理に用いている。"},
    [1730] = {id=1730,en="This pot is specially designed to slow\nthe growth of the polar fir.",ja="成長を遅らせる植木鉢に移し変えられた北極樅。\nただし、長い間植えられていると、枯れてしまう。"},
    [1731] = {id=1731,en="The knights of early San d'Oria used\nto attach these tiny bells to their\nchocobo saddles.",ja="かつて王立騎士に流行した、チョコボにつける鈴。\n美しい音色だが、敵には発見され易かった。"},
    [1732] = {id=1732,en="This tiny tree has been covered in a\nbeautiful layer of ice.",ja="美しい樹氷に覆われた樹。\n"},
    [1733] = {id=1733,en="Ice carved into a perfect sphere.\n",ja="丸く削られた氷の珠。\n"},
    [1734] = {id=1734,en="A sparkling blue band of velvet.\n",ja="輝く青いビロードの帯。\n"},
    [1735] = {id=1735,en="A meat pie made by the world-famous\nranger Khue Ronchab. While delicious\nwhen hot, its flavor is comparable to\na sweaty mocassin when cool.",ja="狩人クェ・ロンチャブが焼いたミートパイ。\n美味しいけれど、冷めると臭味が出てしまう。"},
    [1736] = {id=1736,en="A tasty frozen snack invented by the\nblack mage Mehiruru. Unfortunately, it\nmelts at a very low temperature.",ja="黒魔道士メヒルルの開発した氷菓子。\n美味しいけれど、融けやすいのが難点。"},
    [1737] = {id=1737,en="Jade carved into a perfect sphere.\n",ja="丸く削られた翡翠の珠。\n"},
    [1738] = {id=1738,en="This variety of blood-red copper is\nfound in the Far East.",ja="東方より伝来した赤銅のインゴット。\n"},
    [1739] = {id=1739,en="This sturdy variety of cotton cloth\nwas once used in Bastok when building\nhot-air balloons.",ja="気球に使われていた丈夫な綿布。\nかつて、バストゥークで織られたもののようだ。"},
