    [1749] = {id=1749,en="A trading card sold by the Tenshodo.\nOn one side is a ranger reeling in a\npugil.",ja="天晶堂が発行した証書。\n釣竿と陸魚を腕に抱いた狩人が描かれている。"},
    [1750] = {id=1750,en="A trading card sold by the Tenshodo.\nOn one side is a fierce warrior clad in\nFar Eastern armor.",ja="天晶堂が発行した証書。\n東方の甲冑をつけた猛々しい戦士が描かれている。"},
