    [1823] = {id=1823,en="A tin-plated toy that resembles a\nshrimp. When placed in water,\nlighting the candle on its back\nwill propel it.",ja="海老をモチーフにしたブリキの玩具。\n背皿のロウソクを灯すと、蒸気の力で水面を走る。\n尻尾の先端がひょこひょこ動くギミックがある。"},
