    [2328] = {id=2328,en="A light-based automaton attachment.\n\nFunctionality:\n ・Erase enfeebling and\n 　Light Maneuver effects",ja="光の属性を秘めたオートマトンのアタッチメント。\n弱体効果とライトマニューバの効果を消し去る。"},
    [2329] = {id=2329,en="A darkness-based automaton\nattachment.\n\nFunctionality:\n ・Decreases accuracy,\n 　increases evasion",ja="闇の属性を秘めたオートマトンのアタッチメント。\n命中率ダウン、回避率アップ。"},
    [2330] = {id=2330,en="A beautiful sash said to have been\na part of the legendary archer Yoichi's\nsuit of armor.",ja="伝説の弓取りの大鎧の一部と伝えられる美しい緒。\n"},
    [2331] = {id=2331,en="This papyrus scroll reads:\n\"The bearer of this document has\n proven excellence in the ways of\n the blue mage.\"",ja="偉大な青魔道士であることを証明するパピルス。\n"},
    [2332] = {id=2332,en="This papyrus scroll reads:\n\"The bearer of this document has\n proven excellence in the ways of\n the corsair.\"",ja="偉大なコルセアであることを証明するパピルス。\n"},
    [2333] = {id=2333,en="This papyrus scroll reads:\n\"The bearer of this document has\n proven excellence in the ways of\n the puppetmaster.\"",ja="偉大なからくり士であることを証明するパピルス。\n"},
    [2334] = {id=2334,en="A oddly shaped hat once worn by a\nPoroggo. Only Poroggos can equip it.",ja="ポロッゴの着用する奇妙な形の帽子。\n人間には装備不可能。"},
    [2335] = {id=2335,en="A tentacle cut from the body of\na soulflayer. It still twitches\noccasionally.",ja="ソウルフレアから切り取られた触手。\n生命力が強く、時々ピチピチと動く。"},
    [2336] = {id=2336,en="A magical staff once carried by\na soulflayer. A malevolent curse has\nbeen cast upon it so that only the\nstaff's owner can take hold of it.",ja="ソウルフレアが携帯しているワンド。\n本人しか振れないよう邪悪な呪紋が施されている。"},
    [2337] = {id=2337,en="A clump of hair taken from the body\nof a full-grown wamoura. An ingredient\nused in making wamoura silk.",ja="ワモーラの成虫から刈り取った体毛の束。\nワモーラ糸の原料となる。"},
    [2338] = {id=2338,en="A scale taken from the wing of\na full-grown wamoura. Its surface\nsparkles with reflected light.",ja="ワモーラの成虫の翅から採取したウロコ状の粉。\nキラキラと光を複雑に反射する。"},
    [2339] = {id=2339,en="A medical certificate issued by\nthe Vana'diel Chocobo Society for\na male chocobo.",ja="VCSがチョコボの雄鳥に発行する健康診断書。\n"},
    [2340] = {id=2340,en="This square of silk cloth was created\nusing Near Eastern weaving techniques.",ja="近東風の織り方で織られた絹布。\n"},
    [2341] = {id=2341,en="This device calculates and displays\nthe geology of the ocean floor.\nLong ago, it graced the navigation\nroom of a ship owned by the Kingdom\nof Ephramad.",ja="雷鳴を発して、海底の起伏を測定・再現する装置。\nかつて、イフラマド王国の船舶に搭載されていた。"},
    [2342] = {id=2342,en="A medical certificate issued by\nthe Vana'diel Chocobo Society for\na female chocobo.",ja="VCSがチョコボの雌鳥に発行する健康診断書。\n"},
    [2343] = {id=2343,en="Millet from the La Theine Plateau,\noften mixed into chocobo feed.",ja="ラテーヌ原産の粟。\nチョコボの飼料に配合される。"},
    [2344] = {id=2344,en="This ticket from the Vana'diel Chocobo\nSociety is good for half a day in the\nopen pasture for a lucky chocobo\ncouple.",ja="VCSがチョコボのカップルに贈る半日放牧券。\n"},
    [2345] = {id=2345,en="A high-grade elixir mixed especially\nfor chocobo use.",ja="チョコボ用に調合された高級エリクサー。\n"},
    [2346] = {id=2346,en="A super deluxe salad created especially\nfor chocobos.",ja="チョコボ用に調理された超豪華なサラダ。\n"},
    [2347] = {id=2347,en="A fire-based automaton attachment.\n\nFunctionality:\n ・Use \"Blaze Spikes\"",ja="火の属性を秘めたオートマトンのアタッチメント。\n「ブレイズスパイク」を使用する。"},
    [2348] = {id=2348,en="An ice-based automaton attachment.\n\nFunctionality:\n ・Enhances magic accuracy",ja="氷の属性を秘めたオートマトンのアタッチメント。\n魔法命中率アップの効果。"},
    [2349] = {id=2349,en="A wind-based automaton attachment.\n\nFunctionality:\n ・Adds \"Haste\" effect",ja="風の属性を秘めたオートマトンのアタッチメント。\nヘイストの効果。"},
    [2350] = {id=2350,en="An earth-based automaton attachment.\n\nFunctionality:\n ・May erase an Earth Maneuver\n 　effect to reduce severe physical\n 　damage",ja="土の属性を秘めたオートマトンのアタッチメント。\n物理攻撃による大ダメージをアースマニューバの\n効果をひとつ消して軽減することがある。"},
    [2351] = {id=2351,en="A thunder-based automaton\nattachment.\n\nFunctionality:\n ・Increases critical hit rate",ja="雷の属性を秘めたオートマトンのアタッチメント。\nクリティカルヒット確率アップの効果。"},
    [2352] = {id=2352,en="A water-based automaton attachment.\n\nFunctionality:\n ・May erase a Water Maneuver\n 　effect to prevent an overload",ja="水の属性を秘めたオートマトンのアタッチメント。\nウォータマニューバの効果をひとつ消して、\nオーバーロードを防ぐことがある。"},
    [2353] = {id=2353,en="A light-based automaton attachment.\n\nFunctionality:\n ・Increases the performance\n 　of other attachments",ja="光の属性を秘めたオートマトンのアタッチメント。\n他のアタッチメントの性能アップの効果。"},
    [2354] = {id=2354,en="A darkness-based automaton\nattachment.\n\nFunctionality:\n ・When MP is low, may erase all\n 　Dark Maneuver effects to restore MP",ja="闇の属性を秘めたオートマトンのアタッチメント。\nMPが少ない時、ダークマニューバの効果を、\nすべて消してMPを回復することがある。"},
    [2355] = {id=2355,en="The sturdy chestplate worn by\nMamool Ja Autarch, Gulool Ja Ja.\nIt is far too bulky for people to wear.",ja="グルージャジャが着用していた胸甲。\n人間には装備不可能。"},
    [2356] = {id=2356,en="A helmet once worn by the Troll\nmercenary captain, Gurfurlur the\nMenacing. No one else can equip it.",ja="トロールの傭兵団長が着用していた冑。\n人間には装備不可能。"},
    [2357] = {id=2357,en="This armlet once decorated Medusa's\nforearm. No one else can equip it.",ja="メドゥーサの前腕を飾っていた腕輪。\n人間には装備不可能。"},
    [2358] = {id=2358,en="Enhanced by the power of anima, the\nhardness of this wyvern scale has more\nthan doubled.",ja="アニマによって硬度の増したワイバーンの鱗。\n"},
    [2359] = {id=2359,en="A beautiful sapphire of the highest\nquality, sparkling like a thousand stars.",ja="幸福の星彩が美しく輝く最高級のサファイア。\n"},
    [2360] = {id=2360,en="A motor device composed of multiple\ngears made of gold.",ja="黄金の歯車で作られた動力伝導装置。\n"},
    [2361] = {id=2361,en="A vine cut from an ameretat. Still\npartly alive, the vine twitches\noccasionally, searching for prey.",ja="アムルタートから切り取られたつる。\n生命力が強く、時々ウネウネと獲物を求めて動く。"},
    [2362] = {id=2362,en="A high-quality chunk of the insulator\nebonite.",ja="高品質のエボナイト合成樹脂。\n"},
    [2363] = {id=2363,en="A heavy brick of densely packed clay, built to withstand high temperatures.",ja="粘土に砂や石灰などを混ぜて焼き固めた建築材料。\n耐熱性に優れる。"},
    [2364] = {id=2364,en="This yellow root can be used as\na nourishing tonic.",ja="黄色い色をした薬用人参。\n滋養強壮の効能がある。"},
    [2365] = {id=2365,en="This blood appears to have come\nfrom a demon.",ja="デーモン類のものと思われる血液。\n"},
    [2366] = {id=2366,en="Trade this voucher and an old\nchocobo whistle to a certified VCS\ntrainer in exchange for a new whistle.",ja="VCS発行「チョコボホイッスル」の交換券。\n上級厩務員に中古品と共に渡すと、\n新品のホイッスルと交換してくれる。"},
    [2367] = {id=2367,en="This secret blend of top-quality\nchocobo feed will keep your bird\ncoming back for more.",ja="特殊な方法で配合された野菜汁。\nチョコボの飼料。"},
    [2368] = {id=2368,en="This high-quality carrot has been\ngrown using only the finest fertilizers.",ja="特殊な肥料で育てられた高級人参。\nチョコボの飼料。"},
    [2369] = {id=2369,en="This high-quality worm has been raised\nin the finest soil on Vana'diel.",ja="特殊な飼料で育てられた高級環虫。\nチョコボの飼料。"},
    [2370] = {id=2370,en="A pouch containing an assortment of annual and perennial flower seeds sure to delight any gardener.",ja="様々な花の種が入った袋。\n"},
    [2371] = {id=2371,en="The knotty horn of a mighty khimaira.",ja="節くれ立ったキマイラの角。\n"},
    [2372] = {id=2372,en="The thick, sinewy mane of a mighty\nkhimaira.",ja="太く強靭なキマイラのたてがみ。\n"},
    [2373] = {id=2373,en="The severed tail of a khimaira. It still\nmoves as if it had a will of its own.",ja="キマイラから切り取られた尾。\n独自に意思を持ち、蛇のようにウネウネと動く。"},
    [2374] = {id=2374,en="This dust is an ingredient\nin viper potions.",ja="蛇毒薬の材料となる粉末。\n"},
    [2375] = {id=2375,en="A luminian-plated card retrieved\nfrom the Zhayolm Remnants.",ja="「ゼオルム遺構」で入手した輝金製のカード。\n"},
    [2376] = {id=2376,en="A luminian-plated card retrieved\nfrom the Arrapago Remnants.",ja="「アラパゴ遺構」で入手した輝金製のカード。\n"},
    [2377] = {id=2377,en="A luminian-plated card retrieved\nfrom the Bhaflau Remnants.",ja="「バフラウ遺構」で入手した輝金製のカード。\n"},
    [2378] = {id=2378,en="A luminian-plated card retrieved\nfrom the Silver Sea Remnants.",ja="「銀海遺構」で入手した輝金製のカード。\n"},
    [2379] = {id=2379,en="All-natural dye used to color a\nchocobo's feathers yellow.",ja="チョコボの羽色を黄色に染め上げるヘアダイ。\n"},
    [2380] = {id=2380,en="All-natural dye used to color a\nchocobo's feathers red.",ja="チョコボの羽色を赤色に染め上げるヘアダイ。\n"},
    [2381] = {id=2381,en="All-natural dye used to color a\nchocobo's feathers blue.",ja="チョコボの羽色を青色に染め上げるヘアダイ。\n"},
    [2382] = {id=2382,en="All-natural dye used to color a\nchocobo's feathers green.",ja="チョコボの羽色を緑色に染め上げるヘアダイ。\n"},
    [2383] = {id=2383,en="All-natural dye used to color a\nchocobo's feathers black.",ja="チョコボの羽色を黒色に染め上げるヘアダイ。\n"},
    [2384] = {id=2384,en="A cerulean gas swirls within this\nstopped flask. A label on it reads\n\"Danger! Extremely Flammable.\"",ja="中に青い煙が充満しているフラスコ。\n「注意！超可燃性ガス」とラベルに書いてある。"},
    [2385] = {id=2385,en="A shield once worn by Gigas champion\nAlkyoneus, originally taken from one\nof his past victims. It has seen much\nwear and cannot be equipped.",ja="巨人族ウラノス家のアルキオネウスが\n大切にしている、かつての好敵手の盾。\nかなり傷んでおり、装備することはできない。"},
    [2386] = {id=2386,en="The horn of a colossal wyrm carved\ninto a battle horn by Gigas champion\nPallas. It is too large to sound.",ja="巨人族ウラノス家のパラースが大切にしている\n古代龍の角から作られた角笛。\n長大で、人間が吹き鳴らすことはできない。"},
    [2387] = {id=2387,en="A gilt lantern treasured by the fiend\nSozu Rogberry. The eerie flame burning\ninside emits a surreal radiance.",ja="「僧都のログベリ」が大切にしているランタン。\n中で陰気な炎がちろちろと揺らめいている。"},
    [2388] = {id=2388,en="Supposedly a piece broken from the\nlegendary beast Ullikummi. Flecks of\nmica embedded in the stone sparkle\nwhen held to the light.",ja="「ウルリクムミ」の一部とされる閃緑岩。\n雲母がキラキラと輝いている。"},
    [2389] = {id=2389,en="A ripe faerie apple dipped in rich\nhoney. Use it during a chocobo race\nto temporarily increase the speed of\nyour steed.",ja="蜂蜜を塗ったリンゴ。\nレース中、チョコボの速度を一定時間上げる。"},
    [2390] = {id=2390,en="A ripe faerie apple dipped in creamy\nyogurt. Use it during a chocobo race\nto temporarily increase the stamina of\nyour steed.",ja="ヨーグルトを塗ったリンゴ。\nレース中、チョコボの体力消費を一定時間抑える。"},
    [2391] = {id=2391,en="A ripe faerie apple dipped in aromatic\ncoffee. Use it during a chocobo race\nto temporarily increase the evasion of\nyour steed.",ja="コーヒーを塗ったリンゴ。\nレース中、チョコボの回避力を一定時間上げる。"},
    [2392] = {id=2392,en="A biscuit laced with a ridiculous\namount of black pepper, guaranteed to\ncause anyone who consumes it to have\na sneezing fit.\n\nWhen used during a chocobo race...",ja="食べるとくしゃみが止まらないイタズラ用菓子。\nレース中に食べさせると……。"},
    [2393] = {id=2393,en="A biscuit laced with a ridiculous\nnumber of hot peppers, guaranteed to\nset on fire the mouth of anyone who\nconsumes it.\n\nWhen used during a chocobo race...",ja="食べると辛くて口から火を吹くイタズラ用菓子。\nレース中に食べさせると……。"},
    [2394] = {id=2394,en="A prank firework that emits a thick\ngas smelling remarkably similar to\ngysahl greens.\n\nWhen used during a chocobo race...",ja="周囲に野菜の香りがプ～ンと漂うイタズラ用花火。\nレース中に鳴らすと……。"},
    [2395] = {id=2395,en="A prank firework that releases a\nthick gas containing the spores of\ndanceshrooms.\n\nWhen used during a chocobo race...",ja="ついつい踊ってしまう胞子を撒くイタズラ用花火。\nレース中に鳴らすと……。"},
    [2396] = {id=2396,en="A doll used in Far Eastern countries\nto implore the spirits of nature for\nfair weather.\n\nWhen offered during a chocobo race...",ja="東方に伝わる晴天祈願用の人形。\nレース中に吊るすと……。"},
    [2397] = {id=2397,en="A frog used in Far Eastern countries\nto implore the spirits of nature for\nrain.\n\nWhen offered during a chocobo race...",ja="東方に伝わる雨天祈願の蛙。\nレース中に放すと……。"},
    [2398] = {id=2398,en="Supports a chocobo's limbs, allowing\nfor optimum muscle management.\n\nWhen equipped during a race,\nincreases a chocobo's strength.",ja="肢を保護し競争に全力を投じさせるチョコボ装具。\nレース中、チョコボの力が向上する。"},
    [2399] = {id=2399,en="Blocks a chocobo's side vision,\nallowing the bird to concentrate\non the track ahead.\n\nWhen equipped during a race,\nincreases a chocobo's endurance.",ja="側面の視界を遮り競争に集中させるチョコボ装具。\nレース中、チョコボの持久力が向上する。"},
    [2400] = {id=2400,en="Blocks a chocobo's view of the ground\ndirectly below it, allowing the bird to\nconcentrate on the track ahead.\n\nWhen equipped during a race,\nincreases a chocobo's discernment.",ja="足下の視界を遮り競争に集中させるチョコボ装具。\nレース中、チョコボの判断力が向上する。"},
    [2401] = {id=2401,en="Covers a chocobo's ears, thus blocking\nout surrounding noise and allowing the\nbird to concentrate on the track.\n\nWhen equipped during a race,\nincreases a chocobo's receptivity.",ja="音を遮り競争に集中させるチョコボ装具。\nレース中、チョコボの感受性が向上する。"},
    [2402] = {id=2402,en="A document distributed by the VCS\nauthorizing the participation of a\nchocobo in a CRA-sanctioned race.",ja="チョコボの出走を許可する証明書。VCS交付。\n「チョコボレース」に参加するために必要。"},
    [2403] = {id=2403,en="This VCS-issued token can be\nexchanged for 1 (one) session of\nrace chocobo strength conditioning.",ja="力を重視した競争鳥用の特別訓練トークン。\nVCS発行。"},
    [2404] = {id=2404,en="This VCS-issued token can be\nexchanged for 1 (one) session of\nrace chocobo endurance conditioning.",ja="持久力を重視した競争鳥用の特別訓練トークン。\nVCS発行。"},
    [2405] = {id=2405,en="This VCS-issued token can be\nexchanged for 1 (one) session of\nrace chocobo discernment conditioning.",ja="判断力を重視した競争鳥用の特別訓練トークン。\nVCS発行。"},
    [2406] = {id=2406,en="This VCS-issued token can be\nexchanged for 1 (one) session of\nrace chocobo receptivity\nconditioning.",ja="感受性を重視した競争鳥用の特別訓練トークン。\nVCS発行。"},
    [2407] = {id=2407,en="This VCS-issued token can be\nexchanged for 1 (one) session of\nbasic race chocobo conditioning.",ja="競争鳥用の通常メニューの訓練トークン。\nVCS発行。"},
    [2408] = {id=2408,en="This flaky coral fragment is a beautiful milky white color.",ja="美しい乳白色の珊瑚の欠片。\n"},
    [2409] = {id=2409,en="A fire-based automaton attachment.\n\nFunctionality:\n ・Converts the energy of a\n 　Fire Maneuver into attack\n 　power during weapon skills",ja="火の属性を秘めたオートマトンのアタッチメント。\nウェポンスキル発動時、ファイアマニューバを、\n攻撃力に変換する。"},
    [2410] = {id=2410,en="An ice-based automaton attachment.\n\nFunctionality:\n ・Converts the energy of an Ice\n 　Maneuver into magic attack power\n 　when casting magic spells",ja="氷の属性を秘めたオートマトンのアタッチメント。\n魔法詠唱時アイスマニューバを魔法攻撃力に\n変換する。"},
    [2411] = {id=2411,en="A wind-based automaton attachment.\n\nFunctionality:\n ・When HP is low, converts all\n 　Wind Maneuvers into copy images",ja="風の属性を秘めたオートマトンのアタッチメント。\nHPが減少している時ウィンドマニューバを消して\nその数に応じて分身を作り出す。"},
    [2412] = {id=2412,en="An earth-based automaton attachment.\n\nFunctionality:\n ・Increases the damage\n 　inflicted by Shield Bash\n ・May also induce \"Slow\" effect",ja="土の属性を秘めたオートマトンのアタッチメント。\nシールドバッシュのダメージを増幅。\nスロウの追加効果が発生することがある。"},
    [2413] = {id=2413,en="A thunder-based automaton\nattachment.\n\nFunctionality:\n ・Occasionally grants the automaton\n 　bonus melee attacks",ja="雷の属性を秘めたオートマトンのアタッチメント。\n近接攻撃を連続で行うことがある。"},
    [2414] = {id=2414,en="A water-based automaton attachment.\n\nFunctionality:\n ・Reduces damage taken from\n 　successive attacks of the same type",ja="水の属性を秘めたオートマトンのアタッチメント。\n直前に受けたダメージと同じ属性のダメージを\n軽減する。"},
    [2415] = {id=2415,en="A wind-based automaton attachment.\n\nFunctionality:\n ・Adds \"Haste\" effect",ja="風の属性を秘めたオートマトンのアタッチメント。\nヘイストの効果。"},
    [2416] = {id=2416,en="A light-based automaton attachment.\n\nFunctionality:\n ・Increases \"Cure\" potency",ja="光の属性を秘めたオートマトンのアタッチメント。\nケアル回復量アップ。"},
    [2417] = {id=2417,en="This ore contains traces of the metal\nAht Urhgan brass.",ja="天然の黄銅を含有する鉱石。\n"},
    [2418] = {id=2418,en="An ingot of refined Aht Urhgan brass.\n",ja="製錬した鍮石の塊。\n"},
    [2419] = {id=2419,en="Aht Urhgan brass forged into a sheet.\n",ja="鍮石の板。\n"},
    [2420] = {id=2420,en="Enhanced by the power of anima,\nthis crab shell emits a powerful\nelectric charge.",ja="アニマによって荷電された陸ガニの甲殻。\n"},
    [2421] = {id=2421,en="Enhanced by the power of anima,\nthe hardness of this turtle shell\nhas more than doubled.",ja="アニマによって硬化された海亀の甲羅。\n"},
