    [2511] = {id=2511,en="A Goblin-made shoulderpiece from\nthe armor of an Orc. It is far too\nheavy for people to wear.",ja="オークが着用するゴブリン製の鉄肩甲。\n人間には装備不可能。"},
    [2512] = {id=2512,en="The colorful hide of a lynx.\n",ja="鮮やかな模様の「リンクス」の毛皮。\n"},
    [2513] = {id=2513,en="A vine cut from a carnivorous rafflesia.\nThe poisonous thorns aid the plant in\ncapturing prey.",ja="移動性植物「ラフレシア」のつる。\n先端に補虫のための毒棘がある。"},
    [2514] = {id=2514,en="The fleshy petal of a carnivorous\nrafflesia. The hook at its tip is used\nto render prey immobile.",ja="移動性植物「ラフレシア」の分厚い花弁。\n先端に獲物を固定するための鉤状突起がある。"},
    [2515] = {id=2515,en="A serrated tooth taken from the maw\nof a sandworm.",ja="「サンドウォーム」の口角に生える鋭い歯。\n"},
    [2516] = {id=2516,en="A chitinous plate that protects the\nbody of a sandworm.",ja="「サンドウォーム」の背面を守る硬質の殻。\n"},
    [2518] = {id=2518,en="The striped hide of a smilodon.\n",ja="縞の鮮やかな剣虎「スミロドン」の毛皮。\n"},
    [2519] = {id=2519,en="A pauldron worn by the Yagudo. Its\nawkward design makes it impossible for\npeople to wear.",ja="ヤグードが着用する東方様の肩甲。\n人間には装備不可能。"},
    [2520] = {id=2520,en="A gauntlet worn by the Yagudo. Its\nawkward design makes it impossible\nfor people to wear.",ja="ヤグードが着用する東方様の篭手。\n人間には装備不可能。"},
    [2521] = {id=2521,en="The feculent claw of a gnole.\nThese talons are said to harbor\na score of infectious diseases.",ja="汚らしい「ノール」の鉤爪。\n様々な病気を媒介すると云われている。"},
    [2522] = {id=2522,en="The light, yet pliable wing of\na giant gnat.",ja="半透明の「ナット」の羽根。\n軽量かつ靭性に優れる。"},
    [2523] = {id=2523,en="The elastic skin of a peiste.\n",ja="「ペイスト」の弾力性に富む粗皮。\n"},
    [2524] = {id=2524,en="A poisonous stinger found on the\nhead of a peiste.",ja="「ペイスト」の頭部に生えている防御用の毒棘。\n"},
    [2525] = {id=2525,en="Did you remember to\nput holes in the lid?",ja="妖蟲「ピクシー」の入ったフラスコ。\n"},
    [2526] = {id=2526,en="Clearly of questionable durability from the start, this Moblin Maze Mongers fishing rod is now broken and unusable.",ja="折れてしまった『モブリン式釣竿』。\n"},
    [2527] = {id=2527,en="Protects little Hume hands from hot\npots and pans.",ja="ヒュームの子供用と思われる片手型耐熱ミトン。\n"},
    [2528] = {id=2528,en="An attractive brooch comprised of\na gold feather and a single pearl.",ja="金色の羽根と真珠がついたブローチ。\n"},
    [2529] = {id=2529,en="Hardy smilodon leather.\n",ja="強靭な「スミロドン」のなめし革。\n"},
    [2530] = {id=2530,en="Light and durable lynx leather.\n",ja="軽くて丈夫な「リンクス」のなめし革。\n"},
    [2531] = {id=2531,en="This shiny, black volcanic glass\nis often used in making weapons.",ja="黒色に輝く黒曜石。\n加工に適しており石器製作などに用いられる。"},
    [2532] = {id=2532,en="A rough-cut log of teak timber.\n",ja="未加工のチークの材木。\n"},
    [2533] = {id=2533,en="Processed teak lumber.\n",ja="チークの材木。\n"},
    [2534] = {id=2534,en="A rough-cut log of jacaranda timber.\n",ja="未加工のハカランダの材木。\n"},
    [2535] = {id=2535,en="Processed jacaranda lumber.\n",ja="ハカランダの材木。\n"},
    [2536] = {id=2536,en="An ingot of smelted electrum.\n",ja="製錬した琥珀金の塊。\n"},
    [2537] = {id=2537,en="Cloth woven from\nwool and dhalmel hair.",ja="毛糸とダルメル毛を編んで作った布。\n"},
    [2538] = {id=2538,en="Rough yet beautiful peiste leather.\n",ja="美しいしぼが特徴的なペイストのなめし革。\n"},
    [2539] = {id=2539,en="The shiny, silken hair of a dhalmel.\n",ja="絹のような光沢があるダルメルの毛。\n"},
    [2540] = {id=2540,en="A card created by the moogles for\nthe Starlight Celebration. When\nopened, you can see twinkling stars.",ja="モーグリが作った星芒祭のカード。\nカードを開けると、ちらちらと星が瞬く仕組み。"},
    [2541] = {id=2541,en="A card created by the moogles for\nthe Starlight Celebration. When\nopened, you can see twinkling stars.",ja="モーグリが作った星芒祭のカード。\nカードを開けると、ちらちらと星が瞬く仕組み。"},
    [2542] = {id=2542,en="An all-purpose trencher forged from\ndarksteel. 7 out of 10 Goblins don't\nleave home without one.",ja="ゴブリンが大切にしている黒鉄の飯盒。\n"},
    [2543] = {id=2543,en="A willow wicker basket used by\nGoblins to catch fish and eels.",ja="ゴブリンが漁に用いるヤナギのびく。\n"},
    [2544] = {id=2544,en="An large, leather collar studded with\nsharp spikes.",ja="外周に鋭いスパイクの並ぶスミロドンの首輪。\n"},
    [2545] = {id=2545,en="A heavy collar made of gold.\n",ja="黄金のリングで作られたリンクスの首輪。\n"},
    [2546] = {id=2546,en="The striking tips of black bolts.\n",ja="ブラックボルトの先端にとりつけるパーツ。\n"},
    [2547] = {id=2547,en="The striking tips of obsidian arrows.\n",ja="オブシディアアローの先端にとりつけるパーツ。\n"},
    [2548] = {id=2548,en="Gnat wings that are fitted to the nock\nend of arrow shafts. They add to the\ndirectional stability of arrows in flight.",ja="ナットの羽根でできた矢のパーツ。\n矢の飛行を安定させる。"},
    [2549] = {id=2549,en="The burnt remains of a djinn.\n",ja="ジンの燃えカス。\n"},
    [2550] = {id=2550,en="High-quality parchment made from\nsheepskin. This particular piece\nfeatures a decorative border.",ja="大羊の皮を加工して作られた上級羊皮紙。\n美しい飾り枠が施されている。"},
    [2551] = {id=2551,en="This chain is made of electrum links.\n",ja="琥珀金線を編んで組まれた鎖。\n"},
    [2552] = {id=2552,en="A form of Op Credit endowing the holder with the right to participate in Campaign Ops. Issued by the Allied Forces high command.",ja="「カンパニエops」への参加権を保障する受領券。\nアルタナ連合参謀本部発行。"},
    [2553] = {id=2553,en="A ninjutsu tool\nused in casting \"Monomi.\"",ja="忍び道具のひとつ。\n物見の術に用いられる。"},
    [2554] = {id=2554,en="Known for its pungent aroma, this\nyellow flower is known throughout\nSan d'Oria as the \"Undying Lily.\"",ja="濃厚な芳香を放つ、黄色いユリの花。\nサンドリアでは「楽園の不死の花」と呼ばれる。"},
    [2555] = {id=2555,en="A ninjutsu tool\nused in casting \"Aisha.\"",ja="忍び道具のひとつ。\n哀車の術に用いられる。"},
    [2556] = {id=2556,en="This papyrus scroll reads:\n\"The bearer of this document has\n proven excellence in the ways of\n the dancer.\"",ja="偉大な踊り子であることを証明するパピルス。\n"},
    [2557] = {id=2557,en="This papyrus scroll reads:\n\"The bearer of this document has\n proven excellence in the ways of\n the scholar.\"",ja="偉大な学者であることを証明するパピルス。\n"},
    [2558] = {id=2558,en="A fine grained glue mixed by the Yagudo, used in the repair of pottery.",ja="ヤグードが調合した魚のにかわ。\n粒子が細かく、楽器の修理に向くとされる。"},
    [2559] = {id=2559,en="A Mog Bonanza marble inscribed with the numbers which you have selected. Issued by the Mog House Management Union.",ja="任意に選んだ数字で当選が決まる富くじ。\nモグハウス管理組合発行。"},
    [2560] = {id=2560,en="An image captured while engaged in\nsurveillance of the Beastman\nConfederate has been superimposed\nonto this glass plate.",ja="魔物の姿が焼き付けられた板。\n"},
    [2561] = {id=2561,en="Excellent dough for making pizzas.\n",ja="ピザを作るベースとなる食材。\n"},
    [2562] = {id=2562,en="A knotted rope used by the Yagudo to\ndeliver orders. Due to the complexity and number of these knots, the encoded information is indecipherable.",ja="ヤグードの伝令が携える、結び縄文字の教書。\n未知の複雑な結び方のため、解読不能。"},
    [2563] = {id=2563,en="An extremely high-quality, fine-grained clay originating in the vicinity of Fort Karugo-Narugo.",ja="カルゴナルゴ城砦の周辺で採れる高品質の粘土。\n"},
    [2564] = {id=2564,en="A container of questionably produced feed pellets. The label simply reads, \"Peiste.\" A pungent, fish-like odor emanates from within.",ja="ラベルに「ペイスト」と記された謎の飼料。\n強烈な腥臭を発している。"},
    [2565] = {id=2565,en="A container of questionably produced feed pellets. The label simply reads, \"Gnole.\" The familiar scent of blood emanates from within.",ja="ラベルに「ノール」と記された謎の飼料。\n強烈な血臭を発している。"},
    [2566] = {id=2566,en="A container of questionably produced feed pellets. The label simply reads, \"Gnat.\" The putrid stench of rot and decay emanates from within.",ja="ラベルに「ナット」と記された謎の飼料。\n強烈な腐臭を発している。"},
    [2567] = {id=2567,en="A key to the former living quarters of low-ranking Yagudo initiates, converted to a prison after the outbreak of war.",ja="ヤグードの使う牢の鍵。\n元々は僧房だった場所を利用している。"},
    [2568] = {id=2568,en="A light and refreshing vegetable soup\nthat draws on the harmonizing effects\nof eastern ginger for its aroma and\nflavor. Standard chocobo fodder.",ja="茗荷が配合された淡白な野菜汁。\nチョコボの飼料。"},
    [2569] = {id=2569,en="A thick and hearty vegetable soup that\ndraws on the harmonizing effects of\neastern ginger for its aroma and flavor.\nStandard chocobo fodder.",ja="茗荷が配合された濃厚な野菜汁。\nチョコボの飼料。"},
    [2570] = {id=2570,en="The pelt of the legendary tigress Dawon, soft to the touch and beautifully patterned in fiery orange and black.",ja="巨大な剣虎族「ドゥン」の腹の皮。\nとても柔らかな手触り。"},
    [2571] = {id=2571,en="An eyepatch worn by the celebrated\nhero of legend, Balrahn. It is regarded\nas a sacred relic throughout the empire\nof Aht Urhgan.",ja="英雄バルラーンがつけていたと伝えられる眼帯。\nアトルガン皇国では聖遺物とされる。"},
    [2572] = {id=2572,en="An elaborately fashioned and ornate\nkey used to gain passage through the\nPandemonium Gate.",ja="「パンデモニウム」の門のカギ。\n"},
    [2573] = {id=2573,en="A known favorite of the notorious\nhydra, Tinnin. Allegedly irresistible\nenough to draw the three-headed\nbeast out of hiding.",ja="ハイドラ族「ティンニン」の好物。\n"},
    [2574] = {id=2574,en="A known favorite of the notorious\nArmed Gears. Allegedly irresistible\nenough to draw the robotic monstrosity\nout of hiding.",ja="ギア族「アームドギア」の好物。\n"},
    [2575] = {id=2575,en="A known favorite of the notorious\nMamool Ja, Gotoh Zha the Redolent.\nAllegedly irresistible enough to draw\nthe fiend out of hiding.",ja="マムージャ族「芳香のゴトージャ」の好物。\n"},
    [2576] = {id=2576,en="A known favorite of the notorious\nwivre, Dea. Allegedly irresistible enough\nto draw the hulking beast out of hiding.",ja="ウィヴル族「ディー」の好物。\n"},
    [2577] = {id=2577,en="A known favorite of the notorious\nmarid, Iriz Ima. Allegedly irresistible\nenough to draw the pugnacious\npachyderm out of hiding.",ja="マーリド族「イリズイマ」の好物。\n"},
    [2578] = {id=2578,en="A known favorite of the notorious\nLividroot Amooshah. Allegedly\nirresistible enough to draw the dreaded\nmalboro matron out of hiding.",ja="モルボル族「怒根のアムーシャ」の好物。\n"},
    [2579] = {id=2579,en="A known favorite of the notorious\nPoroggo, Iriri Samariri. Allegedly\nirresistible enough to draw the\nnefarious amphibian out of hiding.",ja="ポロッゴ族「イリリサマリリ」の好物。\n"},
    [2580] = {id=2580,en="A known favorite of the notorious puk,\nVulpangue. Allegedly irresistible enough\nto draw the plague-ridden pest out of\nhiding.",ja="プーク族「ヴルパングエ」の好物。\n"},
    [2581] = {id=2581,en="A known favorite of the notorious\ncolibri, Chamrosh. Allegedly irresistible\nenough to draw the winged menace out\nof hiding.",ja="コリブリ族「チャムロッシュ」の好物。\n"},
    [2582] = {id=2582,en="A known favorite of the notorious\nQiqirn, Cheese Hoarder Gigiroon.\nAllegedly irresistible enough to draw\nthe cheesy hedonist out of hiding.",ja="キキルン族「チーズマニアのギギルン」の好物。\n"},
    [2583] = {id=2583,en="A known favorite of the notorious\ncerberus, Sarameya. Allegedly\nirresistible enough to draw the\ncantankerous canine out of hiding.",ja="ケルベロス族「サーラメーヤ」の好物。\n"},
    [2584] = {id=2584,en="A known favorite of the notorious\nvampyr, Nosferatu. Allegedly irresistible\nenough to draw the perpetually\nbloodlusting undead out of hiding.",ja="ヴァンピール族「ノスフェラトゥ」の好物。\n"},
    [2585] = {id=2585,en="A known favorite of the notorious\nTroll, Khromasoul Bhurborlor. Allegedly\nirresistible enough to draw the gigantic\noaf out of hiding.",ja="トロール族「金敷のブーボーロー」の好物。\n"},
    [2586] = {id=2586,en="A known favorite of the notorious\nwamoura, Achamoth. Allegedly\nirresistible enough to draw the\nmaneating moth out of hiding.",ja="ワモーラ族「アカモート」の好物。\n"},
    [2587] = {id=2587,en="A known favorite of the notorious\ndragon, Anantaboga. Allegedly\nirresistible enough to draw the\nferocious reptilian out of hiding.",ja="ドラゴン族「アナンタボガ」の好物。\n"},
    [2588] = {id=2588,en="A known favorite of the notorious\nbomb, Reacton. Allegedly irresistible\nenough to draw the enraged explosive\nout of hiding.",ja="ボム族「リアクトン」の好物。\n"},
    [2589] = {id=2589,en="A known favorite of the notorious flan,\nDextrose. Allegedly irresistible enough\nto draw the gelatinous blob out of\nhiding.",ja="フラン族「デクストロース」の好物。\n"},
    [2590] = {id=2590,en="A known favorite of the notorious\nwamoura larva, Brass Borer. Allegedly\nirresistible enough to draw the\nterrifying termite out of hiding.",ja="ワモーラ族の幼虫「ブラスボーラー」の好物。\n"},
    [2591] = {id=2591,en="A known favorite of the notorious\nslime, Claret. Allegedly irresistible\nenough to draw the blubbery mass out\nof hiding.",ja="スライム族「クラレット」の好物。\n"},
    [2592] = {id=2592,en="A known favorite of the notorious\nautomaton, Ob. Allegedly irresistible\nenough to draw the mechanical terror\nout of hiding.",ja="オートマトン族「オブ」の好物。\n"},
    [2593] = {id=2593,en="A known favorite of the notorious\nkhimaira, Tyger. Allegedly irresistible\nenough to draw the mythic monster out\nof hiding.",ja="キマイラ族「ティガー」の好物。\n"},
    [2594] = {id=2594,en="A known favorite of the notorious\nsoulflayer, Mahjlaef the Paintorn.\nAllegedly irresistible enough to draw\nthe merciless warlock out of hiding.",ja="ソウルフレア族「惨痛のマジュラエフ」の好物。\n"},
    [2595] = {id=2595,en="A known favorite of the notorious\nExperimental Lamia. Allegedly\nirresistible enough to draw the\nserpentine witch out of hiding.",ja="ラミア族「ラミアEX」の好物。\n"},
    [2596] = {id=2596,en="A known favorite of the notorious\norobon, Nuhn. Allegedly irresistible\nenough to draw the foul fish out of\nhiding.",ja="オロボン族「ヌン」の好物。\n"},
    [2597] = {id=2597,en="A known favorite of the notorious\nacrolith, Wulgaru. Allegedly irresistible\nenough to draw the arcane atrocity out\nof hiding.",ja="アクロリス族「ウルガル」の好物。\n"},
    [2598] = {id=2598,en="A known favorite of the notorious\nqutrub, Zareehkl the Jubilant. Allegedly\nirresistible enough to draw the\ngrotesque horror out of hiding.",ja="クトゥルブ族「法悦のザリクル」の好物。\n"},
    [2599] = {id=2599,en="A known favorite of the notorious imp,\nVerdelet. Allegedly irresistible enough\nto draw the evil sorcerer out of hiding.",ja="インプ族「ヴェルデレト」の好物。\n"},
    [2600] = {id=2600,en="A known favorite of the notorious\nskeleton, Velionis. Allegedly irresistible\nenough to draw the bony ghoul out of\nhiding.",ja="スケルトン族「ヴェリオニス」の好物。\n"},
    [2601] = {id=2601,en="A known favorite of the notorious Lil'\nApkallu. Allegedly irresistible enough to\ndraw the murderous avian out of hiding.",ja="アプカル族の珍種「リルアプカル」の好物。\n"},
    [2602] = {id=2602,en="A known favorite of the notorious\nchigoe, Chigre. Allegedly irresistible\nenough to draw the bounding\nbloodsucker out of hiding.",ja="チゴー族の希少種「チガー」の好物。\n"},
    [2603] = {id=2603,en="This aged bronze coin bears a peculiar glyph on one side, and the image of a sprouting seedling on the other.",ja="裏に小さく「誕生」と書かれた古いコイン。\n"},
    [2604] = {id=2604,en="This aged bronze coin bears a peculiar glyph on one side, and the image of a rising sun on the other.",ja="裏に小さく「発展」と書かれた古いコイン。\n"},
    [2605] = {id=2605,en="This aged bronze coin bears a peculiar glyph on one side, and the image of a rose in full bloom on the other.",ja="裏に小さく「栄華」と書かれた古いコイン。\n"},
    [2606] = {id=2606,en="This aged bronze coin bears a peculiar glyph on one side, and the image of a withered leaf on the other.",ja="裏に小さく「衰退」と書かれた古いコイン。\n"},
    [2607] = {id=2607,en="This aged bronze coin bears a peculiar glyph on one side, and the image of a skull on the other.",ja="裏に小さく「滅亡」と書かれた古いコイン。\n"},
    [2608] = {id=2608,en="An aromatic chestnut with a deep brown husk that grows in abundance on the lush grasslands of the La Theine Plateau. Rich in nutrients and quite tasty when roasted.",ja="加熱することで食用になるクリの実。\n栄養価が高く、携帯食料としても利用されている。"},
    [2609] = {id=2609,en="The lethally toxic fang of the hydra,\nTinnin. It continues to drip poison from\nthe venom ducts within.",ja="ハイドラ族「ティンニン」の毒牙。\n"},
    [2610] = {id=2610,en="A mechanical fragment taken from the\ndisassembled remains of the menacing\nArmed Gears. It appears to be a\ngenerator designed for providing large\nquantities of power.",ja="ギア族「アームドギア」の発電装置。\n"},
    [2611] = {id=2611,en="Neckware of the Mamool Ja, Gotoh Zha\nthe Redolent. Forever imbued with the\nindelible scent of its owner, it can be\nequipped by none other.",ja="マムージャ族「芳香のゴトージャ」の襟巻。\n人間には装備不可能。"},
    [2612] = {id=2612,en="Taken from the nasal protrusion of\nthe massive wivre Dea, this imposing\nhorn is perfectly adapted for impaling\nunwary targets.",ja="ウィヴル族「ディー」の角。\n"},
    [2613] = {id=2613,en="The thick, tough hide of Iriz Ima.\nIts durability is a testament to its\ncapacity to protect the marid against\nmost forms of predation.",ja="マーリド族「イリズイマ」の毛皮。"},
    [2614] = {id=2614,en="A wreathing, vinelike tendril amputated\nfrom the malboro Lividroot Amooshah.\nThe meandering of the vine makes it\nseem to continue to move, even in\ndeath.",ja="モルボル族「怒根のアムーシャ」のつる。\n"},
    [2615] = {id=2615,en="The perfectly form-fit hat of Poroggo \nIriri Samariri. Tailor-made to an\namphibious head, it cannot and will not\nadorn the typical adventurer noggin.",ja="ポロッゴ族「イリリサマリリ」の帽子。\n人間には装備不可能。"},
    [2616] = {id=2616,en="A wing clipping taken from the puk,\nVulpangue. Its lightness and thinness\nbelie both its strength and durability.",ja="プーク族「ヴルパングエ」の羽根。\n"},
    [2617] = {id=2617,en="The razor-sharp beak of the colibri\nChamrosh, capable of easily tearing\napart the flesh of most any creature.",ja="コリブリ族「チャムロッシュ」のくちばし。\n"},
    [2618] = {id=2618,en="The cape and cowl of Qiqirn, Cheese\nHoarder Gigiroon. Fit to the unique\nform of a Qiqirn body, it cannot be\ndonned by people, and reeks of\ncheese.",ja="キキルン族「チーズマニアのギギルン」の外衣。\n人間には装備不可能。"},
    [2619] = {id=2619,en="The tough, near-impenetrable hide of\nSarameya, one of the few known extant\nmembers of the cerberus family.",ja="ケルベロス族「サーラメーヤ」の皮。\n"},
    [2620] = {id=2620,en="Plunged into its victims and then\nlicked clean of the dripping blood,\nthis clawed appendage of the vampyr\nNosferatu still possesses a tangible\neeriness.",ja="ヴァンピール族「ノスフェラトゥ」の武器。\n"},
    [2621] = {id=2621,en="The solid and well-worn plate\narmguard once donned by the Troll,\nKhromasoul Bhurborlor. As with all troll\narmor, it is far too cumbersome to be\nworn by even the strongest of people.",ja="トロール族「金敷のブーボーロー」のよろい。\n人間には装備不可能。"},
    [2622] = {id=2622,en="An antenna taken from the fallen\nwamoura, Achamoth. This tentacular\nappendage is adept at detecting even\ninvisible and silent prey.",ja="ワモーラ族「アカモート」のマユの一部。\n"},
    [2623] = {id=2623,en="The enormous heart of the dragon,\nAnantaboga. It is still saturated\nthrough and through with foul reptilian\nblood.",ja="ドラゴン族「アナンタボガ」の心臓。\n"},
    [2624] = {id=2624,en="The smoldering remains of the bomb,\nReacton. Despite the passage of time,\nthe cinders retain their immense heat.",ja="ボム族「リアクトン」の燃えカス。\n"},
    [2625] = {id=2625,en="The blubberous flesh of the flan,\nDextrose. It jiggles incessantly, even\nwhen at rest.",ja="フラン族「デクストロース」の肉。\n"},
    [2626] = {id=2626,en="A cutting taken from the elaborate\ncocoon spun by the larval wamoura,\nBrass Borer.",ja="ワモーラ族の幼虫「ブラスボーラー」のマユ。\n"},
    [2627] = {id=2627,en="A tiny blob of gelatinous flesh hacked\nfrom the body of the slime, Claret.",ja="スライム族「クラレット」の小型の分身。\n"},
    [2628] = {id=2628,en="A technologically advanced automaton\narm, salvaged from the dismantled\nremains of Ob.",ja="オートマトン族「オブ」の手。\n"},
    [2629] = {id=2629,en="Cleaved from the ferocious khimaira,\nTyger, this once lethal tail is wielded\nin both whipping and stabbing motions.",ja="キマイラ族「ティガー」の尾。\n"},
    [2630] = {id=2630,en="Too great in power and size to be\nwielded by people, this wicked staff of\nthe soulflayer Mahjlaef the Paintorn is\nno doubt responsible for the deaths of\ncountless adventurers.",ja="ソウルフレア族「惨痛のマジュラエフ」の杖。\n人間には装備不可能。"},
    [2631] = {id=2631,en="Decorative and protective armware of\nExperimental Lamia. It inexplicably\nresists being equipped on the arm of\nany other.",ja="ラミア族「ラミアEX」の腕輪。\n人間には装備不可能。"},
    [2632] = {id=2632,en="The bioluminescent, bulbous sac of\nthe oboron, Nuhn. The light is used to\nattract unsuspecting prey in the dark\ndepths of cold waters.",ja="オロボン族「ヌン」の発光器官。\n"},
    [2633] = {id=2633,en="The severed head of the acrolith,\nWulgaru. It was once animated by a\nmost malicious arcane presence.",ja="アクロリス族「ウルガル」の頭部。\n"},
    [2634] = {id=2634,en="Necklace formerly worn by the qutrub,\nZareehkl the Jubilant. It is not\nsuited to dress the neck of any other individual.",ja="クトゥルブ族「法悦のザリクル」のネックレス。\n人間には装備不可能。"},
    [2635] = {id=2635,en="The detached, fleshy wing of the imp,\nVerdelet. Either by some latent magic,\nor simply remaining nerves, it twitches\nperiodically.",ja="インプ族「ヴェルデレト」の翼。\n"},
    [2636] = {id=2636,en="A shard of blackened bone taken from\nthe remains of the wicked skeleton,\nVelionis.",ja="スケルトン族「ヴェリオニス」の骨片。\n"},
    [2637] = {id=2637,en="A shiny egg laid by Lil' Apkallu. The\npale green hue of the eggshell is an\nunmistakable sign.",ja="アプカル族の珍種「リルアプカル」の卵。\n"},
    [2638] = {id=2638,en="The complete and well-preserved\ncorpse of arguably the rarest member\nof the chigoe family, Chigre.",ja="チゴー族の希少種「チガー」。\n"},
    [2639] = {id=2639,en="This bone of indeterminate origin is hard enough to pass for solid rock. It would be highly difficult to craft.",ja="非常に硬く丈夫な骨。\n加工がし辛い。"},
    [2640] = {id=2640,en="A peculiar spiny protrusion removed from the curious creature known as a murex.",ja="ミュレクスの突起物の一部。\n"},
    [2641] = {id=2641,en="A mass of some unidentifiable organic substance removed from the curious creature known as an amoeban.",ja="アメーバンの一時的突出の一部。\n"},
    [2642] = {id=2642,en="A ninjutsu tool\nused in casting \"Myoshu.\"",ja="忍び道具のひとつ。\n妙手の術に用いられる。"},
    [2643] = {id=2643,en="A ninjutsu tool\nused in casting \"Yurin.\"",ja="忍び道具のひとつ。\n幽林の術に用いられる。"},
    [2644] = {id=2644,en="A ninjutsu tool\nused in casting \"Kakka.\"",ja="忍び道具のひとつ。\n活火の術に用いられる。"},
    [2645] = {id=2645,en="An eastern variety of ginger valued for\nits sharp, refreshing aroma. Believed in\nthe East to possess divine powers of\nprotection, lending to its common\nusage as a design motif in many coats\nof arms.",ja="東方伝来の爽やかな香りのジンジャー。東方では\n神の加護を意味し、紋章のモチーフとされる。"},
    [2646] = {id=2646,en="A fragrant oil rumored to possess\naromas so potent they can alter the\nvery personalities of those who smell\nthem.",ja="性格まで変えてしまうと評判の香油。\n"},
    [2647] = {id=2647,en="A fragrant perfume rumored to possess\naromas so potent they can alter the\nvery personalities of those who smell\nthem.",ja="性格まで変えてしまうと評判の香水。\n"},
    [2648] = {id=2648,en="The striking tips of antlion arrows.",ja="アントリオンアローの先端にとりつけるパーツ。\n"},
    [2649] = {id=2649,en="Colibri feathers that are fitted to the nock end of arrow shafts. They add to the directional stability of arrows in flight.",ja="コリブリの羽根でできた矢のパーツ。\n矢の飛行を安定させる。"},
    [2650] = {id=2650,en="The striking tips of darkling bolts.",ja="ダークネスボルトの先端にとりつけるパーツ。\n"},
    [2651] = {id=2651,en="The striking tips of fusion bolts.",ja="軽合金ボルトの先端にとりつけるパーツ。\n"},
    [2652] = {id=2652,en="The huge headwear of a full-grown\nGigas. Incapable of being equipped by\nany other race, the helmet is designed\nas much for inducing fear in the enemy\nas protecting the head of its wearer.",ja="ギガースが着用する冑。\n人間には装備不可能。"},
    [2653] = {id=2653,en="The massive gauntlets worn by armored\nGigas. Far too large or heavy to be\nworn by people, the lack of skill in\ncraftsmanship is compensated for by\nsheer enormity and ruggedness.",ja="ギガースが着用する篭手。\n人間には装備不可能。"},
    [2654] = {id=2654,en="The twisted and contorted horn\nwrested from the head of Dark Ixion.\nIt emits an alluring yet lackluster shine\nof foreboding blackness.",ja="黒光りするイクシオンの角。\n"},
    [2655] = {id=2655,en="The plush, full tail of Dark Ixion.\nDespite the ominous aura of evil still\nsurrounding the fine hairs, their innate\nbeauty is undeniable.",ja="ふさやかなイクシオンの尾。\n"},
    [2656] = {id=2656,en="A radiant silken thread spun\nof the finest luminian filaments.",ja="芯に輝金を巻きこんだ絹糸。\n"},
    [2657] = {id=2657,en="A fire-resistant cloth that has\nbeen infused with liquid mythril\nfor enhanced flame retardancy.",ja="霊銀でコーティングされた耐火布。\n"},
    [2658] = {id=2658,en="An exquisite silk specimen produced\nonly by crawlers living in mountainous\nregions. The especially fine quality is\nattributed to high altitudes.",ja="山岳部に棲むクロウラーからとった緑色の糸。\n"},
    [2659] = {id=2659,en="A sturdy watch of cotton canvas\nknown predominantly for its use in the\nconstruction of sails for ocean-faring\nvessels.",ja="外洋船の帆に使用されていた厚手の木綿織物。\n"},
    [2660] = {id=2660,en="Durable, flexible wiring used in the\nmanipulation of marionettes and\nvarious other puppets.",ja="かつてマリオネットの操作に用いられていた糸。\n"},
    [2661] = {id=2661,en="A high-quality swatch of ridged velvet,\nthe cords of which run parallel to one\nanother in a vertical pattern.",ja="縦の畝が美しい高級ビロード織物。\n"},
