    [2729] = {id=2729,en="An exotic flower that grows only in\nthe Far East, with leafy petals that\nchange hue from deep blue to a rich\nreddish-violet.",ja="青から赤紫に色が七変化する花。\n東方では「紫陽花」と呼ばれる。"},
    [2730] = {id=2730,en="A cork cap branded with\nthe face of a mandragora.\nA Buffalo Bonanza Ranch exclusive.\nCollect them all!",ja="マンドラゴラが描かれたコルクキャップ。\nBBQ牧場製。"},
    [2731] = {id=2731,en="A cork cap branded with\nthe face of a korrigan.\nA Buffalo Bonanza Ranch exclusive.\nCollect them all!",ja="コリガンが描かれたコルクキャップ。\nBBQ牧場製。"},
    [2732] = {id=2732,en="A cork cap branded with\nthe face of a lycopodium.\nA Buffalo Bonanza Ranch exclusive.\nCollect them all!",ja="リコポディウムが描かれたコルクキャップ。\nBBQ牧場製。"},
    [2733] = {id=2733,en="Enhanced by the power of anima,\nthe toughness of this piece of\nsmilodon leather is unworldly.",ja="アニマによって硬化されたスミロドンの革。\n"},
    [2734] = {id=2734,en="A crumpled square of parchment haphazardly scrawled with a mishmash of unintelligible glyphs. Apparently used by the MMM Revitalization Team to monitor clients' stress levels.",ja="メイズモンガー社で使用されている成績記録表。\n"},
    [2735] = {id=2735,en="A ferrule fashioned from the\ngnarled horn of Dark Ixion.\nLong after being separated from its\nmaster, it continues to pulse and\nthrob with an otherworldly energy.",ja="黒一角獣の角から削り出した矛の石突。\n"},
    [2736] = {id=2736,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for spoils from notorious monsters in Lumoria.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：ルモリアNM戦利品（トルク・羽衣）"},
    [2737] = {id=2737,en="The tough hide of a buffalo\nhas been meticulously napped to\ncreate this silky-smooth fabric.",ja="裏皮を丁寧にけばだてて仕上げた野牛のなめし革。\n"},
    [2738] = {id=2738,en="A card created by the moogles for\nthe Starlight Celebration. When\nopened, you can see twinkling stars.",ja="モーグリが作った星芒祭のカード。\nカードを開けると、ちらちらと星が瞬く仕組み。"},
    [2739] = {id=2739,en="A card created by the moogles for\nthe Starlight Celebration. When\nopened, you can see twinkling stars.",ja="モーグリが作った星芒祭のカード。\nカードを開けると、ちらちらと星が瞬く仕組み。"},
    [2740] = {id=2740,en="A shard of the Seed Crystal recovered\nfrom Jugner Forest. It blazes with the\nblinding radiance of a white-hot sun.",ja="ジャグナー森林に降ったシードストーンの欠片。\nギラギラと光っている。"},
    [2741] = {id=2741,en="A shard of the Seed Crystal recovered\nfrom the Pashhow Marshlands.\nIt shines with the soft luminescence\nof an autumn moon.",ja="パシュハウ沼に降ったシードストーンの欠片。\nキラキラと輝いている。"},
    [2742] = {id=2742,en="A shard of the Seed Crystal recovered\nfrom the Meriphataud Mountains.\nIt twinkles with the glittering splendor\nof a sea of stars.",ja="メリファト山地に降ったシードストーンの欠片。\nチラチラと瞬いている。"},
    [2743] = {id=2743,en="An exquisite orb fashioned from the extremely rare variety of blood-red coral known as oxblood.",ja="真紅の珊瑚から作られた宝珠。\n"},
    [2744] = {id=2744,en="An exquisite orb fashioned from the extremely rare variety of pinkish coral known as angel skin.",ja="薄桃の珊瑚から作られた宝珠。\n"},
    [2745] = {id=2745,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for relic equipment from Dynamis - Beaucedine.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：レリック装束（デュナミス-ボスディン）"},
    [2746] = {id=2746,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for equipment from Dynamis - Xarcabard.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：レリック装束\n（デュナミス-ザルカバード）"},
    [2747] = {id=2747,en="A gargouille's horn, its edge as sharp as tempered steel.",ja="刀剣のように鋭利な縁のガーゴイルの角。\n"},
    [2748] = {id=2748,en="A shank of gargouille flesh, hardened by time into something resembling solid rock.",ja="岩石のように角質化したガーゴイルの肉片。\n"},
    [2749] = {id=2749,en="The lustrous, crystalline eye of a gargouille.",ja="水晶のような結晶質のガーゴイルの眼。\n"},
    [2750] = {id=2750,en="The glossy, scaly hide of an amphiptere.",ja="ギラギラした光沢のあるアンフィプテレの皮。\n"},
    [2751] = {id=2751,en="The rough hide of an amphiptere has been processed into a smooth and sturdy square of leather.",ja="すべすべした肌触りのアンフィプテレのなめし革。\n"},
