    [2759] = {id=2759,en="A traditional adhesive and filling material invented by the Yagudo.",ja="ヤグード伝統の製法で作られた接着・充填剤。\n"},
    [2760] = {id=2760,en="An explosive containing drab, mousy-gray gunpowder, manufactured in the traditional Goblin style.",ja="ゴブリン式に調合された灰色の火薬。\n"},
