    [2768] = {id=2768,en="An acrid-smelling concoction used by synergists to repair defects in various materials. Small in quantity, it appears to be of a very high concentration.",ja="錬成窯で装備品の傷の修復に使われる補修剤。\n内容量は少なめ。"},
    [2769] = {id=2769,en="The pitch-black horn of a buggane, a fearsome ogre summoned by pixies to exact revenge on invaders who threatened their forest home. It glows with an eerie energy.",ja="伝説の刹鬼ボゲードンの黒光りする角。\n"},
    [2770] = {id=2770,en="A magnificent white butterfly with gossamer wings that glisten in the sunlight.",ja="前翅も後翅も輝くような純白の大型蝶。\n"},
