    [2828] = {id=2828,en="The supple yet resilient skin of Herensugue.",ja="分厚い「エレンスゲ」の皮。\n"},
    [2829] = {id=2829,en="This square of velvet is so brilliantly colored as to seem to radiate light.",ja="光り輝いているかのように美しいビロード。\n"},
    [2830] = {id=2830,en="The saber-like cuspid of Bastet, sharp enough to pierce even the toughest-skinned prey.",ja="鋭い「バステト」の牙。\n"},
    [2831] = {id=2831,en="Of higher purity than ordinary brass, this chain shines a brilliant yellow.",ja="銅の比率がやや高い黄銅の鎖。\n"},
