    [2835] = {id=2835,en="Hair from the mane of a dahu. No matter how hard you try to straighten it, it always reverts to a twisted, gnarled state.",ja="細く丈夫な「ダウー」のたてがみ。\n"},
    [2836] = {id=2836,en="A pelage from a giant ram so thick and fluffy it could keep an adventurer warm on even the coldest nights.",ja="状態のよい雄羊の毛皮。\n"},
    [2837] = {id=2837,en="The pelt of the elusive Ratatoskr, sought after by many a hunter.",ja="ふさふさした「ラタトスク」の毛皮。\n"},
    [2838] = {id=2838,en="A piece of cloth so delicate and thin it seems about to fade from existence at any moment.",ja="今にも消えてしまいそうなくらい薄手の木綿布。\n"},
    [2839] = {id=2839,en="The absurdly grotesque skin of the fabled coquecigrue.",ja="幻の「コクシグルー」の皮。\n"},
    [2840] = {id=2840,en="A resplendent yellow topaz of peerless cut and clarity.",ja="透き通った黄色の宝石。\n"},
    [2841] = {id=2841,en="An ingot of silver refined using Quadav smelting techniques.",ja="クゥダフ独自の金属配合で製錬した銀の塊。\n"},
    [2842] = {id=2842,en="A garnet so murky and rough that it resembles little more than a misshapen lump of red stone.",ja="輝きを失いつつあるガーネット。\n"},
    [2843] = {id=2843,en="A particularly elegant square of linen woven by a Fomor.",ja="特に上質な亜麻布。\n"},
    [2844] = {id=2844,en="An ingot of brass with oddly patterned streaks of black that appear to shift like shadows.",ja="やや黒みを帯びたブラスインゴット。\n"},
    [2845] = {id=2845,en="An unnatural-seeming fiber that is curiously resilient given its thin and supple nature.",ja="強靭で衝撃に強く柔軟な繊維。 \n"},
    [2846] = {id=2846,en="An exceptionally heavy and sturdy-looking piece of oak lumber.",ja="大きくがっしりとしたカシの材木。\n"},
    [2847] = {id=2847,en="A jasper of brilliant blue, so rarely seen that many consider it but a myth.",ja="幻と云われる青色の碧玉。\n"},
    [2848] = {id=2848,en="This bronze sheet is so filthy with dirt and grime that it turns the stomach even to touch it.",ja="汚れているブロンズ板。\n"},
    [2849] = {id=2849,en="The sharp, dagger-like talon of a likho.",ja="長く伸びた「リコ」の爪。\n"},
    [2850] = {id=2850,en="An ingot smelted from alluvial gold retrieved by the Sahagin from an ancient river bed.",ja="沖積土に含まれる砂金から作られた金の塊。\n"},
    [2851] = {id=2851,en="The massive and sturdy molar of a rambukk, worn down from chewing large quantities of cud.",ja="雄羊の巨大な臼歯。\n"},
    [2852] = {id=2852,en="A shadowy black ingot smelted by demons in their netherworldly forge.",ja="魔人のあみだした製法による闇の金属。\n"},
    [2853] = {id=2853,en="A hellishly warped mandrel said to have the power to twist its possessor's soul.",ja="魂すら歪めるとまで云われた心金。\n"},
    [2854] = {id=2854,en="This massive shell from a rare species of land crab is so hard it feels like metal to the touch.",ja="まるで金属のように頑丈な陸ガニの甲殻。\n"},
    [2855] = {id=2855,en="The darkest and hardest wood from the center of an ancient mahogany tree.",ja="マホガニーの芯に近い部分の材木。\n"},
    [2856] = {id=2856,en="A bloodstained cloth that belonged to a ghost.",ja="ゴーストが身にまとっていた血のように赤い衣。\n"},
    [2857] = {id=2857,en="A lump of the purest steel, wrought in a manner taught in a land far to the east.",ja="特に質のよい玉鋼。\n"},
    [2858] = {id=2858,en="A highly durable steel, refined through methods long since forgotten.",ja="非常に硬度の高い鋼の一種。\n失われた製法により精錬された。\n"},
    [2859] = {id=2859,en="Ore containing the lustrous metal cobalt. When processed with other metals, it produces a brilliant blue hue.",ja="貴金属のコバルトを含有する鉱石。\n加工の際に不純物として扱われることで\n美しい青色を呈する。\n"},
    [2860] = {id=2860,en="Metallic in appearance and slick to the touch, this mineral is used to harness and channel the power of lightning.",ja="炭素からなる黒色の鉱物。\n雷のエネルギーとの相性が良いことでも知られる。"},
    [2861] = {id=2861,en="The years have not been kind to this Ephramadian talisman. An image of the Dark Rider embossed on its surface is barely distinguishable.",ja="冥路の騎士を渇仰していたイフラマドの戦士の\nおまもり。長い年月を経て古色を帯びている。"},
    [2862] = {id=2862,en="This otherwise nondescript gray stone glows with a faint blue light that feels somehow familiar...",ja="ほのかな青みがかった光を放っている小石。\nどこか見覚えのある光なのだが……。\n"},
