    [2874] = {id=2874,en="This delicate scale from the wing of a pixie glows with a soothing light. It is said to have curative powers.",ja="ピクシー族の羽根から得た淡い光を放つ鱗粉。\n特殊な薬品と混合することで治癒効果を発揮する。"},
    [2875] = {id=2875,en="A delicate scale from the wing of a pixie, so thin and tenuous as to be almost imperceptible.",ja="ピクシー族の羽根から得た鱗粉。\n"},
    [2876] = {id=2876,en="This ingot of pure gold is coated in a viscous, slimy substance that clings tenaciously to its surface.",ja="粘液でねばねばしている金の塊。\n"},
    [2877] = {id=2877,en="Years spent in the possession of baleful monsters have lent an ill-boding glint to this once-pure precious metal.",ja="魔物の不浄な力で汚れ、その輝きを失った銀の塊。\n"},
    [2878] = {id=2878,en="Luxurious and smooth to the touch, this fabric is such a deep red as to make one wonder if it were dyed with blood.",ja="血に染まったような緋色をしているが、\n肌触りのよい布。\n"},
    [2879] = {id=2879,en="Jagged to the touch, this barnacle from the shell of the massive Krabkatoa is coated with a layer of hardened magma.",ja="クラブ族「クラブカタウ」の隆起した甲殻から\n剥離した欠片。\n"},
    [2880] = {id=2880,en="A tawny crystalline stone recovered from the body of the antlion Orcus, quite beautiful despite its unpleasant origin.",ja="アントリオン族「オルクス」の体内から出てきた\n小石。\n"},
    [2881] = {id=2881,en="A brilliant, flawless gem of otherworldly beauty that was a treasured possession of Verthandi.",ja="ピクシー族「ヴェルザンディ」が身に着けていた\n装飾品についていた宝石。\n"},
    [2882] = {id=2882,en="A smallish globule of red slime split off from Blobdingnag. If left alone, will it grow to the size of its parent...?",ja="巨大なクロット「ブロブディンナグ」の\n小型の分身。\n"},
    [2883] = {id=2883,en="The dagger-like fingernail of the fearsome vampyr Lord Ruthven, still specked with the blood of one of his unfortunate victims.",ja="ヴァンピール族「ルスベン」の鋭い指爪。\n"},
    [2884] = {id=2884,en="The massive, still-smoldering shell of the gargantuan Krabkatoa, as solid and durable as a slab of volcanic rock.",ja="クラブ族「クラブカタウ」の甲殻。\n通常のクラブ族のものよりも硬質性に優れる。\n"},
    [2885] = {id=2885,en="The imposing mandible of the mammoth antlion Orcus, suited to instantaneously crushing the life out of unwitting prey.",ja="アントリオン族「オルクス」の巨大なアゴ。\n"},
    [2886] = {id=2886,en="The excess mold growth on this shabby-looking ingot makes it impossible to discern what sort of metal it originally was.",ja="腐食が進み、朽ち果てた金属の塊。\nもはや何の金属か分からない。\n"},
    [2887] = {id=2887,en="A decaying ingot of some indeterminate metal that feels as if it is about to crumble to dust in your hand.",ja="ひび割れ、ぼろぼろになった金属の塊。\nもはや何の金属か分からない。\n"},
    [2888] = {id=2888,en="A translucent mass of tissue found protruding from the body of certain vorageans. Though slightly cracked, it retains a vivid scarlet hue.",ja="「ヴォラジアン」の体表面にみられる組織。\n生命活動の終息とともに小さな亀裂が入るが、\n血のように赤い美しさは保たれている。"},
    [2889] = {id=2889,en="The spiny pincer of a limule.",ja="リミュルの脚の一部。\n"},
    [2890] = {id=2890,en="The delicate, translucent wing of a clionid.",ja="クリオニッドの翼足の一部。\n"},
    [2891] = {id=2891,en="The withered husk of a dead chigoe.",ja="干乾びたチゴーの死骸。\n"},
    [2892] = {id=2892,en="This bloody slab of ram meat exudes an overpowering raw odor.",ja="とても生臭い大羊の肉。\n"},
    [2893] = {id=2893,en="The oversized fang of a gargantuan species of black tiger.",ja="異常に伸びた黒虎の犬歯。\n"},
    [2894] = {id=2894,en="A shield claimed by a Gigas off the body of a particularly renowned adventurer it slew.",ja="ギガースが腰に吊るしている盾。\n元は勝利し、認めた人間の持ち物。"},
    [2895] = {id=2895,en="This oversized sock of a Gigas reeks of blood and sweat. Far too large (and rancid) to be worn except by Gigas.",ja="特に大きなギガースの靴下。\n長期間履き続けたため強烈な臭いがする。\n人間には装備不可能。"},
    [2896] = {id=2896,en="A weighted armband used by Gigas in building their hulking muscles. Far too heavy to be worn except by Gigas.",ja="とても重いギガースの腕輪。\n一説にはギガースの鍛錬のひとつだと云う。\n人間には装備不可能。"},
    [2897] = {id=2897,en="An insect wing so transparent as to be almost invisible to the eye.",ja="日に翳すと見えなくなるくらい透通った虫の翅。\n"},
    [2898] = {id=2898,en="A pitch-black scale that seems to smother the light around it.",ja="光を吸収する性質のある鱗粉。\n"},
    [2899] = {id=2899,en="Puk eggs laid in winter, such as this one, are said to be particularly rich in nutrients.",ja="特に栄養のあるプークの卵。\n"},
    [2900] = {id=2900,en="This hole-ridden hat of a Poroggo appears to have provided a meal for many an insect. Only Poroggos can equip it.",ja="小さな穴のあいたポロッゴハット。\n人間には装備不可能。"},
    [2901] = {id=2901,en="A particularly large and earthy agaricus mushroom.",ja="大きく育ったアガリクス。\n"},
    [2902] = {id=2902,en="This massive gnole claw is caked with dirt and grime.",ja="とりわけ汚いノールの鉤爪。\n"},
    [2903] = {id=2903,en="Blood from an eft, said to be so vile that even leeches steer clear of it.",ja="リーチ族にもあまり好まれないエフトの血液。\n"},
    [2904] = {id=2904,en="The long, slimy eyestalk of a giant slug.",ja="異常に長いスラッグの眼。\n"},
    [2905] = {id=2905,en="A gossamer astral fabric that glows only under the light of the moon. Far too delicate to use in crafting.",ja="月光下でのみ発光するアストラル物質の布。\n非常にもろく、加工は不可能。"},
    [2906] = {id=2906,en="An eyeball from a treant that has begun to decompose.",ja="朽ちかけているトレントの球根。\n"},
    [2907] = {id=2907,en="A curiously small morbol vine.",ja="小さなモルボルのつる。\n"},
    [2908] = {id=2908,en="A poisonous fungus said to wipe clean the memory of any who eats it. Not suitable for consumption.",ja="食べると我を忘れてしまうといわれるキノコ。\n食用には適さない。"},
    [2909] = {id=2909,en="A curious mottled moss that had been growing from the back of a goobbue.",ja="グゥーブーの背に寄生する珍しい苔。\n蛇の体表のように見える。"},
    [2910] = {id=2910,en="The massive horn of a wivre, of fearsome size and sharpness.",ja="鋭く尖ったウィヴルの角。\n"},
    [2911] = {id=2911,en="A skin that appears to have been savagely ripped from the body of the eft it once belonged to.",ja="ちぎれたエフトの皮の断片。\n"},
    [2912] = {id=2912,en="The particularly gargantuan tusk of a bugard.",ja="特に大きなブガードの牙。\n"},
    [2913] = {id=2913,en="A murky lens from the eye of an Ahriman.",ja="曇ってしまったアーリマンのレンズ。\n"},
    [2914] = {id=2914,en="A small globule rumored to be the soul of a deep sea creature. Place it by your ear, and you can hear the sound of a murmuring stream...",ja="水生生物の魂と云われる小さな塊。\nそっと耳に近づけるとせぜらきが聞こえる。"},
    [2915] = {id=2915,en="A particularly durable clionid wing.",ja="状態のよいクリオニッドの翼足。\n"},
    [2916] = {id=2916,en="A particularly sharp limule pincer.",ja="状態のよいリミュルの鋏脚。\n"},
    [2917] = {id=2917,en="The bloodshot eyeball of a hecteyes.",ja="充血しているヘクトアイズの眼球。\n"},
    [2918] = {id=2918,en="The cursed skull of a corpselight.",ja="呪いを振りまくコープスライトの頭骨。\n"},
    [2919] = {id=2919,en="The fang of a bat, flecked with fresh blood.",ja="新しい血の付いているコウモリの牙。\n"},
    [2920] = {id=2920,en="The strong alkaline concentration of this humus renders it highly unsuitable for gardening.",ja="アルカリ性が強く通常の栽培には適さない腐葉土。\n"},
    [2921] = {id=2921,en="Still dripping with potent venom, this scorpion stinger must be handled with care.",ja="特に毒性の強い大サソリの針。\n"},
    [2922] = {id=2922,en="In spite of (or perhaps because of?) the slight sulphurous odor it exudes, eft eggs such as this one are considered a delicacy.",ja="美味で知られるエフトの卵。\n"},
    [2923] = {id=2923,en="Meat from the tail of a cockatrice. Stringy and flavorless, it is quite unpopular among culinarians.",ja="淡味で知られるコカトリスの尾の肉。\n"},
    [2924] = {id=2924,en="This whisker cut from the face of a coeurl pulsates with energy in your hand.",ja="クァールから切り取られたヒゲ。\n帯電しておりビリビリとしびれる。"},
    [2925] = {id=2925,en="A particularly pliant and durable manticore mane.",ja="特に弾力のあるマンティコアのたてがみ。\n"},
    [2926] = {id=2926,en="A fragment of some unidentifiable organic substance that emits a faint moaning sound.",ja="「嘆くもの」の断片。\n"},
    [2927] = {id=2927,en="The massive shell of a glavoid.",ja="「グラヴォイド」の巨大な殻。\n"},
    [2928] = {id=2928,en="An oversized flower from the crown of a chloris.",ja="「クロリス」の頭に生えている巨大な芽。\n"},
    [2929] = {id=2929,en="An imposing helm that once guarded the head of the legendary Gigas Briareus. Only wearable by Gigas.",ja="伝説のギガース族「ブリアレオス」が着用していた冑。人間には装備不可能。"},
    [2930] = {id=2930,en="A small yet tasteful gem that belonged to the evil pixie queen Carabosse.",ja="「カラボス」が持っていた小さな宝石。\n"},
    [2931] = {id=2931,en="A thick, foul-smelling liquid expelled from a fistule.",ja="「フィスチュル」から抽出した体液。\n"},
    [2932] = {id=2932,en="The massive fang of Kukulkan, capable of impaling a knight clean through his armor.",ja="「ククルカン」の巨大な毒棘。\n"},
    [2933] = {id=2933,en="Laid by Chukwa, this egg is several orders of magnitude larger than a typical adamantoise egg.",ja="巨亀「チュクワ」の卵。\n通常のアダマンタスの卵に比べて明らかに大きい。"},
    [2934] = {id=2934,en="The oversized necklet of a manananggal. An incantation of warding prevents any but its original owner from equipping it.",ja="「マナナンガル」の大きなネックレス。\n人間には装備不可能。"},
    [2935] = {id=2935,en="The ratty, flea-ridden pelage of Mangy-tailed Marvin.",ja="ウサギ族「古尾のマーヴィン」の毛皮。\n"},
    [2936] = {id=2936,en="A dagger-like stinger harvested from the body of a chasmic hornet.",ja="「カズミックホーネット」から切り取られた針。\n"},
    [2937] = {id=2937,en="The giant vine of a raskovnik.",ja="「ラスコヴニク」の巨大なつる。\n"},
    [2938] = {id=2938,en="A wing clipped from the imp lord Bakka.",ja="インプ族「バッカ」から切り取られた翼。\n"},
    [2939] = {id=2939,en="The fearsome horn of the legendary serpent Cuelebre.",ja="「クエレブレ」の見事な角。\n"},
    [2940] = {id=2940,en="The dark robes worn by the necromancer Mictlantecuhtli while performing his dark rituals. Not wearable by living beings.",ja="「ミクトランテクトリ」が着用していた衣。\n人間には装備不可能。"},
    [2941] = {id=2941,en="A pamama purloined from the possession of the fruit-fancying Keesha Poppo.",ja="オポオポ族「キーシャポッポ」が持っていた\nパママ。"},
    [2942] = {id=2942,en="A hefty silver nugget removed from the stomach of Megamaw Mikey. Likely the cause of a mega-serious case of indigestion.",ja="ワーム族「大口のマイキー」の飲み込んでいた\n大きな銀鉱。"},
    [2943] = {id=2943,en="The ghastly skull of a balaur wyvern.",ja="ワイバーン族「バラウル」の頭骨。\n"},
    [2944] = {id=2944,en="Once carried by a Tonberry Lieje, this lantern still burns with an ominous, hateful light.",ja="「リージェ」が持っていたランタン。\n"},
    [2945] = {id=2945,en="The wing of a clionid, now shriveled from excess exposure to the air.",ja="乾燥し萎れてしまったクリオニッドの翼足。\n"},
    [2946] = {id=2946,en="The pincer of a limule, now tarnished from excess exposure to the air.",ja="乾燥し萎れてしまったリミュルの鋏脚。\n"},
    [2947] = {id=2947,en="This corpselight skull has been cleansed of the curse that once resided in it.",ja="呪いの鎮められたコープスライトの頭骨。\n"},
    [2948] = {id=2948,en="Mildly acidic in composition, this humus is well suited for gardening.",ja="弱酸性の栽培に適した腐葉土。\n"},
    [2949] = {id=2949,en="This eft egg seems about to hatch at any moment...",ja="今にも孵化しそうなエフトの卵。\n"},
    [2950] = {id=2950,en="Drained of electricity, this coeurl whisker is soft and smooth to the touch.",ja="帯電質が抜けてふさふさになったクァールの髭。\n"},
    [2951] = {id=2951,en="This spectacular green-colored mineral shimmers brilliantly even in dim light.",ja="美しい緑色の鉱物。\n"},
    [2952] = {id=2952,en="A gaseous substance that acts to temporarily disperse miasmas.",ja="瘴気を一時的に中和する薬剤。\n"},
    [2953] = {id=2953,en="A slimy substance expectorated by a rare species of arachnid. Can be used as an adhesive.",ja="蜘蛛の吐き出した粘液。\n接着剤の替わりに使われるほど強力。"},
    [2954] = {id=2954,en="A small casket of gunpowder. Dampened from time spent underwater, it is likely unusable in its current state.",ja="火薬の入った小型の箱。\n水底に沈んでいたため、今も使えるかは不明。"},
    [2955] = {id=2955,en="An elaborate crest belonging to the uppermost nobility of the Kindred.",ja="闇の血族が用いると伝えられる印影。\n一部の上位階級の血族が所有する。"},
    [2956] = {id=2956,en="Surreal, nightmarish patterns adorn this crest, symbolizing a Kindred house of the purest lineage.",ja="闇の血族が用いると伝えられる印影。\n貴族階級の血族により受け継がれてきた貴重なもの。"},
    [2957] = {id=2957,en="The demonically frightful patterns etched into this crest skillfully convey the power possessed by the unholiest of Kindred houses.",ja="闇の血族が用いると伝えられる印影。\n公爵階級の血族により受け継がれてきた\n貴重なもの。"},
    [2958] = {id=2958,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for level 85 empyrean weapons.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：エンピリアンウェポン（Lv85）"},
    [2959] = {id=2959,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for job-specific Dynamis accessories.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：ジョブ専用アクセサリ（デュナミス）"},
