    [3064] = {id=3064,en="An ether in an ornate bottle.\nThe gaudy label features a stately\nportrait of Goldagrik alongside the\nfamiliar Moblin Maze Mongers emblem.",ja="見事に調合された「ＭＭＭエーテル」。\n"},
    [3065] = {id=3065,en="This elixir has been prepared by the\nfinest Moblin alchemists in Movalpolos.\nAn elaborate label bearing a stylized\nvariant of the Moblin Maze Mongers\nemblem adorns the elegantly curved\nvial.",ja="見事に調合された「ＭＭＭエリクサー」。\n"},
    [3066] = {id=3066,en="A bowl of thin, watered-down soup.\nA crudely drawn Moblin Maze Mongers\nemblem is imprinted at the base.",ja="メイズモンガー社の社章が器に描かれた汁物。\n"},
    [3067] = {id=3067,en="A stale and lightly burnt pie with a\nhard crust, decorated with a\nnearly indistinguishable Moblin\nMaze Mongers emblem.",ja="メイズモンガー社の社章が器に描かれた焼き菓子。\n"},
    [3068] = {id=3068,en="A rock-hard, crusty, and decidedly\nunappetizing loaf of bread.\nThe Moblin Maze Mongers emblem\ncarelessly impressed into the crust is\nbarely recognizable.",ja="メイズモンガー社の社章の焼印があるパン。\n"},
    [3069] = {id=3069,en="Prepared by the finest Moblin chefs\nin Movalpolos, this hearty soup gives\noff a rich aroma of exotic spices.",ja="見事に煮込まれた「ＭＭＭスープ」。\n"},
    [3070] = {id=3070,en="Prepared by the finest Moblin bakers\nin Movalpolos, this tasty pie features\na filling of fresh fruit and a\nscrumptious cinnamon crust.",ja="見事に焼き上げられた「ＭＭＭパイ」。\n"},
    [3071] = {id=3071,en="A loaf of mouthwatering bread\nprepared by the finest Moblin bakers\nin Movalpolos. The crust is skillfully\ndecorated with a stylized variant of\nthe Moblin Maze Mongers emblem.",ja="見事に焼き上げられた「ＭＭＭパン」。\n"},
    [3072] = {id=3072,en="The withered cocoon of a wamoura.",ja="乾いてしまったワモーラの繭。\n"},
    [3073] = {id=3073,en="The oversized egg of an eruca.",ja="エルカの大きな卵。\n"},
    [3074] = {id=3074,en="A small lump of silver that has lost some of its lustre.",ja="やや白みがかった小さな銀の鉱石。\n"},
    [3075] = {id=3075,en="This repulsive gunk continues to bubble and squirm long after being separated from the doomed that excreted it.",ja="ドゥームが分泌する粘液。\n"},
    [3076] = {id=3076,en="Cracked and chipped bones of various size, shape, and origin.",ja="ひび割れて砕けている骨くず。\n"},
    [3077] = {id=3077,en="When you rest your ear on these tattered garments, you can hear a tortured scream in the distance…",ja="うらみの声が聞こえてきそうなボロボロの衣。\n"},
    [3078] = {id=3078,en="A massive force must have been required to cause this sturdy scale of a dragon to crack.",ja="ひびの入ったドラゴンのウロコ。\n"},
    [3079] = {id=3079,en="This scorpion pincer is caked with the blood of its prey.",ja="獲物の血がついたままのサソリの爪。\n"},
    [3080] = {id=3080,en="The fully extended eyestalk of a slug, doomed never to return to its retracted state.",ja="伸びきってしまったスラッグの眼。\n"},
    [3081] = {id=3081,en="This round cut of thigh meat from a coeurl is laced with fat and gristle.",ja="少し脂ののったクァールの肉。\n"},
    [3082] = {id=3082,en="Separated from the mandragora it sprouted from, it looks about to crumble into dust at any moment.",ja="今にも枯れそうなマンドラゴラの芽。\n"},
    [3083] = {id=3083,en="The cockatrice this skin was taken from clearly did not go down without a fight…",ja="暴れて傷だらけになったコカトリスの皮。\n"},
    [3084] = {id=3084,en="The thick root of an ancient treant.",ja="大きく育ったトレントの根。\n"},
    [3085] = {id=3085,en="The ensorcelled tusk of a bugard.",ja="まじないに使われるというブガードの牙。\n"},
    [3086] = {id=3086,en="Scraps from the shedded molt of a lizard.",ja="脱皮したトカゲの皮の切れ端。\n"},
    [3087] = {id=3087,en="These underfeathers of an apkallu are soft and warm to the touch.",ja="保温効果の高いアプカルの羽。\n"},
    [3088] = {id=3088,en="A large feather that allows birds to control their flight path in strong wind.",ja="鳥の翼に生えている小さな風切羽。\n"},
    [3089] = {id=3089,en="The rare cheekmeat of an orobon, considered a delicacy.",ja="貴重なオロボンの頬肉。\n"},
    [3090] = {id=3090,en="A plate of some indeterminate metal, retrieved from a deactivated spheroid.",ja="スフィアロイドから剥がれ落ちた金属板。\n"},
    [3091] = {id=3091,en="The frozen, hardened skin of a raptor.",ja="凍って硬くなったラプトルの皮。\n"},
    [3092] = {id=3092,en="The beak of a colibri said to have the ability to mimic adventurers' voices.",ja="冒険者の声を真似るというコリブリのくちばし。\n"},
    [3093] = {id=3093,en="This piece of land crab meat is of perfect quality. So perfect, in fact, that it would be unthinkable to eat it.",ja="状態のよい陸ガニの肉。\n"},
    [3094] = {id=3094,en="A chunk of rock salt of the highest grade and quality.",ja="状態のよい岩塩。\n"},
    [3095] = {id=3095,en="This hole-ridden mandragora bud has clearly served as a feast for many a famished worm.",ja="穴のあいているマンドラゴラの芽。\n"},
    [3096] = {id=3096,en="An attractive spotted pattern adorns this giant flytrap leaf.",ja="斑入りのフライトラップの葉。\n"},
    [3097] = {id=3097,en="The tail of a black rabbit, said to serve as a warding talisman.",ja="魔除けにも使われる黒兎の尻尾。\n"},
    [3098] = {id=3098,en="The balefully gnarled horn of a taurus.",ja="不気味に歪んだタウルスの角。\n"},
    [3099] = {id=3099,en="A hunk of flesh from a gargouille that has hardened to the point that it is indistinguishable from actual stone. ",ja="特に角質化の進んだガーゴイルの肉片。\nまるで硬い石のようだと云われる。"},
    [3100] = {id=3100,en="A rare clam said to open its shell only when the light of the moon shines upon it.",ja="月の満ち欠けに誘われて開くという二枚貝。\n"},
    [3101] = {id=3101,en="The skull of a corpselight that seems to have caught a hefty blow to its head.",ja="衝撃で歪んだコープスライトの頭骨。\n"},
    [3102] = {id=3102,en="This tentacle has stiffened after the death of the soulflayer it was once attached to.",ja="動きが止まり固まったソウルフレアの触手。\n"},
    [3103] = {id=3103,en="Other than its jet-black color, this feline whisker is entirely unremarkable.",ja="希少なスミロドンがもつと云われる漆黒のヒゲ。\n妖しい艶を帯びている。"},
    [3104] = {id=3104,en="The murky-colored wing of some unnatural beast.",ja="くすんで透明度が失われた合成獣の羽根。\n"},
    [3105] = {id=3105,en="This red wing of a ladybug is said to bring good luck to he who finds it.",ja="幸運を呼ぶというレディバグの赤い羽根。\n"},
    [3106] = {id=3106,en="The smoldering ashes of a now-extinguished djinn.",ja="粉々になったジンの燃えカス。\n"},
    [3107] = {id=3107,en="A poisonous mushroom said to send a paralyzing shock through the body if consumed.",ja="食べると体を痺れさせるキノコ。\n食用には適さない。"},
    [3108] = {id=3108,en="A small stone removed from the stomach of a crawler. Can be used as pumice.",ja="クロウラーの腸内で時折見つかる小石。\n軽石として利用されている。"},
    [3109] = {id=3109,en="The particularly sturdy hide of a rabbit.",ja="状態のよい野兎の毛皮。\n"},
    [3110] = {id=3110,en="A musty slip of parchment, worn and faded with the years. Faintly visible is the image of a piece of armor, annotated with elaborately scribed glyphs of a long-lost tongue.",ja="衣服の型が書かれた紙。\n脇の空白部分に細かく製法が書き留められている。"},
