    [3210] = {id=3210,en="A peculiar translucent stone that refracts light, making objects seen through it appear bright and clear.",ja="緑色の小さな石。\n"},
    [3211] = {id=3211,en="A palm-sized coin of a curious transparent metal.",ja="緑色の小さな金属板。\n"},
    [3212] = {id=3212,en="A shimmering jewel of perfect cut and clarity.",ja="緑色の小さな宝玉。\n"},
    [3213] = {id=3213,en="A timeworn card bearing an exquisitely illustrated depiction of a far-seeing eye.",ja="緑色を基調とした絵が描かれたカード。\n"},
    [3214] = {id=3214,en="Holding this small crimson stone in your hand, you feel a gentle warmth well up from within you.",ja="紅色の小さな石。\n"},
    [3215] = {id=3215,en="A palm-sized coin embossed with the mark of a burning heart.",ja="紅色の小さな金属板。\n"},
    [3216] = {id=3216,en="The red hues of this jewel blaze and surge like the flames of passion.",ja="紅色の小さな宝玉。\n"},
    [3217] = {id=3217,en="A timeworn card bearing an exquisite illustration of a raging flame.",ja="紅色を基調とした絵が描かれたカード。\n"},
    [3218] = {id=3218,en="Taking this stone into hand, you can feel your arm move more freely.",ja="黄色の小さな石。\n"},
    [3219] = {id=3219,en="A palm-sized coin emblazoned with the mark of a hand gripping a blade.",ja="黄色の小さな金属板。\n"},
    [3220] = {id=3220,en="The amber hues of this jewel swish and swirl unconstrained.",ja="黄色の小さな宝玉。\n"},
    [3221] = {id=3221,en="A timeworn card bearing an exquisite illustration of a whirling sword.",ja="黄色を基調とした絵が描かれたカード。\n"},
    [3222] = {id=3222,en="A sturdy stone that, when placed on the ground, can curiously not be moved from either side.",ja="白色の小さな石。\n"},
    [3223] = {id=3223,en="A peculiar coin that, when flipped, will always alternate heads and tails.",ja="白色の小さな金属板。\n"},
    [3224] = {id=3224,en="A beautiful translucent jewel of perfectly symmetrical cut.",ja="白色の小さな宝玉。\n"},
    [3225] = {id=3225,en="A timeworn card bearing an exquisitely illustrated depiction of a weighing scale.",ja="白色を基調とした絵が描かれたカード。\n"},
    [3226] = {id=3226,en="Taking this stone into hand, you can feel the wind blowing at your back.",ja="黒色の小さな石。\n"},
    [3227] = {id=3227,en="A palm-sized coin embossed with the mark of a ship with billowing sails.",ja="黒色の小さな金属板。\n"},
    [3228] = {id=3228,en="The blue hues of this jewel ebb and flow like the ocean tides.",ja="黒色の小さな宝玉。\n"},
    [3229] = {id=3229,en="A timeworn card bearing an exquisitely illustrated depiction of a striding man.",ja="黒色を基調とした絵が描かれたカード。\n"},
    [3230] = {id=3230,en="A shimmering liquid metal extracted from the doll Tablilla.",ja="ドール族「タブリーラ」から採取された液体金属。\n"},
    [3231] = {id=3231,en="The rugged hide of the manticore Sharabha.",ja="マンティコア族「シャラブハ」の毛皮。\n"},
    [3232] = {id=3232,en="The regally colored hide of the fell tiger Ansherekh.",ja="スミロドン「アンシェレク」の毛皮。\n"},
    [3233] = {id=3233,en="A pungent liquid extracted from a slain vadleany, its role of driving away would-be foes unfulfilled.",ja="レディバグ族「ヴァドレアニ」から採取された体液。\n強烈な苦みで天敵から身を守っている。"},
    [3234] = {id=3234,en="A precious bottle of pure water from a desert oasis, carried by the fearsome Bugul Noz.",ja="パキポディウム「ブグル・ノッズ」が持っていた水。\n"},
    [3235] = {id=3235,en="Desert sand clings to the surface of this shattered doll fragment.",ja="破壊されたドールから採取された砂まみれの破片。\n"},
    [3236] = {id=3236,en="This arm of a bomb still steams and smolders despite having been long since severed from its master.",ja="いまだ火の消えないボムのうで。\n"},
    [3237] = {id=3237,en="This oversized manticore fang is caked with such a thick layer of sand that its original shape and color is impossible to discern.",ja="砂に埋もれたマンティコアの犬歯。\n"},
    [3238] = {id=3238,en="A particularly durable dhalmel hide.",ja="状態のよいダルメルの毛皮。\n"},
    [3239] = {id=3239,en="The blood of an unnaturally bred puk, said to impel anyone who drinks it to dance uncontrollably.",ja="合成獣プークの血液。\n口にしたものは操り人形のように踊り続けるという。"},
    [3240] = {id=3240,en="A particularly durable cockatrice skin.",ja="状態のよいコカトリスの皮。\n"},
    [3241] = {id=3241,en="A broad, thick-veined leaf that had been stuck to the back of an unaware ladybug.",ja="レディバグに付着していた葉の一部。\n"},
    [3242] = {id=3242,en="A particularly sharp scorpion claw.",ja="状態のよい大サソリの爪。\n"},
    [3243] = {id=3243,en="A variety of desert clay with a high sand content.",ja="砂が多く養分の少ない土。\n"},
    [3244] = {id=3244,en="A parasitic plant so tenacious that it is known to strangle the life out of even the mightiest oaks.",ja="寄生した大木を枯らすほどに育った木の枝。\n"},
    [3245] = {id=3245,en="A massive, jagged-toothed gear of bronze that powered the mighty Koghatu.",ja="アクロリス族「コガトゥ」の動力伝達に用いられる黄金の歯車。\n"},
    [3246] = {id=3246,en="This condensed soul of the fearsome Upas-Kamuy burns with a chill blue flame.",ja="巨大なスノール族「ウパシカムイ」の凍える魂。\n"},
    [3247] = {id=3247,en="A fragment of debris claimed off the shattered body of the golem Sisyphus.",ja="ゴーレム族「シーシュポス」から採取された破片。\n"},
    [3248] = {id=3248,en="The frost-covered wing of the notorious imp Chillwing Whitti.",ja="放たれる風が氷のように冷たいという、\nインプ族「ホウィッティ」の翼。"},
    [3249] = {id=3249,en="The rough hide of the bovine audumbla.",ja="バッファロー族「アウズンブラ」の毛皮。\n"},
    [3250] = {id=3250,en="A curved metallic gear that once powered a mighty acrolith.",ja="アクロリスの動力伝達に用いられる霊銀の歯車。\n"},
    [3251] = {id=3251,en="A peculiar, oil-like substance that will not freeze in even the coldest temperatures.",ja="寒冷地でも凍ることのないギア族の体液。\n"},
    [3252] = {id=3252,en="The arm of a snoll, so stingingly cold that holding it in one's bare hand will inflict an almost instant case of frostbite.",ja="肌をさす冷気が漂ってくるスノールのうで。\n"},
    [3253] = {id=3253,en="A particularly durable marid hide.",ja="状態のよいマーリドの毛皮。\n"},
    [3254] = {id=3254,en="This wyvern scale is as chill as ice to the touch.",ja="氷のように冷たいワイバーンのウロコ。\n"},
    [3255] = {id=3255,en="A rich clay-like substance excreted from the body of an entozoon.",ja="エントゾアンが排出した栄養価に優れた土。\n"},
    [3256] = {id=3256,en="A compact horn employed by imp sentries to warn their masters of potential interlopers.",ja="インプの斥候が連絡用に携帯している角笛。\n通常のものよりも小型。"},
    [3257] = {id=3257,en="This clouded eye of a benumbed vodoriga stares at you with a soulless, empty gaze.",ja="水晶のような結晶質のヴォドリガの眼。\n"},
    [3258] = {id=3258,en="A particularly large and sturdy buffalo horn.",ja="状態のよいバッファローの角。\n"},
    [3259] = {id=3259,en="The particularly rugged and sleek hide of a black tiger.",ja="状態のよい黒虎の毛皮。\n"},
    [3260] = {id=3260,en="The shattered fragment of the Teekesselchen.",ja="マジックポット族「ティーケッセルチェン」から採取された破片。\n"},
    [3261] = {id=3261,en="The abnormally hard skull of the wyvern Minaruja.",ja="飛竜には珍しく頑丈なミナルジャの頭骨。\n"},
    [3262] = {id=3262,en="The almost-weightless yet highly durable wing of the peapuk Jaculus.",ja="非常に軽量なピープーク「ジャキュルス」の羽根。\n"},
    [3263] = {id=3263,en="A wispy lock of hair from the pixie Lorelei, whose haunting song is said to have beckoned many an adventurer to an untimely demise.",ja="ピクシー族「ローレライ」の澄んだ毛髪。\n"},
