    [3544] = {id=3544,en="A delicate gossamer fabric hailing from a land far to the west. Named for a beautiful maiden of myth who lovingly weaved a fabric over the course of years while faithfully awaiting her husband's return from war.",ja="長い年月をかけ繰り返し織られた丈夫な布。\n西方の国から伝来したもの。"},
