    [3549] = {id=3549,en="A viscous liquid extracted from the stem of a belladonna, its sweet smell conceals a highly lethal poison. Said to take on remarkable medicinal properties if processed correctly.",ja="ベラドンナから抽出した希少な体液。\n強い毒性をもつが、薬品としても扱われる。"},
    [3550] = {id=3550,en="An unusual thread said to resemble the mythical thread of fate.",ja="運命を紡ぐと云われる美しい糸。\n"},
