    [3942] = {id=3942,en="An interesting specimen of creature that resembles a chapuli. Though normally associated with death and destruction, this type of beast possesses a certain organ which aids in flushing out poisons.",ja="ウルブカ大陸に適応したバッタ。\n体内で毒を浄化する器官をもつ。"},
    [3943] = {id=3943,en="Chapuli wings that are fitted \nto the nock end of arrow shafts. \nThey add to the directional stability \nof arrows in flight.",ja="チャプリの翅でできた矢のパーツ。\n矢の飛行を安定させる。"},
    [3944] = {id=3944,en="The striking tips of chapuli wing arrows.",ja="チャプリアローの先端にとりつけるパーツ。\n"},
    [3945] = {id=3945,en="The striking tips of midrium bolts.",ja="ミドリウムボルトの先端にとりつけるパーツ。\n"},
    [3946] = {id=3946,en="The striking tips of mantid foreleg arrows.",ja="マンティッドアローの先端にとりつけるパーツ。\n"},
    [3947] = {id=3947,en="The striking tips of damascus bolts.",ja="ダマスクボルトの先端にとりつけるパーツ。\n"},
    [3948] = {id=3948,en="Tulfaire feathers that are fitted \nto the nock end of arrow shafts. \nThey add to the directional stability \nof arrows in flight.",ja="トゥルフェイアの羽でできた矢のパーツ。\n矢の飛行を安定させる。"},
    [3949] = {id=3949,en="The striking tips of titanium bolts.",ja="チタンボルトの先端にとりつけるパーツ。 "},
    [3950] = {id=3950,en="The wing of a black twitherym that flutters within the deepest recesses of otherworldly skirmishes. Its breathtaking beauty often causes pioneers to forget themselves and stare into its velvet sheen for minutes on end.",ja="スカームの奥深くに棲むトウィザリムの綺麗な\n黒翅。"},
