    [3957] = {id=3957,en="Developed by the Inventors' Coalition, this sorcerous lubricant brings out the true power of certain pieces of equipment.",ja="インベンター・ワークスが開発した特定の\n装備の性能を引き出す潤滑剤。"},
    [3958] = {id=3958,en="This mineral-rich soil taken from the Yahse Hunting Grounds is as nutritious as it is natural.",ja="ヤッセの狩り場で採れる栄養豊富な腐葉土。\n"},
    [3959] = {id=3959,en="Meat sliced efficiently from the body of one of the Zoldeff River's tastiest inhabitants--the Delectable Orobon.",ja="ゾルデフ川に生息するデレックタブル・オロボンの肉。\n"},
    [3960] = {id=3960,en="This stony hunk of a petrified tree contains flecks of a substance that emits an unsettlingly spectral green glow.",ja="珪化した原木のユグ石。\n緑色に輝く成分を含んでいる。"},
    [3961] = {id=3961,en="This stony hunk of a petrified tree contains flecks of a substance that emits an unsettlingly spectral blue glow.",ja="珪化した原木のユグ石。\n青色に輝く成分を含んでいる。"},
    [3962] = {id=3962,en="This stony hunk of a petrified tree contains flecks of a substance that emits an unsettlingly spectral red glow.",ja="珪化した原木のユグ石。\n赤色に輝く成分を含んでいる。"},
    [3963] = {id=3963,en="Midrium forged into a sheet.",ja="ミドリウムの板。\n"},
    [3964] = {id=3964,en="Rhodium forged into a sheet.",ja="ロジウムの板。\n"},
    [3965] = {id=3965,en="A type of seaweed that is often harvested along the shores of the Ulbukan continent.",ja="ウルブカ大陸近海でよく採れる海藻。\n"},
    [3966] = {id=3966,en="Glasses used in the process of measuring soul pyres.",ja="ソウルパイヤーを計測するためのメガネ。\n"},
    [3967] = {id=3967,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for spoils from bosses in Delve.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：メナスインスペクター戦利品\n（ボスNM防具）"},
    [3968] = {id=3968,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for spoils from notorious monsters in Delve.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：メナスインスペクター戦利品（NM防具）"},
    [3969] = {id=3969,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for Salvge +1 armor.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：サルベージ戦利品（+1防具）"},
    [3970] = {id=3970,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).Tradeable for armor from Nyzul Isle Uncharted Survey.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：ナイズル島未開領域踏査指令戦利品\n（防具）"},
    [3971] = {id=3971,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for rank V simulacra segments.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：スタチューセグメントV"},
    [3972] = {id=3972,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for rank II simulacra segments.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：スタチューセグメントII"},
    [3973] = {id=3973,en="A prize redemption coupon from the Mog Bonanza event. Issued by the Mog House Management Union (MHMU).\nTradeable for orchestrion sheet music.",ja="モグハウス管理組合発行の引換券。\n様々な品と交換できる。\n引換アイテム：オーケストリオン譜"},
    [3974] = {id=3974,en="This mystical and magical solution may be as intangible as the air itself, but it still draws out immense powers that lay dormant within certain pieces of equipment.",ja="空気のように軽い魔法の液体。\n特定の装備に秘められた力を引き出す。"},
    [3975] = {id=3975,en="This mystical and magical solution may be as intangible as the air itself, but it still draws out immense powers that lay dormant within certain pieces of equipment.",ja="空気のように軽い魔法の液体。\n特定の装備に秘められた力を大きく引き出す。"},
    [3976] = {id=3976,en="This mystical and magical solution may be as intangible as the air itself, but it still draws out immense powers that lay dormant within certain pieces of equipment.",ja="空気のように軽い魔法の液体。\n特定の装備に秘められた力をとても大きく引き出す。"},
    [3977] = {id=3977,en="The mafic horn of a culled gabbrath that remains doused in the blood of the countless pioneers unfortunate enough to be impaled upon it.",ja="幾人もの開拓者を貫いたギャブラスの角。\n"},
    [3978] = {id=3978,en="A rigid dorsal fin with a surprisingly clean and soft shape. It once belonged to a rockfin before the beast was fished up from the depths of the unknown. ",ja="大きく形の整ったロックフィンの背鰭。\n"},
    [3979] = {id=3979,en="Sharper than the most finely whetted blade, this rockfin tooth can slice through an unwary pioneer's fingers in an instant.",ja="欠けることのないロックフィンの鋭歯。\n"},
    [3980] = {id=3980,en="Once attached to the abdomen of an enraged bztavian, this stinger would make even the winds retreat in fear when thrust.",ja="風を貫くバズテヴィアの針。\n"},
    [3981] = {id=3981,en="This wing ripped forcefully from the back of a bztavian would cause roaring gales to erupt whenever flapped.",ja="風を切るバズテヴィアの翅。\n"},
    [3982] = {id=3982,en="That this seed will produce vegetation is known. Where the seed came from, however, is not.",ja="どこかの森の草木が取れる種。\n"},
    [3983] = {id=3983,en="That this seed will spring forth fruit is known. Where the seed came from, however, is not.",ja="どこかの森の果実が取れる種。\n"},
    [3984] = {id=3984,en="A pouch containing the seeds of a golden yellow flower.",ja="黄色の花の種が入った袋。\n"},
    [3985] = {id=3985,en="Viscous, noxious drool scraped from the mouth of a massive insect that slobbers uncontrollably. Slathering it on mineral veins attracts antlions.",ja="巨大な羽虫から採取できる刺激臭のする液体。 \n鉱脈に掛けるとアントリオン族が好む匂いがする。"},
    [3986] = {id=3986,en="A fragrant fluid that releases an odor many insects crave. Placing it in an arboreal grove makes it possible to harvest beetles occasionally.",ja="虫が好む香りを放つ樹液。\n木立から甲虫族が採集できることがある。"},
    [3988] = {id=3988,en="A long and lithe slimy slitherer that enriches the soil wherever it tunnels.\nIncreases the yield of crops from a furrow.",ja="土壌を綺麗にするワーム。\n畑の収穫量が増える。"},
    [3989] = {id=3989,en="This humus apparently has no official origin, as scholars have yet to ascertain its native habitat.\nReduces the length of a furrow's grow season.",ja="どこかの森の腐葉土。\n畑の収穫時間を短縮する。"},
    [3990] = {id=3990,en="This spectacular example of humus was released upon Ulbuka by the Inventors' Coalition after months of careful research, which have paid off in spades. Occasionally produces strange and wondrous harvests.",ja="インベンター・ワークスが開発した腐葉土。\n珍しい物を収穫できることがある。"},
    [3991] = {id=3991,en="A long and lithe slimy slitherer that enriches the soil wherever it tunnels.\nIncreases the bounty obtained from a grove.",ja="土壌を綺麗にするワーム。\n木立の収穫量が増える。"},
    [3992] = {id=3992,en="This specialized mulch works even in the unforgiving Ulbukan soil, keeping the trees growing straight and strong.\nOccasionally increases the number of times one can log a grove.",ja="立木の成長を促す培養土。\n木立の伐採回数が増えることがある。"},
    [3993] = {id=3993,en="Cuttings from trees nestled in an unspecified forest somewhere in Vana'diel.\nEnables lumber to be more easily procured from groves.",ja="どこかの森林の樹木の添え木。\n木立から原木が得やすくなる。"},
    [3994] = {id=3994,en="This thick and viscous nectar emits an aroma so enticing that many pioneers begin to slaver simply at the thought of tasting it.\nAllows insects to be more easily procured from groves.",ja="甘い香りがする蜜。\n木立から虫が得やすくなる。"},
    [3995] = {id=3995,en="This spectacular example of fertilizer was released upon Ulbuka by the Inventors' Coalition after months of careful research, which have paid off in spades.\nOccasionally allows for strange and wondrous finds to flourish in a grove.",ja="インベンター・ワークスが開発した液体肥料。\n珍しい物を収集できることがある。"},
    [3996] = {id=3996,en="A solution that magically softens the surface of mineral veins and primes them for mining.\nIncreases the yield of a vein when mined.",ja="鉱脈を柔らかくする魔法の液体。\n鉱脈の収穫量が増える。"},
    [3997] = {id=3997,en="A solution that magically stiffens the surface of mineral veins, which keeps them from degrading quickly.\nOccasionally increases the number of times a vein can be mined.",ja="鉱脈を硬くさせる魔法の油。\n鉱脈の採掘回数が増えることがある。"},
    [3998] = {id=3998,en="A solution that transmogrifies the surface of mineral veins, completely changing their composition.\nAllows for precious metals to be more easily procured while mining.",ja="鉱脈を変化させる魔法の油。\n鉱脈から貴金属が得やすくなる。"},
    [3999] = {id=3999,en="A solution that transmogrifies the surface of mineral veins, completely changing their composition.\nAllows for metals to be more easily procured while mining.",ja="鉱脈を変化させる魔法の油。\n鉱脈から金属が得やすくなる。"},
    [4000] = {id=4000,en="This spectacular example of a serum was released upon Ulbuka by the Inventors' Coalition after months of careful research, which have paid off in spades.\nOccasionally allows for strange and wondrous finds to flourish when mining.",ja="インベンター・ワークスが開発した魔法の油。\n珍しい物を採掘できることがある。"},
    [4001] = {id=4001,en="A ball of ground sardine mixed with grains specifically added to attract fish inhabiting freshwater lakes and ponds.",ja="池に餌を撒いて魚をおびき寄せる。\n"},
    [4002] = {id=4002,en="A ball of ground bass mixed with grains specifically added to attract fish inhabiting freshwater lakes and ponds.",ja="池に餌を撒いて魚をおびき寄せる。\n"},
    [4003] = {id=4003,en="A ball of ground shrimp mixed with grains specifically added to attract fish inhabiting freshwater lakes and ponds.",ja="池に餌を撒いて魚をおびき寄せる。\n"},
    [4004] = {id=4004,en="A ball of ground mincemeat mixed with grains specifically added to attract fish inhabiting freshwater lakes and ponds.",ja="池に餌を撒いて魚をおびき寄せる。\n"},
    [4005] = {id=4005,en="This spectacular example of rolled bait was released upon Ulbuka by the Inventors' Coalition after months of careful research, which have paid off in spades.\nOccasionally allows for strange and wondrous catches when fishing in freshwater.",ja="インベンター・ワークスが開発した特製練り餌。\n珍しい淡水魚がかかることがある。"},
    [4006] = {id=4006,en="A sack of mangled sardine mixed with grains specifically added to attract saltwater fish.",ja="海に餌を撒いて魚をおびき寄せる。\n"},
    [4007] = {id=4007,en="A sack of mangled bass mixed with grains specifically added to attract saltwater fish.",ja="海に餌を撒いて魚をおびき寄せる。\n"},
    [4008] = {id=4008,en="A sack of mangled shrimp mixed with grains specifically added to attract saltwater fish.",ja="海に餌を撒いて魚をおびき寄せる。\n"},
    [4009] = {id=4009,en="A sack of mincemeat slapped together and mixed with grains specifically added to attract saltwater fish.",ja="海に餌を撒いて魚をおびき寄せる。\n"},
    [4010] = {id=4010,en="This spectacular example of chum was released upon Ulbuka by the Inventors' Coalition after months of careful research, which have paid off in spades.\nOccasionally allows for strange and wondrous catches when fishing in saltwater.",ja="インベンター・ワークスが開発した特製の撒き餌。\n珍しい海水魚がかかることがある。"},
    [4011] = {id=4011,en="This spectacular example of a catalytic enzyme was released upon Ulbuka by the Inventors' Coalition after months of careful research, which have paid off in spades.\nMakes crops harvestable in almost no time.",ja="インベンター・ワークスが開発した畑用の\n不思議な液体肥料。\nすぐに収穫できるようになる。"},
    [4012] = {id=4012,en="Though this beak was already torn violently from the head of a conquered waktza, lightning still crackles and darts around it, temporarily paralyzing any who dare to touch its dagger-blade surface.",ja="帯電しているワクタザのくちばし。\n"},
    [4013] = {id=4013,en="Once crowning the head of a proud waktza, this delicately soft feather belies the ferocity of its former master. Due to its difficulty to obtain, many fortunate enough to get their hands upon one employ it as a good luck charm.",ja="ワクタザの頭に生えている希少な羽毛。\n手にした者に富をもたらすと云われる。"},
    [4014] = {id=4014,en="This sturdy trunk hacked free of a yggdreant after a flurry of agonizing attempts puts the fear of the forest into each and every pioneer who dares steal even a glimpse at it.",ja="不気味なイグドリアの胴体の一部。\n"},
    [4015] = {id=4015,en="This knotted and gnarled root, chopped from the base of a fallen yggdreant, is rumored to bestow everlasting life upon those who boil it in their tea.",ja="幻のイグドリアの根。\n煎じて飲むと不老長寿になると云われる。"},
    [4016] = {id=4016,en="A tulfaire pinion feather.",ja="トゥルフェイアの風切羽。 \n"},
    [4017] = {id=4017,en="The verdant, two-leafed shoot that emerges from the heads of all mandragoras. Contemporary researchers proffer that its leaves capture sunlight and convert it into a sort of nourishment.",ja="大きな二枚葉のマンドラゴラの芽。 \nマンドラゴラの頭に生えて、光合成をしている芽。"},
    [4018] = {id=4018,en="A rough-cut log of guatambu timber.",ja="未加工のパウマルフィンの材木。\n"},
    [4019] = {id=4019,en="Processed guatambu lumber.",ja="パウマルフィンの材木。\n"},
