    [4021] = {id=4021,en="An ingot of smelted titanium.",ja="製錬したチタニウムの塊。 "},
    [4022] = {id=4022,en="Titanium forged into a sheet.",ja="チタニウムの板。"},
    [4023] = {id=4023,en="This ore contains the precious metal snowsteel.",ja="貴金属の重白銀を含有する鉱石。"},
    [4024] = {id=4024,en="A refined mass of snowsteel.",ja="精錬した重白銀のかたまり。"},
    [4025] = {id=4025,en="Snowsteel forged into a sheet.",ja="重白銀の板。\n"},
    [4026] = {id=4026,en="A grass common throughout the Ulbukan continent.\nFiber taken from its stem is used as\na material for akaso thread.",ja="ウルブカ大陸に分布する草。\n赤い色素を多く含む繊維が採れる。"},
    [4027] = {id=4027,en="Thread spun from akaso fiber.",ja="赤麻の繊維をつむいだ糸。\n"},
    [4028] = {id=4028,en="Cloth woven from akaso fiber thread.",ja="赤麻糸を編んで作った布。 \n"},
    [4029] = {id=4029,en="This jet-black cloth contains the faintest remains of runic sorcery woven into its fabric.",ja="微かな魔導力を放つ漆黒の布。\n"},
    [4030] = {id=4030,en="Originating from a country in the Far East, this blood red and pitch black coating, made from the sap of the lacquer tree, is often used on wooden crafts.",ja="ラッカー樹液から作られた東方風の赤い塗料。 \n木製品等のコーティングに用いられる。 "},
    [4031] = {id=4031,en="The digestive juices that rest inside a snapweed's mouth and trap whatever prey is unfortunate enough to wander inside.",ja="スナップウィードの消化液。\n"},
    [4032] = {id=4032,en="The still-twitching and vine-like limb of a snapweed.",ja="スナップウィードのつる。\n"},
