    [4034] = {id=4034,en="Cold to the touch, this sickly green stone is as ghoulishly powerful as it is frigid.",ja="力を秘めた冷たい石。 \n"},
    [4035] = {id=4035,en="Cold to the touch, this sickly green stone is as ghoulishly powerful as it is frigid.",ja="力を秘めた冷たい石。 \n"},
    [4036] = {id=4036,en="The wing of a black twitherym that flutters within the deepest recesses of otherworldly skirmishes. Its inconceivably dark color often reminds pioneers how pathetically miniscule they are in the grand scheme of things.",ja="スカームの奥深くに棲むトウィザリムの大きな\n黒翅。"},
