    [4039] = {id=4039,en="A head segment of a weathered and cryptic simulacrum found lying amidst the wilderness of Eastern Ulbuka.",ja="強い魔力を秘めている古い人形の頭のパーツ。\nスタチューセグメントと呼ばれ、\n東ウルブカ各地に散らばっている。"},
    [4040] = {id=4040,en="A head segment of a weathered and cryptic simulacrum found lying amidst the wilderness of Eastern Ulbuka.",ja="強い魔力を秘めている古い人形の頭のパーツ。\nスタチューセグメントと呼ばれ、\n東ウルブカ各地に散らばっている。"},
