    [4042] = {id=4042,en="This ore developed incalculable veins of enigmatic sorcerous minerals while gestating in the stomach of an acuex.",ja="アクエフの体内で魔力を帯びた鉱石。\n"},
    [4043] = {id=4043,en="A resplendent jewel streaked with slowly snaking lines of magma.",ja="マグマの熱を帯びた宝石。\n"},
    [4044] = {id=4044,en="Its inky slick appearance and metallic lustre are but two clues to the subterranean powers this rock harbors, such as mitigating the forces of water.",ja="炭素からなる黒色の鉱物。\n水の力で魔を退けると云われている。"},
    [4045] = {id=4045,en="Forcefully shorn from its stem by tempestuous winds that churn with the power of the heavens, this bulb of cotton came from locales unknown.",ja="風に運ばれた綿花。\n"},
    [4046] = {id=4046,en="Dyed a bleeding red hue from various chemical reactions, this craggy and porous mass of minerals has an appearance so miserable that not even a miner could commiserate with it.",ja="毒の影響で赤く変色し、ボロボロになった石。\n"},
    [4047] = {id=4047,en="An extremely strong and incredibly durable thread of silk harvested from erucas that slink about the crevasses of Yorcia Weald.",ja="ヨルシアに棲むエルカから採れる丈夫な絹糸。\n"},
    [4048] = {id=4048,en="Speckled with bumps around its eyes, this fish can be found in the rivers and lakes of the Ulbukan continent's archipelago. Many marine life maniacs, including the Green Thumb Moogle, covet this precious fish.",ja="ウルブカ諸島に生息する美しい淡水魚。\n目の周りのコブが特徴で\nアドゥリンでは観賞用として珍重される。\n「グリーンサム・モーグリ」が興味を持っている\nようだが……。"},
    [4049] = {id=4049,en="An ancient piece of currency from the east, hauled in from the depths of the ocean and coated with a heavy layer of rust. Coin collectors like the Green Thumb Moogle may find this of interest.",ja="海中から引き上げられた、錆びついた東方の通貨。\n「グリーンサム・モーグリ」が興味を持っている\nようだが……。"},
    [4050] = {id=4050,en="So rotund that it would hardly fit in a Meeble's mouth, this rare specimen of burrow worm is prized by not only the burrow diggers themselves, but by the Green Thumb Moogle as well.",ja="ミーブル族が好んで食べる極太のワーム。\n稀にしか捕れないため重宝されている。\n「グリーンサム・モーグリ」が興味を持っている\nようだが……。"},
    [4051] = {id=4051,en="This mystical solution is inexplicably absorbed by myriad metals, which seems to be how it draws out the immense powers that lay dormant within certain pieces of equipment.",ja="金属に吸収される不思議な液体。\n装備の秘められた力を引き出す。 "},
    [4052] = {id=4052,en="This mystical solution is inexplicably absorbed by myriad metals, which seems to be how it draws out the immense powers that lay dormant within certain pieces of equipment.",ja="金属に吸収される不思議な液体。\n装備の秘められた力を大きく引き出す。 "},
    [4053] = {id=4053,en="This mystical solution is inexplicably absorbed by myriad metals, which seems to be how it draws out the immense powers that lay dormant within certain pieces of equipment.",ja="金属に吸収される不思議な液体。\n装備の秘められた力をとても大きく引き出す。 "},
    [4054] = {id=4054,en="The crystallized soul of a beetle as black as midnight. It squirms so incessantly within its mineral prison that it emits a palpable warmth.",ja="温かさを感じるクリスタルの塊。\n魔物の魂が宿っている。"},
    [4055] = {id=4055,en="The crystallized soul of an antlion as black as midnight. It squirms so incessantly within its mineral prison that it emits a palpable warmth.",ja="温かさを感じるクリスタルの塊。\n魔物の魂が宿っている。"},
    [4056] = {id=4056,en="The crystallized soul of a pachypodium as black as midnight. It squirms so incessantly within its mineral prison that it emits a palpable warmth.",ja="温かさを感じるクリスタルの塊。\n魔物の魂が宿っている。"},
    [4057] = {id=4057,en="A frigid crystalline mass, stones of this type occasionally contain pellucid gems that create dazzling displays of light.",ja="透明の宝石を含んでいることがある石。 \n"},
    [4058] = {id=4058,en="Dizzying numbers of veins containing the mineral bismuth crisscross the interior of this ore.",ja="金属の蒼鉛を含有する鉱石。\n"},
    [4059] = {id=4059,en="This naturally annealed conglomeration was formed from magma that once coursed through deep subterranean channels.",ja="長い年月を掛けて固まったマグマの岩石。\n"},
    [4060] = {id=4060,en="This somber hunk of ore contains an extremely rare type of iron that rumors say will revolutionize the smithing process.",ja="希少な鉄の一種の金属を含有する鉱石。 \n"},
    [4061] = {id=4061,en="A shiny, jet-black gemstone wrested from the abyssal depths of an unexplored crevasse.",ja="狭間より現じた黒い玉石。 \n"},
    [4062] = {id=4062,en="A gem so solid that dropping it from a fair height supposedly leaves fissures in the immediate area.",ja="非常に硬そうに見える宝珠。\n"},
    [4063] = {id=4063,en="A gem so solid that dropping it from a fair height supposedly leaves fissures in the earth for malms.",ja="非常に硬そうに見える宝珠。\n"},
    [4064] = {id=4064,en="The first chapter of ten in the saga of an ordinary man named Rem. The kingdom is fraught with chaos, as a long-ruling king collapses. His death engenders a terrible power struggle, from which Rem miraculously emerges the victor.",ja="全十章からなる物語の第一章。\n王の死から物語が始まる。"},
    [4065] = {id=4065,en="The second chapter of ten in the saga of an ordinary man named Rem. In it, the leader of a neighboring empire takes advantage of Rem's inexperience and invades his homeland.",ja="全十章からなる物語の第二章。\n隣国との戦争が始まる。"},
    [4066] = {id=4066,en="The third chapter of ten in the saga of an ordinary man named Rem. In it, Rem's kingdom is unceremoniously routed by the invaders and annexed to their territory.",ja="全十章からなる物語の第三章。\n戦争に敗北してしまう。"},
    [4067] = {id=4067,en="The fourth chapter of ten in the saga of an ordinary man named Rem. In it, Rem is stripped of his crown and imprisoned within his own palace's oubliette.",ja="全十章からなる物語の第四章。\n王位を失脚し塔の地下に幽閉される。"},
    [4068] = {id=4068,en="The fifth chapter of ten in the saga of an ordinary man named Rem. In it, the protagonist struggles to maintain his sanity while locked in what is ostensibly a granite-lined hole for a full decade.",ja="全十章からなる物語の第五章。\n幽閉されて10年の歳月が経つ。"},
    [4069] = {id=4069,en="The sixth chapter of ten in the saga of an ordinary man named Rem. In it, a rowdy band of vagabonds who long for the good old days of Rem's rule slips into the oubliette under the cover of darkness and saves him in his eleventh year of imprisonmen",ja="全十章からなる物語の第六章。\n11年目でレジスタンスが救出にくる。"},
    [4070] = {id=4070,en="The seventh chapter of ten in the saga of an ordinary man named Rem. In it, news of Rem's rescue rings throughout the land and galvanizes the masses to stand up in resistance to the neighboring tyrant.",ja="全十章からなる物語の第七章。\nレジスタンスの希望となる。"},
    [4071] = {id=4071,en="The eighth chapter of ten in the saga of an ordinary man named Rem. In it, the hefty number of resistance fighters rise up against their oppressive foreign king.",ja="全十章からなる物語の第八章。\nレジスタンスと王政の戦争が始まる。"},
    [4072] = {id=4072,en="The ninth chapter of ten in the saga of an ordinary man named Rem. In it, the resistance movement succeeds against all odds. The well-trained phalanxes of infantry from the neighboring kingdom lie battered and defeated outside the castle gates.",ja="全十章からなる物語の第九章。\n民衆を味方につけ王政に勝利する。"},
    [4073] = {id=4073,en="The final chapter of ten in the saga of an ordinary man named Rem. In it, the crown is returned to Rem thirteen years after the whole ordeal began. Everyone lives happily ever after under his fair and just rule.",ja="全十章からなる物語の終章。\n失脚して13年後に王位に戻る。"},
    [4074] = {id=4074,en="The crystallized remains of suspended thought memories, they contain a faint trace of life.",ja="「想うもの」の記憶の断片と\nわずかな生気が結晶化したもの。\n"},
    [4075] = {id=4075,en="The crystallized remains of suspended hope memories, they contain a faint trace of life.",ja="「願うもの」の記憶の断片と\nわずかな生気が結晶化したもの。\n"},
    [4076] = {id=4076,en="The crystallized remains of suspended fulfillment memories, they contain a faint trace of life.",ja="「満たすもの」の記憶の断片と\nわずかな生気が結晶化したもの。\n"},
    [4077] = {id=4077,en="This tama-hagane was refined in Reisenjima and shines with seven colors when struck by the moon's light. The technique for refining it has been lost to eternity.",ja="醴泉島で製錬された玉鋼。\n月の光にあてると七色に光る。\n製錬する技法は失われている……。\n"},
    [4078] = {id=4078,en="This fabric was woven in Reisenjima and shines with seven colors when struck by the moon's light. The technique for weaving it has been lost to eternity.",ja="醴泉島で織られた布。\n月の光にあてると七色に光る。\n織る技法は失われている……。\n"},
    [4079] = {id=4079,en="This leather was made in Reisenjima and shines with seven colors when struck by the moon's light. The technique for making it has been lost to eternity.",ja="醴泉島で加工された革。\n月の光にあてると七色に光る。\n加工する技法は失われている……。\n"},
    [4080] = {id=4080,en="This paint was mixed in Reisenjima and shines with seven colors when struck by the moon's light. The technique for mixing it has been lost to eternity.",ja="醴泉島で作られた塗料。\n月の光にあてると七色に光る。\n作る技法は失われている……。\n"},
    [4081] = {id=4081,en="This gem was polished in Reisenjima and shines with seven colors when struck by the moon's light. The technique for polishing it has been lost to eternity.",ja="醴泉島で磨かれた宝石。\n月の光にあてると七色に光る。\n研磨する技法は失われている……。\n"},
    [4082] = {id=4082,en="This coral from Reisenjima gives off a warm and soft light.",ja="醴泉島で生息していた珊瑚のかけら。\nやわらかい光を放っている。\n"},
    [4083] = {id=4083,en="The striking tips of beryllium arrows.\n",ja="ベリリムアローの先端にとりつけるパーツ。\n"},
    [4084] = {id=4084,en="A mixture of porxie wings and\nchapuli wings that are fitted\nto the nock end of arrow shafts.\nThey add to the directional stability\nof arrows in flight.",ja="ポークシーの翅とチャプリの翅を\n混合させてできた矢のパーツ。\n矢の飛行を安定させる。"},
    [4085] = {id=4085,en="The striking tips of beryllium bolts.\n",ja="ベリリムボルトの先端にとりつけるパーツ。 "},
    [4094] = {id=4094,en="The epitome of soups everywhere, this stew was cooked in the year 880. The longer it ages, the better it tastes, but most Goblins cannot bear to leave it sitting for more than a few minutes before their appetites get the best of them.",ja="C.E.880年頃に作成されたゴブリン風シチュー。\nゴブリン垂涎の一品。"},
