    [4165] = {id=4165,en="This lubricant cuts down 99.99% of\nall friction. When applied, it can\nnearly erase all noise emitted from\na person or object.",ja="極限まで摩擦を無くす潤滑油。\n塗布した者に消音効果を与える。"},
