    [4284] = {id=4284,en="The slow-cooked mutton in this\nnavarin will simply melt in your mouth.\nHP+3% (Max.130) STR+3\nVIT+1 AGI+1 INT-1\nAttack+27% (Max.35)\nRanged Attack+27% (Max.35)\nEvasion+5",ja="やわらかく煮込んだナヴァラン。\nHP+3% (最大130) STR+3 VIT+1 AGI+1\nINT-1 攻+27% (最大35) 飛攻+27% (最大35)\n回避+5"},
    [4285] = {id=4285,en="If you love the ocean, then you'll love\nthe mouthwatering flavor of this\nmagnificent shark fin soup.\nHP+5% (Max. 150) MP+5 DEX+4\nAttack+14% (Max. 90)\nRanged Attack+14% (Max. 90)\nHP recovered while healing +9",ja="美味しくできたフカヒレスープ。\nHP+5% (最大150) MP+5 DEX+4\n攻+14% (最大90) 飛攻+14% (最大90)\nヒーリングHP+9"},
