    [4860] = {id=4860,en="BLM Lv.45 / DRK Lv.37\nTeaches the black magic Stun.\nTemporarily prevents an enemy from acting.",ja="使用制限:黒Lv45 暗Lv37\n黒魔法『スタン』が記されたスクロール。\n効果:敵を短時間行動不能にする。"},
