    [4862] = {id=4862,en="BLM Lv.4 / RDM Lv.8 \nTeaches the black magic Blind.\nBlinds an enemy, lowers its accuracy.",ja="使用制限:黒Lv4 赤Lv8 \n黒魔法『ブライン』が記されたスクロール。\n効果:敵を「暗闇」状態にする。"},
