    [4866] = {id=4866,en="BLM Lv.7 / RDM Lv.11 / DRK Lv.20\nTeaches the black magic Bind.\nBinds an enemy in place, immobilizing it.",ja="使用制限:黒Lv7 赤Lv11 暗Lv20\n黒魔法『バインド』が記されたスクロール。\n効果:敵を「束縛」状態にする。"},
