    [4868] = {id=4868,en="RDM Lv.32\nSCH Lv.32 (Addendum: Black)\nTeaches the black magic Dispel.\nRemoves one beneficial magic effect from an enemy.",ja="使用制限:赤Lv32 学Lv32（黒の補遺時のみ）\n黒魔法『ディスペル』が記されたスクロール。\n効果:敵の魔法効果を1つ消し去る。"},
    [4869] = {id=4869,en="BLM Lv.17 \nTeaches the black magic Warp.\nTransports you to your home point.",ja="使用制限:黒Lv17 \n黒魔法『デジョン』が記されたスクロール。\n効果:自身をホームポイントへ飛ばす。"},
