    [5104] = {id=5104,en="RDM Lv.48\nTeaches the white magic Flurry.\nIncreases target's ranged attack speed.",ja="使用制限:赤Lv48 \n白魔法『スナップ』が記されたスクロール。\n効果:標的の遠隔攻撃間隔を短くする。"},
    [5105] = {id=5105,en="RDM Lv.96\nTeaches the white magic Flurry II.\nIncreases target's ranged attack speed.",ja="使用制限:赤Lv96 \n白魔法『スナップII』が記されたスクロール。\n効果:標的の遠隔攻撃間隔を短くする。"},
    [5106] = {id=5106,en="RDM Lv.64\nTeaches the white magic Inundation. Grants a bonus to skillchain damage based on the number of weaponskill weapon types used on the target.",ja="使用制限:赤Lv64 \n白魔法『イナンデーション』が記されたスクロール。\n効果:標的に異なる種別の武器のウェポンスキルを使用すると、連携ダメージアップ。"},
    [5109] = {id=5109,en="A hempen sack, worn and frayed by time. It bears an image of a refined stone that resembles a lush forest.",ja="『緑霊石+1』が入った小袋。"},
    [5110] = {id=5110,en="A hempen sack, worn and frayed by time. It bears an image of a refined stone that resembles a lush forest.",ja="『緑霊石+2』が入った小袋。"},
    [5111] = {id=5111,en="A hempen sack, worn and frayed by time. It bears an image of a refined stone that resembles a decomposing corpse.",ja="『白霊石+1』が入った小袋。"},
    [5112] = {id=5112,en="A hempen sack, worn and frayed by time. It bears an image of a refined stone that resembles a decomposing corpse.",ja="『白霊石+2』が入った小袋。"},
    [5113] = {id=5113,en="An indehiscent fruit with a fractured shell.",ja="ひび割れた硬い殻の木の実。\n"},
    [5114] = {id=5114,en="An especially tart rolanberry smothered in insect saliva to preserve its freshness.",ja="蟲の唾液で防腐処理されたロランベリー。 \n"},
    [5115] = {id=5115,en="Moko grass that has been left in sorry shape after being devoured by voracious insects.",ja="何かの蟲に食われて欠けているモコ草。\n"},
    [5116] = {id=5116,en="A worm that wiggles and flourishes so joyfully that it almost seems to be smiling.",ja="元気よくねじれて動いているワーム。\n"},
    [5117] = {id=5117,en="Every granule of this strange powder clings to one's body with almost palpable desperation.",ja="粉末が体にまとわりついてくる不思議な石粉。\n"},
    [5118] = {id=5118,en="A rather small example of toads' favorite treat.",ja="トード族が大好きな小さなゴカイ。\n"},
    [5119] = {id=5119,en="A tome bursting at the spine with drills as numerous as they are rigorous.",ja="厳しい訓練内容が記された本。\n"},
    [5120] = {id=5120,en="Feared by sailors and pirates alike,\nthis giant sea monster has been known\nto tear apart ships with its razor-sharp\nteeth.",ja="船を沈めると恐れられる、伝説の巨大海水魚。\n"},
    [5121] = {id=5121,en="This tropical fish makes its home\namong the coral of the Maliyakaleya\nReef. The Tarutaru love to keep them\nas pets.",ja="マリヤカレヤリーフに生息する、美しい海水魚。\nウィンダスでは観賞用として珍重される。"},
    [5122] = {id=5122,en="This echinoderm is found all over\nBibiki Bay. While edible, you will\nnot find any gracing the menu\nof a four-star restaurant.",ja="ビビキー湾の浅海に生息する、極彩色の棘皮動物。\n食用だが、あまり美味しくない。"},
    [5123] = {id=5123,en="This bivalve shellfish lives in the\nsands of Bibiki Bay. It scares away\npredators by shooting out of its\nshell like a rocket.",ja="ビビキー湾の砂浜に生息する二枚貝。\n驚くと、ピョンッと巣穴から飛び上がる。"},
    [5124] = {id=5124,en="This bivalve shellfish lives in the\nsands of Bibiki Bay. Recently, excess\ngathering has led to a decline in their\nnumbers.",ja="ビビキー湾の砂浜に生息する二枚貝。\n非常に美味だが、個体数は少ない。"},
    [5125] = {id=5125,en="This green amphibian is found only in\nthe Phanauet Channel.",ja="ファノエ運河にのみ生息する緑色のイモリ。\n"},
    [5126] = {id=5126,en="A tiny newt is found only in the\nPhanauet Channel. It is easily\nrecognizable by its large outer gills.",ja="ファノエ運河に生息する小さなイモリ。\n水中に入ると、大きなエラが飛び出す。"},
    [5127] = {id=5127,en="A mythical reptile said to roam the\nseven seas.",ja="伝説の長大な海生ハ虫類。\n"},
    [5128] = {id=5128,en="This variety of squid is known for its\ncone-shaped body.",ja="尖った殻が特徴的な頭足類。\n"},
    [5129] = {id=5129,en="A fabled freshwater fish, legendary for\nits enormous length.",ja="伝説の長大な淡水魚。\n"},
    [5130] = {id=5130,en="A freshwater fish found in the rivers\nof the Tavnazian Archipelago. It is\neasily recognized by its orange and\nsilver stripes.",ja="旧タブナジア領の川底に生息する淡水魚。\n体色はオレンジとシルバーの鮮やかなストライプ。"},
    [5131] = {id=5131,en="This bivalve shellfish found in the\nwaters around Purgonorgo Isle is\nknown for its exquisite flavor.",ja="プルゴノルゴ島に生息する二枚貝の固有種。\nたいへん美味。"},
    [5132] = {id=5132,en="This saltwater fish lives in the\nGugru Blue.\nIt can fly in the air, but only for\na short time.",ja="ググリュー洋に生息する海水魚。\n短時間だが飛行できる。"},
    [5133] = {id=5133,en="This giant arthropod is also known as\na \"sea scorpion.\"",ja="「海のサソリ」と呼ばれる巨大節足動物。\n"},
    [5134] = {id=5134,en="Legends say that this enormous\nsaltwater fish has rescued shipwreck\nvictims at sea.",ja="遭難者を助けたという伝説もある巨大海水魚。\n"},
    [5135] = {id=5135,en="This enormous saltwater fish has a\nswordlike tusk growing from its head.",ja="剣のような吻を備えた巨大海水魚。\n"},
    [5136] = {id=5136,en="This saltwater fish inhabits the reefs\nof the Arrapago Islands.\nIts fins are extremely poisonous.",ja="アラパゴ諸島の岩礁に生息する海水魚。\nヒレに猛毒を秘めている。"},
    [5137] = {id=5137,en="This enormous freshwater fish\nsometimes preys on waterbirds and\nunsuspecting beasts that venture\ntoo close to the water's edge.",ja="時に水鳥や水辺の獣すら捕食する巨大淡水魚。\n"},
    [5138] = {id=5138,en="This freshwater fish gives off light\nfrom inside its body.",ja="体内に発電器官をもつ淡水魚。\n"},
    [5139] = {id=5139,en="This beautifully colored fish possesses\na strong fighting instinct.\nPeople often raise bettas to watch\nthem fight or simply for viewing.",ja="艶やかな美しさと強い闘争本能を備えた淡水魚。\n観賞魚として、あるいは闘魚として飼育される。"},
    [5140] = {id=5140,en="This legendary giant saltwater fish is\nalso referred to as a \"Gigas's Shield.\"",ja="「巨人の盾」と呼ばれる、伝説の巨大海水魚。\n"},
    [5141] = {id=5141,en="This enormous saltwater fish is named\nafter a legendary admiral.",ja="伝説の提督の名を冠する、巨大海水魚。\n"},
    [5142] = {id=5142,en="A juicy slab of medium rare\nbison meat.\nSTR+6 AGI+1 INT-3\nAttack+18% (Max.90)\nRanged Attack+18% (Max.90)\n\"Lizard Killer\"+5",ja="厚切りで焼いた野牛の肉。\nSTR+6 AGI+1 INT-3 攻+18% (最大90)\n飛攻+18% (最大90) リザードキラー+5"},
    [5143] = {id=5143,en="A typical stir-fry often served at\nfestivals. The seasoning has been\nadjusted to meet the tastes of all\nnon-Goblins.\nVIT+2 AGI+5 CHR-5",ja="ゴブリンがよく屋台等で売る、肉と野菜の炒め物。\n人間の口にも合うように調味されている。\nVIT+2 AGI+5 CHR-5"},
    [5144] = {id=5144,en="The detoxified gelatinous remains of a\nclot, whipped up into a tasty dessert.\nMP+12% (Max. 85) INT-6\nMP recovered while healing +2",ja="クロットを型に容れ、ゼラチンで固めた菓子。\nMP+12% (最大85) INT+6 ヒーリングMP+2 "},
    [5145] = {id=5145,en="Whitefish and popotoes fried to a\ngolden brown and served with creamy\nTarutaru sauce.\nA traditional Tavnazian dish.\nDEX+3 VIT+3 MND-3\nRanged Accuracy+7% (Max.10)\nDEF+5",ja="白身の魚と刻んだポポトイモの揚げ物セット。\nタブナジアの家庭料理。\nDEX+3 VIT+3 MND-3 飛命+7% (最大10) 防+5"},
    [5146] = {id=5146,en="Shredded meat wrapped and baked in\na bean-laden crust, garnished with\nbaby carrots.\nHP+55 STR+6 VIT+2 INT-3 MND+3\nAccuracy+5\nAttack+18% (Max. 90)\nRanged Attack+18% (Max. 90)\nHP and MP recovered while healing +2",ja="刻んだ肉を、豆入りパイ生地で包み焼きした料理。\n伝説の怪物「ヘッジホッグパイ」を模し、\n表面はカロットの針で飾られている。\nHP+55 STR+6 VIT+2 INT-3 MND+3 命中+5\n攻+18% (最大90) 飛攻+18% (最大90)\nヒーリングHP+2 ヒーリングMP+2"},
    [5147] = {id=5147,en="Sweet milk frozen with the essence of\na snoll.\nMP+16% (Max.75)\nMP recovered while healing +1",ja="スノールの冷気で、ミルクを凍らせた氷菓子。\nMP+16% (最大75) ヒーリングMP+1"},
    [5148] = {id=5148,en="Sliced, raw squid served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nHP+30 DEX+6 AGI+5 MND-1\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上に、\nスキッドの生の切り身を乗せた東方伝来の料理。\nHP+30 DEX+6 AGI+5 MND-1 命中+15% (最大72)\n飛命+15% (最大72) レジストスリープ+1 "},
    [5149] = {id=5149,en="Sliced, raw sole served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nHP+20 STR+5 DEX+6\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上に、\nソールの生の切り身を乗せた東方伝来の料理。\nHP+20 STR+5 DEX+6 命中+15% (最大72)\n飛命+15% (最大72) レジストスリープ+1 "},
    [5150] = {id=5150,en="Sliced, raw tuna served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nHP+20 DEX+3 CHR+5\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上に、\nトゥーナの生の切り身を乗せた東方伝来の料理。\nHP+20 DEX+3 CHR+5 命中+15% (最大72)\n飛命+15% (最大72) レジストスリープ+1 "},
    [5151] = {id=5151,en="The raw eggs of a Bibiki urchin served\non a small portion of sweet vinegar\nrice wrapped in seaweed.\nHP+40 STR+1 VIT+5\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)",ja="炊いて握り固めたライスを、海苔で囲んで船とし、\n中にアーチンの生殖巣を乗せた東方伝来の料理。\nHP+40 STR+1 VIT+5 命中+15% (最大72)\n飛命+15% (最大72) "},
    [5152] = {id=5152,en="A succulent slab of fresh buffalo meat.\n",ja="臭味がなく、とても美味なバッファローの肉。\n"},
    [5153] = {id=5153,en="Sliced, raw fatty tuna served on a\nsmall portion of sweet vinegar rice.\nFatty tuna is twice as expensive\nas regular tuna.\nHP+20 DEX+3 CHR+5\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)\n\"Resist Sleep\"+2",ja="炊いて握り固めたライスの上に、\n脂肪に富むトゥーナの腹の切り身を乗せた料理。\nHP+20 DEX+3 CHR+5 命中+16% (最大76)\n飛命+16% (最大76) レジストスリープ+2 "},
    [5154] = {id=5154,en="The liver from Tavnazian sheep is\nconsidered a delicacy in many parts\nof Vana'diel.",ja="珍味で知られるタブナジア羊の肝臓。\n"},
    [5155] = {id=5155,en="This delicious gelato has been known\nto give Tarutaru brain-freeze.\nHP+10 MP+16% (Max.80)\nMP recovered while healing +2",ja="美味しく冷えたスノールジェラート。\nHP+10 MP+16% (最大80) ヒーリングMP+2"},
    [5156] = {id=5156,en="Serve this mouthwatering hedgehog pie\nat any family gathering and it will be\ngone faster than you can say \"sonic.\"\nHP+55 STR+6 VIT+2 INT-3 MND+3\nAccuracy+5\nAttack+18% (Max. 95)\nRanged Attack+18% (Max. 95)",ja="美味しく焼けたヘッジホッグパイ。\nHP+55 STR+6 VIT+2 INT-3 MND+3 命中+5\n攻+18% (最大95) 飛攻+18% (最大95)"},
    [5157] = {id=5157,en="Marbled with succulent fat, this\nheavenly bison steak will melt in\nyour mouth.\nSTR+6 AGI+1 INT-3\nAttack+18% (Max.95)\nRanged Attack+18% (Max.95)\n\"Lizard Killer\"+5",ja="美味しく焼けた野牛の厚切り肉。\nジューシーで、食すると肉汁が溢れ出す。\nSTR+6 AGI+1 INT-3 攻+18% (最大95)\n飛攻+18% (最大95) リザードキラー+5"},
    [5158] = {id=5158,en="This is about as tasty as you can\nmake the detoxified gelatinous remains\nof a clot.\nMP+12% (Max. 90)\nINT+6\nMP recovered while healing +2",ja="美味しく固めたクリムゾンゼリー。\n口中でクロットが動き、舌全体で旨味を味わえる。\nMP+12% (最大90) INT+6 ヒーリングMP+2 "},
    [5159] = {id=5159,en="Named after the \"Tragedy of\nMisareaux\" where five died of\nbliss after eating a terribly\nscrumptious basket of fish and chips.\nDEX+3 VIT+3 MND-3\nRanged Accuracy+7% (Max.15)\nDEF+5",ja="美味しくあげたフィッシュ＆チップス。\nかつては、美味で知られたミザレオ海岸の魚を\n使ったもののみが、そう呼ばれていた。\nDEX+3 VIT+3 MND-3 飛命+7% (最大15) 防+5"},
    [5160] = {id=5160,en="If the urchin eggs on this sushi were\nany fresher, they'd hatch.\nHP+40 STR+1 VIT+6\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)",ja="美味しく握れたアーチングンカン。\nHP+40 STR+1 VIT+5 命中+16% (最大76)\n飛命+16% (最大76) "},
    [5161] = {id=5161,en="This variety of Goblin stir-fry is named\nafter its inventor, Leadavox.\nVIT+2 AGI+5",ja="美味しく炒めたゴブリン風野菜炒め。\n呼称は、考案者のゴブリンに敬意を表したもの。\nVIT+2 AGI+5"},
    [5162] = {id=5162,en="This divine squid sushi would bring\ntears to any mother's eyes.\nHP+30 DEX+6 AGI+5\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)\n\"Resist Sleep\"+2",ja="美味しく握れたスキッドスシ。\nHP+30 DEX+6 AGI+5 命中+16% (最大76)\n飛命+16% (最大76) レジストスリープ+2 "},
    [5163] = {id=5163,en="Only a master chef could have\nproduced such a fine display of\nEastern cuisine.\nHP+20 STR+5 DEX+6\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)\n\"Resist Sleep\"+2",ja="美味しく握れたソールスシ。\nHP+20 STR+5 DEX+6 命中+16% (最大76)\n飛命+16% (最大76) レジストスリープ+2 "},
    [5164] = {id=5164,en="Eat too much of this Eastern spice and\nyour sinuses will be clear for months.",ja="つんと鼻腔を刺激される東方伝来のスパイス。\n"},
    [5165] = {id=5165,en="This carbonated water bubbles up from\nsprings located in Movalpolos. The gas\nfound in it has the ability to alter\nvoices.",ja="ムバルポロスの天然水で有名な炭酸水。\nガス成分の影響か、飲むと声がちょっと高くなる。"},
    [5166] = {id=5166,en="A tasty hot sandwich made with\nsucculent coeurl saute and soft\nwhite bread.\nMP+10 STR+5 AGI+1 INT-2\nAttack+20% (Max. 75)\nRanged Attack+20% (Max. 75)\n\"Resist Stun\"+4\nHP recovered while healing +1",ja="クァールのソテーを挟んだ白パン。\nMP+10 STR+5 AGI+1 INT-2\n攻+20% (最大75) 飛攻+20% (最大75)\nレジストスリープ+1 レジストスタン+4\nヒーリングHP+1"},
    [5167] = {id=5167,en="Coeurl on bread doesn't get any better\nthan this.\nMP+15 STR+5 AGI+1 INT-2\nAttack+22% (Max. 80)\nRanged Attack+22% (Max. 80)\n\"Resist Sleep\"+1\n\"Resist Stun\"+4\nHP recovered while healing +1",ja="美味しくできたクァールサンド。\nMP+15 STR+5 AGI+1 INT-2\n攻+22% (最大80) 飛攻+22% (最大80)\nレジストスリープ+1 レジストスタン+4\nヒーリングHP+1 "},
    [5168] = {id=5168,en="A nutritious quiche made with fresh\nbatagreens.\nMP+8 VIT-2 AGI+1\nRanged Accuracy+7% (Max.15)",ja="バタリア菜を使ったキッシュ。\nMP+8 VIT-2 AGI+1 飛命+7% (最大15)"},
    [5169] = {id=5169,en="The flaky crust of this heavenly quiche\nwill make a grown Galka cry.\nMP+10 VIT-1 AGI+1\nRanged Accuracy+7% (Max.20)",ja="美味しく焼けたバタリアキッシュ。\nMP+10 VIT-1 AGI+1 飛命+7% (最大20)"},
    [5170] = {id=5170,en="A nutritious quiche made with fresh\nbeaugreens.\nMP+10 VIT-1 AGI+1\nRanged Accuracy+7% (Max.15)",ja="ボスディン菜を使ったキッシュ。\nMP+10 VIT-1 AGI+1 飛命+7% (最大15)"},
    [5171] = {id=5171,en="Only the finest of chefs can bake a\nquiche of this quality.\nMP+15 AGI+1\nRanged Accuracy+7% (Max.20)",ja="美味しく焼けたグリーンキッシュ。\nMP+15 AGI+1 飛命+7% (最大20)"},
    [5172] = {id=5172,en="A simple snack consisting of Windurst\nsalad wrapped in a warm tortilla.\nMP+20 VIT-1 AGI+5\nRanged Accuracy+8% (Max.10)\nRanged Attack+1\nMP recovered while healing +1",ja="ウィンダス風サラダを挟んだトルティーヤ。\nMP+20 VIT-1 AGI+5 飛命+8% (最大10)\n飛攻+1 ヒーリングMP+1"},
    [5173] = {id=5173,en="Possibly the most mouthwatering\nWindurst taco you will ever sink\nyour teeth into.\nMP+20 VIT-1 AGI+5\nRanged Accuracy+8% (Max.15)\nRanged Attack+1\nMP recovered while healing +1",ja="美味しくできたウィンダス風タコス。\n音楽の森レストランの裏メニューを模したもの。\nMP+20 VIT-1 AGI+5 飛命+8% (最大15)\n飛攻+1 ヒーリングMP+1"},
    [5174] = {id=5174,en="A simple snack consisting of Tavnazian\nsalad wrapped in a warm tortilla.\nHP+20 MP+20 DEX+4 VIT+6 AGI+4\nCHR+4 DEF+25% (Max. 150)\nHP and MP recovered\nwhile healing +1",ja="タブナジア風サラダを挟んだトルティーヤ。\nHP+20 MP+20 DEX+4 VIT+6 AGI+4\nCHR+4 防+25% (最大150) ヒーリングHP+1\nヒーリングMP+1"},
    [5175] = {id=5175,en="The former Tavnazia marquis was\nknown to eat as many as seven of\nthese titillating Tavnazian tacos a day.\nHP+20 MP+20 DEX+4 VIT+6 AGI+4\nCHR+4 DEF+25% (Max. 160)\nHP and MP recovered while healing +1",ja="美味しくできたタブナジア風タコス。\nHP+20 MP+20 DEX+4 VIT+6 AGI+4\nCHR+4 防+25% (最大160) ヒーリングHP+1\nヒーリングMP+1 "},
    [5176] = {id=5176,en="Sliced, raw bream served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nDEX+6 VIT+5\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上に、\nブリームの生の切り身を乗せた東方伝来の料理。\nDEX+6 VIT+5 命中+16% (最大76)\n飛命+16% (最大76) レジストスリープ+1 "},
    [5177] = {id=5177,en="The kind of sushi that \"breams\" are\nmade of.\nDEX+6 VIT+5\nAccuracy+17% (Max. 80)\nRanged Accuracy+17% (Max. 80)\n\"Resist Sleep\"+2",ja="美味しく握れたブリームスシ。\nDEX+6 VIT+5 命中+17% (最大80)\n飛命+17% (最大80) レジストスリープ+2 "},
    [5178] = {id=5178,en="Sliced, noble lady served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nDEX+5\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\nEnmity+4\n\"Resist Sleep\"+1\n",ja="炊いて握り固めたライスの上に、ノーブルレディ\nの生の切り身を乗せた東方伝来の料理。\nDEX+5 命中+15% (最大72) 飛命+15% (最大72)\n敵対心+4 レジストスリープ+1"},
    [5179] = {id=5179,en="This dorado sushi will entice the\npalate of any sushi connoisseur.\nDEX+5\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)\nEnmity+5\n\"Resist Sleep\"+2",ja="美味しく握れたドラドスシ。\nDEX+5 命中+16% (最大76)\n飛命+16% (最大76) 敵対心+5\nレジストスリープ+2"},
    [5180] = {id=5180,en="This savory brain stew will make\nyou wonder how you would settle\nfor anything less.\nDEX+6 INT+6 MND+6\nHP recovered while healing +3\nMP recovered while healing +3",ja="複雑な味が引き出されたブレインシチュー。\nDEX+6 INT+6 MND+6 ヒーリングHP+3\nヒーリングMP+3"},
