    [5183] = {id=5183,en="The scurviest pirates of the north seas\nhave given this pickled herring their\nseal of approval.\nDEX+4 MND-3\nAttack+12% (Max.75)\nRanged Attack+12% (Max.75)",ja="美味しく漬けたニシンの塩漬け。\nDEX+4 MND-3 攻+12% (最大75)\n飛攻+12% (最大75)"},
