    [5185] = {id=5185,en="Tavnazian salad with a twist!\nHP+20 MP+20 DEX+4 VIT+6 AGI+4\nCHR+4 DEF+25% (Max.160)",ja="美しい盛りつけのタブナジア風サラダ。\nHP+20 MP+20 DEX+4 VIT+6 AGI+4\nCHR+4 防+25% (最大160)"},
    [5186] = {id=5186,en="This carp sushi's accurate degree\nof fermentation would make any\nzymologist proud.\nDEX+2 Accuracy+11% (Max.56)\nHP recovered while healing +2",ja="風味豊かに発酵させたフナずし。\nDEX+2 命中+11% (最大56) ヒーリングHP+2"},
