    [5189] = {id=5189,en="Red mages across Vana'diel adore this sumptuous blend of pomodoro sauce and vongola clams served over spaghetti al dente.\nHP+20% (Max. 90)\nVIT+2 MND-1\nDEF+25% (Max. 30)\n\"Store TP\"+6",ja="ポモドーロソースであえたボンゴラのパスタ。\nHP+20% (最大90) VIT+2 MND-1\n防+25% (最大30) ストアTP+6 "},
    [5190] = {id=5190,en="A tasty white pasta with a creamy\nsauce made from Selbina milk and\nground black pepper.\nHP+14% (Max. 175)\nMP+10 STR+4 VIT+2 INT-3\nAttack+17% (Max. 65)\n\"Store TP\"+6",ja="ミルクと黒胡椒であえた炭焼き風パスタ。\nHP+14% (最大175) MP+10 STR+4 VIT+2\nINT-3 攻+17% (最大65) ストアTP+6 "},
    [5191] = {id=5191,en="Fishermen the world over salivate over this delectable blend of pomodoro sauce and seafood served over spaghetti al dente.\nHP+15% (Max. 150)\nVIT+3 MND-1\nDEF+22% (Max. 65)\n\"Store TP\"+6",ja="魚介をポモドーロソースであえた漁師風パスタ。\nHP+15% (最大150) VIT+3 MND-1\n防+22% (最大65) ストアTP+6 "},
    [5192] = {id=5192,en="Popular among lumberjacks, this flavorful meal is composed of a blend of pomodoro sauce and mushrooms served over spaghetti al dente.\nHP+18% (Max. 120)\nMP+35 STR-5 DEX-2 VIT+2 MND+4\n\"Store TP\"+6\nMP recovered while healing +1",ja="キノコをポモドーロソースであえた樵風パスタ。\nHP+18% (最大120) MP+35 STR-5 DEX-2 VIT+2 MND+4 ストアTP+6 ヒーリングMP+1 "},
    [5193] = {id=5193,en="The dark color of this squid ink\npasta is especially popular among\nblack mages.\nHP+17% (Max. 130)\nDEX+3 VIT+2 AGI-1 MND-2 CHR+1\n\"Double Attack\"+1%\n\"Store TP\"+6",ja="頭足類の墨であえた黒色のパスタ。\nHP+17% (最大130) DEX+3 VIT+2 AGI-1 MND-2 CHR-1 ダブルアタック+1% ストアTP+6"},
    [5194] = {id=5194,en="A simple sauce made from crushed\nMithran tomatoes.\nINT+1 MND+2\nHP recovered while healing +1",ja="潰したトマトのソース。\nINT+1 MND+2 ヒーリングHP+1"},
    [5195] = {id=5195,en="This refreshing herb is used to accent\nmany types of cuisine.",ja="爽快な香りを発する葉のスパイス。\n"},
