    [5197] = {id=5197,en="This spaghetti peperoncino is so hot,\nyou will need at least Water IV to\ncool off the fire in your mouth.\nHP+30% (Max. 75) VIT+2\n\"Store TP\"+6\n\"Resist Virus\"+12",ja="美味しくできたペペロンチーノ。\nHP+30% (最大75) VIT+2\nストアTP+6 レジストウィルス+12"},
    [5198] = {id=5198,en="In a recent survey, 87% of all vongola\nclams replied spaghetti vongole +1 is\nthe way they'd like to go.\nHP+20% (Max. 95)\nVIT+2 MND-1\nDEF+25% (Max. 35)\n\"Store TP\"+6",ja="美味しくできたボンゴレロッソ。\nHP+20% (最大95) VIT+2 MND-1\n防+25% (最大35) ストアTP+6 "},
    [5199] = {id=5199,en="This spaghetti carbonara is so creamy,\nthe word \"creamy\" isn't creamy enough\nto describe its creaminess.\nHP+14% (Max. 180)\nMP+15 STR+4 VIT+2 INT-3\nAttack+17% (Max. 70)\n\"Store TP\"+6",ja="美味しくできたカルボナーラ。\nHP+14% (最大180) MP+15 STR+4 VIT+2\nINT-3 攻+17% (最大70) ストアTP+6 "},
    [5200] = {id=5200,en="3 1/2 times better than the spaghetti\npescatora your mom used to make.\nHP+15% (Max. 160)\nVIT+3 MND-1\nDEF+22% (Max. 70)\n\"Store TP\"+6",ja="美味しくできたペスカトーレ。\nHP+15% (最大160) VIT+3 MND-1\n防+22% (最大70) ストアTP+6 "},
    [5201] = {id=5201,en="There are enough mushrooms in\nthis scrumptious pasta to make\nany moustached plumber jump for joy.\nHP+18% (Max. 130)\nMP+40 STR-5 DEX-2 VIT+2 MND+4\n\"Store TP\"+6\nMP recovered while healing +1",ja="美味しくできたボスカイオーラ。\nHP+18% (最大130) MP+40 STR-5 DEX-2 VIT+2 MND+4 ストアTP+6 ヒーリングMP+1 "},
