    [5208] = {id=5208,en="The rump roast of a Tavnazian\nram. This meat's toughness makes\nit unpopular with Humes.",ja="タブナジア原産の大きな雄羊のロースト肉。\n筋が多いため、ヒュームには評判が悪い。"},
    [5209] = {id=5209,en="Though considered a delicacy, the\npowerful odor given off by this meat\nis enough to turn away even the\nbravest of connoisseurs.",ja="強烈な臭味が特徴の大鳥の肉。\nただし、一部の食通にはすこぶる評判がよい。"},
    [5210] = {id=5210,en="A dish often served at banquets held\nby the Quadav Adamantking. Its odor\nprevents it from becoming a popular\ndish in culinary circles.\nSTR-7 DEX-7 VIT-7 AGI-7 INT-7 MND-7\nCHR-7",ja="クゥダフの王宮料理のひとつである冷製スープ。\n強烈な腐臭はクゥダフにこそ喜ばれるものの\n人間には一般的に好まれない。\nSTR-7 DEX-7 VIT-7 AGI-7 INT-7 MND-7\nCHR-7"},
    [5211] = {id=5211,en="A delightful blend of pomodoro sauce and dragon meat served over spaghetti al dente, with enough mustard to make your eyes pop in surprise.\nHP+17% (Max. 140)\nSTR+5 VIT+2 INT-7\nAttack+22% (Max. 90)\nRanged Attack+22% (Max. 90)\n\"Store TP\"+6\n\"Resist S",ja="龍の肉をポモドーロソースであえた激辛パスタ。\nHP+17% (最大140) STR+5 VIT+2 INT-7\n攻+22% (最大90) 飛攻+22% (最大90)\nストアTP+6 レジストスリープ+8 "},
    [5212] = {id=5212,en="Only a master's hand could produce\nsuch a perfect balance of ingredients.\nHP+17% (Max. 150)\nSTR+5 VIT+2 INT-7\nAttack+23% (Max. 100)\nRanged Attack+23% (Max. 100)\n\"Store TP\"+6\n\"Resist Sleep\"+8",ja="美味しくできたアラビアータ。\nHP+17% (最大150) STR+5 VIT+2 INT-7\n攻+23% (最大100) 飛攻+23% (最大100)\nストアTP+6 レジストスリープ+8 "},
    [5213] = {id=5213,en="Coveted by many a paladin, this dish is comprised of pomodoro sauce and eggplant served over spaghetti al dente.\nHP+25% (Max. 100) VIT+2\n\"Store TP\"+6\n\"Resist Sleep\"+10",ja="ナスをポモドーロソースであえたパスタ。\nHP+25% (最大100) VIT+2 ストアTP+6\nレジストスリープ+10 "},
    [5214] = {id=5214,en="Made from the most exceptional\neggplants in all of Vana'diel.\nHP+25% (Max. 105) VIT+2\n\"Store TP\"+6\n\"Resist Sleep\"+10",ja="美味しくできたメランザーネ。\nHP+25% (最大105) VIT+2 ストアTP+6\nレジストスリープ+10 "},
    [5215] = {id=5215,en="A Far Eastern dish made by shaping\nsteamed rice into a ball and topping\nit off with raw squid tentacles.\nHP+20 DEX+3 AGI+3 MND-1\nAccuracy+20% (Max. 18)\nRanged Accuracy+20% (Max. 18)\n\"Double Attack\"+1%",ja="炊いて握り固めたライスの上に、\nカラマリの生の足を乗せた東方伝来の料理。\nHP+20 DEX+3 AGI+3 MND-1 命中+20% (最大18) 飛命+20% (最大18) ダブルアタック+1% "},
    [5216] = {id=5216,en="Raw squid tentacles don't\nget any better than this!\nHP+20 DEX+3 AGI+3\nAccuracy+20% (Max. 20)\n\"Double Attack\"+1%",ja="美味しく握れたゲソズシ。\nHP+20 DEX+3 AGI+3 命中+20% (最大20) 飛命+20% (最大20) ダブルアタック+1% "},
    [5217] = {id=5217,en="These eggs of the\nfreshwater Cheval salmon\nare said to be a rare delicacy.",ja="淡水魚「シュヴァルサーモン」の卵巣。\n珍味で知られる。"},
    [5218] = {id=5218,en="Salmon eggs pickled in salt,\nthis delicacy is sometimes\nreferred to as \"red gold.\"\nHP+8 MP+8 DEX+2 MND-1",ja="サーモンの卵の塩漬け。\n「赤い貴石」と呼ばれている。\nHP+8 MP+8 DEX+2 MND-1"},
    [5219] = {id=5219,en="A Far Eastern dish made by shaping\nsteamed rice into a ball, placing\nsalmon roe on top, and wrapping the\nsides in tall seaweed. The finished\nproduct is said to resemble a warship.\nHP+30 MP+10 DEX+3 MND-2\nAccuracy+18% (Max. 28)\nRanged Accuracy+18% (Max. 28)",ja="炊いて握り固めたライスを、海苔で囲んで船とし、\n中にサーモンの卵を乗せた東方伝来の料理。\nHP+30 MP+10 DEX+3 MND-2\n命中+18% (最大28) 飛命+18% (最大28) "},
    [5220] = {id=5220,en="This plate of ikra gunkan looks\nso delicious, even the kids will eat it.\nHP+30 MP+12 DEX+3 MND-1\nAccuracy+18% (Max. 30)\nRanged Accuracy+18% (Max. 30)",ja="美味しく握れたイクラグンカン。\nHP+30 MP+12 DEX+3 MND-1\n命中+18% (最大30) 飛命+18% (最大30) "},
    [5221] = {id=5221,en="Your adventuring fellow made\nthis herbal tea especially for you.\nIt gives off a faint, soothing\nfragrance.\nAccuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)\nHP recovered while healing +1",ja="フェローが淹れてくれたハーブティー。\nほのかな香りが心を癒してくれる。\n命中+12% (最大80) 攻+10% (最大40)\n飛命+12% (最大80) 飛攻+10% (最大40)\nヒーリングHP+1 "},
    [5222] = {id=5222,en="Your fellow adventurer must have\nworked hard to make this delectable\nstew especially for you.\nVIT+1 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが煮込んでくれたシチュー。\n苦労の跡がうかがえる。\nVIT+1 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5223] = {id=5223,en="Your adventuring fellow\nmade this freezing cold\ngelato especially for you.\nINT+1 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが作ってくれたジェラート。\nとても冷えている。\nINT+1 命中+12% (最大80) 攻+10% (最大40)\n飛命+12% (最大80) 飛攻+10% (最大40) "},
    [5224] = {id=5224,en="Your adventuring fellow\nmade this tightly wrapped\nrice ball especially for you.\nDEX+1 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが握ってくれたおにぎり。\n力いっぱいぎゅっと握られている。\nDEX+1 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5225] = {id=5225,en="Your adventuring fellow\nmade this cheese especially for you.\nIt is hard as a rock and difficult\nto chew.\nHP+10 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが作ってくれたチーズ。\n金属のように硬く、歯ごたえがある。\nHP+10 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5226] = {id=5226,en="Your adventuring fellow\ncooked this hot, juicy\nsteak especially for you.\nSTR+1 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが焼いてくれたステーキ。\n熱々で肉汁がほとばしっている。\nSTR+1 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5227] = {id=5227,en="Your adventuring fellow\nmade this salad especially for you.\nThe ingredients have been\nsliced up carefully.\nMP+10 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが和えてくれたサラダ。\n材料ひとつひとつが丁寧に切られている。\nMP+10 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5228] = {id=5228,en="Your adventuring fellow baked\nthis bread especially for you.\nIt is shaped into a perfect rectangle.\nAccuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)\nMP recovered while healing +1",ja="フェローが焼いてくれたパン。\n几帳面に形が整えられている。\n命中+12% (最大80) 攻+10% (最大40)\n飛命+12% (最大80) 飛攻+10% (最大40)\nヒーリングMP+1 "},
    [5229] = {id=5229,en="Your adventuring fellow made\nthis risotto especially for you.\nIt contains ingredients of the\nhighest quality in generous amounts.\nMND+1 Accuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが作ってくれたリゾット。\n高級食材がおしみなく用いられている。\nMND+1 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5230] = {id=5230,en="This heart-shaped chocolate\nhas been wrapped with ribbon\nand parchment.\nMP recovered while healing +4",ja="リボンと羊皮紙でラッピングされたハートチョコ。\nヒーリングMP+4"},
    [5231] = {id=5231,en="An elegantly wrapped\nheart-shaped chocolate.\nMP+10\nMP recovered while healing +4",ja="丁寧にラッピングされたハートチョコ。\nMP+10 ヒーリングMP+4"},
