    [5238] = {id=5238,en="A Far Eastern dish created from\nvarious ingredients. Each piece\nof food may be removed and eaten\nas soon as it has finished cooking.\nHP+10% (Max. 50) MP+10\nAccuracy+5 Ranged Accuracy+5\nEvasion+5\nHP recovered while healing +5\nMP recovered while healing +1",ja="数多の食材を汁で煮ながら\nみなで食べられる東方伝来の鍋料理。\nHP+10% (最大50) MP+10 命中+5 飛命+5\n回避+5 ヒーリングHP+5 ヒーリングMP+1"},
    [5239] = {id=5239,en="The cooking of this seafood stewpot\nwas strictly supervised to ensure\nthat the ingredients were added\nin the proper manner.\nHP+10% (Max. 75) MP+15\nDEX+1 VIT+1 AGI+1 MND+1\nAccuracy+6 Ranged Accuracy+6\nEvasion+6\nHP recovered while healing +7\nMP recovered wh",ja="美味しくつつけるように\n食材の投入や手順が厳しく監視された寄せ鍋。\nHP+10% (最大75) MP+15 DEX+1 VIT+1\nAGI+1 MND+1 命中+6 飛命+6 回避+6\nヒーリングHP+7 ヒーリングMP+2"},
    [5240] = {id=5240,en="The cooking of this seafood stewpot\nwas directed so that the ingredients\nwere masterfully utilized.\nHP+10% (Max. 100) MP+20\nDEX+2 VIT+2 AGI+2 MND+2\nAccuracy+7 Ranged Accuracy+7\nEvasion+7 \nHP recovered while healing +9\nMP recovered while healing +3",ja="みなが美味しくつつけるように\n見事に食材の投入や手順が采配された寄せ鍋。\nHP+10% (最大100) MP+20 DEX+2 VIT+2\nAGI+2 MND+2 命中+7 飛命+7 回避+7\nヒーリングHP+9 ヒーリングMP+3"},
