    [5411] = {id=5411,en="A sweet drink often offered to the\nGoddess, Altana. It is first mentioned\nin the holy scripture in Trepidations IX.\n\n\"Ye cannot drink the cup of the\nGoddess, and the cup of Daemons.\"",ja="アルタナに捧げるために作られた甘い飲み物。\n教典の「汝、分け与えよ」という章に記述がある。"},
