    [5610] = {id=5610,en="This thick steak of cerberus meat\nremains hot and juicy even if left\nalone for a long period of time.\nHP+22 STR+7 INT-3\nAttack+20% (Max. 150)\nRanged Attack+20% (Max. 150)\n\"Dragon Killer\"+5\nHP recovered while healing +2\nMP recovered while healing +1",ja="美味しく焼けたケルベロスの厚切り肉。\n長時間、冷めることなくホットな食感を楽しめる。\nHP+22 STR+7 INT-3 攻+20% (最大150)\n飛攻+20% (最大150) ドラゴンキラー+5\nヒーリングHP+2 ヒーリングMP+1 "},
    [5611] = {id=5611,en="A Far Eastern dish created with orobon\nmeat, along with vegetables and a few\nother ingredients.\nHP+10% (Max. 200) MP+10\nAccuracy+15% (Max. 15)\nRanged Accuracy+15% (Max. 15)\nHP recovered while healing +5\nMP recovered while healing +1",ja="「オロボンの肉」を中心に野菜等と共に煮ながら\nみなで食べられる東方伝来の鍋料理。\nHP+10% (最大200) MP+10\n命中+15% (最大15) 飛命+15% (最大15)\nヒーリングHP+5 ヒーリングMP+1"},
    [5612] = {id=5612,en="The cooking of this angler stewpot\nwas strictly supervised to ensure\nthat the ingredients were added in\nthe proper manner.\nHP+10% (Max. 200) MP+15\nDEX+2 AGI+1 MND+1\nAccuracy+15% (Max. 30)\nRanged Accuracy+15% (Max. 30)\nHP recovered while healing +7\nMP reco",ja="美味しくつつけるように\n食材の投入や手順が厳しく監視された鮟鱇鍋。\nHP+10% (最大200) MP+15 DEX+2 AGI+1\nMND+1 命中+15% (最大30)\n飛命+15% (最大30) ヒーリングHP+7\nヒーリングMP+2"},
    [5613] = {id=5613,en="The cooking of this angler stewpot\nwas directed so that the ingredients\nwere masterfully utilized.\nHP+10% (Max. 200) MP+20\nDEX+4 AGI+2 MND+2\nAccuracy+15% (Max. 45)\nRanged Accuracy+15% (Max. 45)\nHP recovered while healing +9\nMP recovered while healing +3",ja="みなが美味しくつつけるように\n見事に食材の投入や手順が采配された鮟鱇鍋。\nHP+10% (最大200) MP+20 DEX+4 AGI+2\nMND+2 命中+15% (最大45)\n飛命+15% (最大45) ヒーリングHP+9\nヒーリングMP+3"},
