    [5651] = {id=5651,en="An edible root grown in the Far East.\n",ja="東方原産の根を食す野菜。\n"},
    [5652] = {id=5652,en="Icefish or sandfish pickled in oil.\nMass produced and rationed to the\nRepublican Army during the Crystal\nWar.",ja="アイスフィッシュやサンドフィッシュの油漬。\n大戦中、共和国軍の保存食として量産された。"},
    [5653] = {id=5653,en="A tiny cake filled with\nYagudo cherries.\nMP+10% (Max. 80)\nAGI-1 INT+1",ja="ヤグードチェリー入りの小さな焼き菓子。\nMP+10% (最大80) AGI-1 INT+1 "},
    [5654] = {id=5654,en="An exceptionally delicious cherry\nmuffin. All the Yagudo cherries inside\nare equidistant from each other.\nMP+10% (Max. 85) AGI-1 INT+2",ja="パティシエの技が光る「チェリーマフィン」。\nとてもとても美味しい。\nMP+10% (最大85) AGI-1 INT+2 "},
    [5655] = {id=5655,en="A tiny cake flavored with coffee.\nMP+10% (Max. 85) STR-1 MND+1",ja="コーヒー風味の小さな焼き菓子。\nMP+10% (最大85) STR-1 MND+1 "},
    [5656] = {id=5656,en="An exceptionally aromatic\ncoffee muffin.\nMP+10% (Max. 90) STR-1 MND+2",ja="パティシエの技が光る「コーヒーマフィン」。\nとてもとても美味しい。\nMP+10% (最大90) STR-1 MND+2 "},
    [5657] = {id=5657,en="A hard, tasteless biscuit high in\ncalories. Rationed to Federation\nArmy soldiers during the Crystal War.\nHP recovered while healing +3\nMP recovered while healing +3",ja="硬く焼いた小型の菓子。\n大戦中、連邦軍の携帯食として量産された。\nヒーリングHP+3 ヒーリングMP+3 "},
    [5658] = {id=5658,en="A more than generous serving of\nassorted vegetables prepared in\nolive oil, served over spaghetti\nal dente.\nHP+30% (Max. 70)\nVIT+2 AGI+2\n\"Store TP\"+6\n\"Resist Blind\"+10",ja="オリーブオイルで野菜をあえた菜園風パスタ。\nHP+30% (最大70) VIT+2 AGI+2\nストアTP+6 レジストブライン+10"},
    [5659] = {id=5659,en="A sumptuous alternative for the\nvoracious vegans of Vana'diel.\nHP+30% (Max. 75)\nVIT+2 AGI+2\n\"Store TP\"+6\n\"Resist Blind\"+10",ja="美味しくできたオルトラーナ。\nHP+30% (最大75) VIT+2 AGI+2\nストアTP+6 レジストブライン+10"},
    [5660] = {id=5660,en="A hard, spicy sausage made of\ngiant sheep meat. Mass produced\nand rationed to the Royal Army\nduring the Crystal War.",ja="香辛料を効かせた羊肉の腸詰め。\n大戦中、王国軍の保存食として量産された。"},
    [5661] = {id=5661,en="This hard-shelled nut comes from\ntrees of the same name.",ja="硬質の殻に覆われたウォルナットの実。\n"},
    [5662] = {id=5662,en="Covered in soft green barbs, this\ncactus fruit has a sweet, tangy flavor.",ja="緑色の棘に覆われた、甘酸っぱいサボテンの実。\n"},
    [5663] = {id=5663,en="Sliced, raw salmon served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nSTR+1\nAccuracy+14% (Max. 68)\nRanged Accuracy+14% (Max. 68)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上に\nサーモンの生の切り身を乗せた東方伝来の料理。\nSTR+1 命中+14% (最大68)\n飛命+14% (最大68) レジストスリープ+1 "},
    [5664] = {id=5664,en="Salmon sushi so succulent, you'll make\nthe trek back upstream to get more.\nSTR+1\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\n\"Resist Sleep\"+2",ja="美味しく握れたサーモンスシ。\nSTR+1 命中+15% (最大72)\n飛命+15% (最大72) レジストスリープ+2 "},
    [5665] = {id=5665,en="Sliced, raw kalkanba served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nINT+5\nAccuracy+16% (Max. 76)\nRanged Accuracy+16% (Max. 76)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上にカルカンバルウの\n生のヒレを乗せた東方伝来の料理。\nINT+5 命中+16% (最大76)\n飛命+16% (最大76) レジストスリープ+1"},
    [5666] = {id=5666,en="When the fins taste this good,\nwho needs the rest of the fish?\nINT+6\nAccuracy+17% (Max. 80)\nRanged Accuracy+17% (Max. 80)\n\"Resist Sleep\"+2",ja="美味しく握れたフィンスシ。\nINT+6 命中+17% (最大80)\n飛命+17% (最大80) レジストスリープ+2 "},
    [5667] = {id=5667,en="An extra-lean cut of\nluscious lynx meat.",ja="脂身がほとんどないリンクスの肉。\n"},
    [5668] = {id=5668,en="Smilodon livers are\nsaid to enhance virility.",ja="精が付くことで知られるスミロドンの肝臓。\n"},
    [5669] = {id=5669,en="This blend of brass loaches, burdock\nroot, and a fresh bird egg is popular\nat Far Eastern parties.\nAccuracy+7% (Max. 15)\nRanged Accuracy+7% (Max. 17)\nEvasion+3",ja="ブラスローチとバードックを卵で綴じた\nみなで食べられる東方伝来の鍋料理。\n命中+7% (最大15) 飛命+7% (最大15) 回避+3"},
    [5670] = {id=5670,en="This blend of select Far Eastern\ningredients is much more delightful\nwhen eaten with friends.\nDEX+2 AGI+2\nAccuracy+7% (Max. 30)\nRanged Accuracy+7% (Max. 30)\nEvasion+4",ja="美味しくつつけるように\n食材の投入や手順が厳しく監視された柳川鍋。\nDEX+2 AGI+2 命中+7% (最大30)\n飛命+7% (最大30) 回避+4"},
    [5671] = {id=5671,en="This precise blend of select\ningredients creates a culinary\nharmony that can only be appreciated\nwhen enjoyed with friends.\nDEX+4 AGI+4\nAccuracy+7% (Max. 45)\nRanged Accuracy+7% (Max. 50)\nEvasion+5",ja="みなが美味しくつつけるように\n見事に食材の投入や手順が采配された柳川鍋。\nDEX+4 AGI+4 命中+7% (最大45)\n飛命+7% (最大50) 回避+5"},
    [5672] = {id=5672,en="A sweet rolanberry, dried in the sun.",ja="乾燥させて甘味の増したロランベリー。\n"},
    [5673] = {id=5673,en="Only the sweetest dried rolanberries\ncan be deemed \"rolsins.\"",ja="とても甘いドライベリー。\n"},
    [5674] = {id=5674,en="A serendipitously sweet\nrolanberry pie baked by\nAileen of the Craftsmen's Eatery.\nHP+50 MP+50 STR+4 DEX+4 VIT+4\nAGI+4 INT+4 MND+4 CHR+4\nMP recovered while healing +2",ja="職人食堂のアイリーンが焼いたロランベリーパイ。\nほのかに甘酸っぱい。\nHP+50 MP+50 STR+4 DEX+4 VIT+4\nAGI+4 INT+4 MND+4 CHR+4\nヒーリングMP+2"},
    [5675] = {id=5675,en="Divine intervention can be the only\nexplanation for this miraculously\npreserved rolanberry.",ja="奇跡的に長期保存に成功した乾燥ロランベリー。\n"},
    [5676] = {id=5676,en="A sumptuous blend of fungi\nsauteed in rich, creamy butter.\nMP+60 MND+6\nMP recovered while healing +6",ja="数種類のキノコをバターで炒めた料理。\nMP+60 MND+6 ヒーリングMP+6 "},
    [5677] = {id=5677,en="A mouthwatering blend of fungi\nsauteed in rich, creamy butter.\nOften served at cotillions held\nby Windurst's Patriarch Protectors.\nMP+65 MND+7\nMP recovered while healing +7",ja="数種類のキノコをバターで香ばしく炒めた料理。\n元老院の晩餐会で饗されるほど素晴らしい出来。\nMP+65 MND+7 ヒーリングMP+7 "},
    [5678] = {id=5678,en="A traditional San d'Orian\nmushroom salad.\nMP+14% (Max. 85)\nSTR-5 VIT-5 AGI+6 MND+6\nRanged Accuracy+15",ja="キノコを盛り付けたサンドリア伝統のサラダ。\nMP+14% (最大85) STR-5 VIT-5 AGI+6\nMND+6 飛命+15 "},
    [5679] = {id=5679,en="A mushroom salad so delicious,\neven the papsque cannot help\nbut ask for seconds.\nMP+15% (Max. 90)\nSTR-5 VIT-5 AGI+7 MND+7\nRanged Accuracy+17",ja="キノコを美味しそうに盛り付けたサラダ。\n大聖堂の賓客に振る舞われるほど素晴らしい出来。\nMP+15% (最大90) STR-5 VIT-5 AGI+7\nMND+7 飛命+17 "},
    [5680] = {id=5680,en="This medicinal mushroom can only\nbe found growing on funguars of\nthe coppercap variety.",ja="「カッパーキャップ」に寄生する薬用キノコ。\n"},
    [5681] = {id=5681,en="A beautifully wrapped, heart-shaped\nchocolate. A Cupid's arrow design\nhas been printed in its center.\nAccuracy+10 Ranged Accuracy+10\nAttack+10 Ranged Attack+10\n\"Store TP\"+25",ja="ラッピングされたハート型のチョコレート。\n中央にキューピッドの矢が刻印されている。\n命中+10 飛命+10 攻+10 飛攻+10\nストアTP+25 "},
    [5682] = {id=5682,en="A rare mushroom said to have medicinal properties.",ja="霊芝の一種である珍しいキノコ。\n"},
    [5683] = {id=5683,en="The absolute pinnacle of eggcraft\nartistry, this is an exceptional\nrendition of the Humpty Dumpty of\nfolklore. The piece's girth belies\nits fragility.\nHP+6% (Max. 160)\nMP+6% (Max. 160)",ja="妖精「ハンプティダンプティ」を模した卵細工。\n太っちょだけど繊細で、取り扱いには注意が必要。\nHP+6% (最大160) MP+6% (最大160) "},
    [5684] = {id=5684,en="A high-grade cheese of San d'Oria, its\ndistinctive characteristics being its\ninnumerable perforations and distinct\naroma. It bears the name of the\nculinarily inclined monarch,\nChalaimbille II.",ja="無数の気孔が特徴の香り高いサンドリア風チーズ。\n美食王シャラムビール2世の名を冠する。"},
    [5685] = {id=5685,en="No rabbits were harmed in the making of this pie.\nSTR+5 VIT+5 INT-2\nAttack+25% (Max. 100)\nRanged Attack+25% (Max. 100)\nDEF+25% (Max. 100)",ja="兎を模したサンドリア伝統の祝祭用パイ。\nSTR+5 VIT+5 INT-2 攻+25% (最大100)\n飛攻+25% (最大100) 防+25% (最大100) "},
    [5686] = {id=5686,en="A classic sandwich and favorite\namong the masses. A simple, profound,\nand timeless cheese sandwich.\nHP+10 AGI+1",ja="シャラムビーチーズを挟んだ白パン。\n流行の料理で、若者に人気。\nHP+10 AGI+1 "},
    [5687] = {id=5687,en="No doubt some divine power has\nhad a hand in the forming of\nthis flawless cheese sandwich.\nWords do it no justice.\nHP+10 AGI+2",ja="美味しくできたチーズサンド。\nHP+10 AGI+2 "},
    [5688] = {id=5688,en="This leafy green is known and desired for its distinctively bitter taste.",ja="独特の苦みが特徴の葉を食す野菜。\n"},
    [5689] = {id=5689,en="Finely seasoned meat formed into\nthe shape of a loaf of bread and\nbaked to goodness.\nSTR+6 AGI+2 INT-3\nAttack+18% (Max. 90)",ja="野牛の挽き肉等をパンの形状にして焼いた料理。\nSTR+6 AGI+2 INT-3 攻+18% (最大90) "},
    [5690] = {id=5690,en="The blend and balance of lynx\nand buffalo in this meatloaf is,\nin a word, sublime.\nSTR+6 AGI+2 INT-3\nAttack+18% (Max. 95)",ja="美味しく焼けたミートローフ。\nSTR+6 AGI+2 INT-3 攻+18% (最大95) "},
    [5691] = {id=5691,en="A delicacy hailing from the eastern lands consisting of a sweeper laid across subtly flavored rice.\nVIT+1\nAccuracy+14% (Max. 68)\nRanged Accuracy+14% (Max. 68)\nDEF+5\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上にバストア\nスイーパーの生の切り身を乗せた東方伝来の料理。\nVIT+1 命中+14% (最大68)\n飛命+14% (最大68) 防+5\nレジストスリープ+1 "},
    [5692] = {id=5692,en="The rice is packed to just the right consistency and the shrimp is still twitching. It is perfect.\nVIT+2\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\nDEF+10\n\"Resist Sleep\"+2",ja="美味しく握れたシュリンプスシ。\nVIT+2 命中+15% (最大72)\n飛命+15% (最大72) 防+10\nレジストスリープ+2 "},
    [5693] = {id=5693,en="A delicacy hailing from the eastern lands consisting of a cut of octopus laid across subtly flavored rice.\nSTR+1\nAccuracy+14% (Max. 68)\nRanged Accuracy+14% (Max. 68)\n\"Resist Sleep\"+1",ja="炊いて握り固めたライスの上にギガント\nオクトパスの生の切り身を乗せた東方伝来の料理。\nSTR+1 命中+14% (最大68)\n飛命+14% (最大68) レジストスリープ+1"},
    [5694] = {id=5694,en="The rice is packed to just the right consistency and the suckers on the tentacle still show signs of life. So fresh!\nSTR+2\nAccuracy+15% (Max. 72)\nRanged Accuracy+15% (Max. 72)\n\"Resist Sleep\"+2",ja="美味しく握れたオクトパススシ。\nSTR+2 命中+15% (最大72)\n飛命+15% (最大72) レジストスリープ+2"},
    [5695] = {id=5695,en="This pizza derives its popularity from the tried-and-tested combinatorial deliciousness of cheese, basil, and tomato.\nHP+30\nAccuracy+10% (Max. 8)\nAttack+10% (Max. 10)",ja="バジルとチーズとトマトを乗せたカラフルなピザ。\nHP+30 命中+10% (最大8) 攻+10% (最大10)"},
    [5696] = {id=5696,en="A margherita among margheritas, this pizza has achieved the perfect harmony of basil and tomato.\nHP+35\nAccuracy+10% (Max. 9)\nAttack+10% (Max. 11)",ja="美味しく焼けたマルゲリータピザ。\nHP+35 命中+10% (最大9) 攻+10% (最大11)"},
    [5697] = {id=5697,en="A veritable sheet of pepperoni delicately floats upon the layers of cheese and sauce below. A mainstay of any pizza repertoire.\nHP+30 STR+1\nAccuracy+9% (Max. 10)\nAttack+10% (Max. 15)",ja="ペパローニを乗せたピリ辛のピザ。\nHP+30 STR+1 命中+9% (最大10)\n攻+10% (最大15) "},
    [5698] = {id=5698,en="The width of the pepperoni slices, the consistency of the crust, the proportion of cheese to sauce. It's all here.\nHP+35 STR+2\nAccuracy+9% (Max. 11)\nAttack+10% (Max. 16)",ja="美味しく焼けたペパロニピザ。\nHP+35 STR+2 命中+9% (最大11)\n攻+10% (最大16) "},
    [5699] = {id=5699,en="An often slighted pizza varietal that makes up for its lack of adherents with lots of salt.\nHP+30 DEX+1\nAccuracy+9% (Max. 15)\nAttack+10% (Max. 20)",ja="アンチョビを乗せた塩気のきいたピザ。\nHP+30 DEX+1 命中+9% (最大15)\n攻+10% (最大20) "},
    [5700] = {id=5700,en="Only the choicest of anchovies are given the privilege of topping this transcendental pizza.\nHP+35 DEX+2\nAccuracy+9% (Max. 16)\nAttack+10% (Max. 21)",ja="美味しく焼けたアンチョビピザ。\nHP+35 DEX+2 命中+9% (最大16)\n攻+10% (最大21)"},
    [5701] = {id=5701,en="A well-rounded salad whose main\ningredient is finely diced nopales.\nSTR+1 AGI+6\nRanged Accuracy+20\nRanged Attack+10",ja="小さく刻んだノパルを盛り付けたサラダ。\nSTR+1 AGI+6 飛命+20 飛攻+10 "},
    [5702] = {id=5702,en="Everything that a salad should be.\nYou feel healthier just looking at it.\nSTR+2 AGI+7\nRanged Accuracy+25\nRanged Attack+15",ja="滋養たっぷりのエンサラダデノパル。\nSTR+2 AGI+7 飛命+25 飛攻+15 "},
    [5703] = {id=5703,en="A full-bodied milk extracted from the buffalos of Uleguerand Range.\n\"Regen\"+2 [120s.]",ja="口当たりのまろやかな野牛の乳。\nリジェネ+2[120秒]"},
    [5704] = {id=5704,en="A bean stew first concocted by\nThierride the fisherman, and\ncurrently in use as the official\nration of the Royal Army of\nSan d'Oria. Derives its flavor\nfrom the salts of Lake Lufet.\nVIT-1 AGI+5\nRanged Accuracy+5\n\"Regen\"+1",ja="漁師テリードが考案した豆のシチュー。\n王国軍のレーションとして制式採用されている。\n味の決め手は「ルフェ湖の塩」。\nVIT-1 AGI+5 飛命+5 リジェネ+1 "},
    [5705] = {id=5705,en="A homemade salisbury steak made\nfor you by your fellow. By modern\nconvention, it appears to be just\na smidgen overdone.\nAGI+1\nAccuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)",ja="フェローが焼いてくれたハンバーグ。\n少し焦げ過ぎているようだ。\nAGI+1 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40) "},
    [5706] = {id=5706,en="Homemade carbonara made for you\nby your fellow. The noodles have\nbeen boiled to a perfect consistency\nthat adheres ever so deliciously\n\"to the teeth.\"\nCHR+1\nAccuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10",ja="フェローが作ってくれたカルボナーラ。\n茹で加減は完璧なアルデンテ。\nCHR+1 命中+12% (最大80)\n攻+10% (最大40) 飛命+12% (最大80)\n飛攻+10% (最大40)"},
    [5707] = {id=5707,en="A homemade omelette made for you\nby your fellow. The soft, fluffy eggs\npractically melt in your mouth before\nyou can even chew them.\nAccuracy+12% (Max. 80)\nAttack+10% (Max. 40)\nRanged Accuracy+12% (Max. 80)\nRanged Attack+10% (Max. 40)\nDEF+5",ja="フェローが作ってくれたオムレツ。\nふんわりと口中でとろける柔らかさ。\n命中+12% (最大80) 攻+10% (最大40)\n飛命+12% (最大80) 飛攻+10% (最大40) 防+5 "},
    [5708] = {id=5708,en="A fish mithkabob bursting with the\nunbridled flavor of the sea. Made\nfrom a closely guarded House of\nMihgo family recipe.\nDEX+5 VIT+2 MND-2\nAccuracy+50\nRanged Accuracy+50\nEvasion+5\nDEF+25% (Max. 95)",ja="ミーゴ家伝統の野性味あふれる海の幸串焼。\nDEX+5 VIT+2 MND-2 命中+50 飛命+50\n回避+5 防+25% (最大95) "},
    [5709] = {id=5709,en="The original tooth-rotter, this old\nfavorite comes in a puff of cloudlike,\nsugary sweetness tangled elegantly\naround a stick.\nMP+10% (Max. 200)\nMP recovered while healing +3",ja="ふわふわした雲のような食感の砂糖菓子。\nMP+10% (最大200) ヒーリングMP+3 "},
    [5710] = {id=5710,en="A simple-yet-refreshing dessert\ncomprised of a heap of ice shavings\ndoused with a sweet dose of\nrolanberry syrup.\nMP+30% (Max. 30)\nINT+1 +5",ja="細かく削った氷で作った雪山状のデザート。\nロランベリー味のシロップがかけられている。\nMP+30% (最大30) INT+1 耐風+5 "},
    [5711] = {id=5711,en="A simple-yet-refreshing dessert\ncomprised of a heap of ice shavings\ndoused with a tangy dose of\nkitron syrup.\nMP+15% (Max. 15)\nINT+2 +5",ja="細かく削った氷で作った雪山状のデザート。\nキトロン味のシロップがかけられている。\nMP+15% (最大15) INT+2 耐風+5 "},
    [5712] = {id=5712,en="A ridiculously simple dessert comprised\nof nothing more than a heap of ice\nshavings doused with a sweet dose of\nthundermelon-flavored syrup.\nHP+10% (Max. 200) +5\nHP recovered while healing +3",ja="細かく削った氷で作った雪山状のデザート。\nサンダーメロン味のシロップがかけられている。\nHP+10% (最大200) 耐風+5 ヒーリングHP+3 "},
    [5713] = {id=5713,en="A pleasantly simple sunset-in-a-bowl,\nthis dessert is comprised of nothing\nmore than a heap of ice shavings\ndoused with a sweet dose of Saruta\norange-flavored syrup.\nMP+20% (Max. 20)\nAGI-1 INT+1 +5",ja="細かく削った氷で作った雪山状のデザート。\nサルタオレンジ味のシロップがかけられている。\nMP+20% (最大20) AGI-1 INT+1 耐風+5 "},
    [5714] = {id=5714,en="A showfish native to eastern Vana'diel\nthat is highly prized for its remarkably\nbeautiful scales, which are said to\nresemble round pearls.",ja="東方伝来の高級観賞魚。\n真珠のように丸い鱗が美しい。"},
    [5715] = {id=5715,en="A showfish native to western Vana'diel\nwhose name derives from its distinctive\nmottled coloring and elongated tail.",ja="西方伝来の高級観賞魚。\n彗星のように長い尾が美しい。"},
    [5716] = {id=5716,en="This potion instantly restores some HP.\nIt gives off a minty aroma that is quite refreshing to the senses.",ja="HPを瞬時に少量回復する秘薬。\nほのかな香りが気持ちを落ち着かせる。"},
    [5717] = {id=5717,en="A festive snack whipped up by the\nM&P Market chefs. The serving size\nis more than abundant.\nHP+5% (Max. 150)\nMP+5% (Max. 150)\nHP recovered while healing +2\nMP recovered while healing +2",ja="Ｍ＆Ｐの香具師が作った食べ物。\nボリューム満点！\nHP+5% (最大150) MP+5% (最大150)\nヒーリングHP+2 ヒーリングMP+2 "},
    [5718] = {id=5718,en="A popular dessert the world round,\nthis treat is comprised of sweet, fluffy\ncream injected into a thin, crispy crust.\nHP-10 INT+7",ja="薄い皮でクリームを包んだキャベツ型ケーキ。\nHP-10 INT+7 "},
    [5719] = {id=5719,en="Bountiful portions of seafood flavored\nin a pomodoro sauce saute. A favorite\namong seafarers.\nHP+15% (Max. 120)\nVIT+2 DEF+5\n\"Store TP\"+6\nHP recovered while healing +1",ja="魚介をポモドーロソースであえた船乗り風パスタ。\nHP+15% (最大120) VIT+2 防+5\nストアTP+6 ヒーリングHP+1"},
    [5720] = {id=5720,en="Made with the most select seafood\nand pasta boiled to perfection, this\ndish will no doubt leave an indelible\nimpression on whoever is fortunate\nenough to consume it.\nHP+15% (Max. 130)\nVIT+2 DEF+6\n\"Store TP\"+6\nHP recovered while healing +1",ja="美味しくできたマリナーラ。\nHP+15% (最大130) VIT+2 防+6\nストアTP+6 ヒーリングHP+1"},
    [5721] = {id=5721,en="Sliced, raw crab served on a small\nportion of sweet vinegar rice--a\npopular dish in Far Eastern nations.\nVIT+1\nAccuracy+13% (Max. 64)\nDEF+10 \"Resist Sleep\"+1",ja="炊いて握り固めたライスの上に陸ガニの生の\n切り身を乗せた東方伝来の料理。\nVIT+1 命中+13% (最大64) 防+10\nレジストスリープ+1 "},
    [5722] = {id=5722,en="A flawless marriage of delectable claw\nmeat and lovingly packed vinegar rice,\nbound together by invigoratingly fresh\nwasabi.\nVIT+2\nAccuracy+14% (Max. 68)\nDEF+15\n\"Resist Sleep\"+2",ja="美味しく握れたクラブスシ。\nVIT+2 命中+14% (最大68) 防+15\nレジストスリープ+2 "},
    [5724] = {id=5724,en="An odd-smelling collection of powder said to transform anyone who comes in contact with it.",ja="塗布した者の姿を変える不思議な粉。\n"},
    [5725] = {id=5725,en="A firework from a land far to the east.",ja="東方伝来の打上花火。\n"},
    [5726] = {id=5726,en="This edible member of the gourd\nfamily is cylindrical in shape and\ndark green in color.",ja="細長い濃緑色の果実の野菜。\n"},
    [5727] = {id=5727,en="Delicious and nutritious, this\ntraditional dish from the Far East\nis comprised of noodles made from\nbuckwheat flour.\nHP+12% (Max. 180) AGI+3\n\"Resist Sleep\"+5",ja="東方伝来の生蕎麦を用いた麺料理。\nHP+12% (最大180) AGI+3\nレジストスリープ+5 "},
    [5728] = {id=5728,en="Arguably one of the best\nservings of zaru soba ever made.\nHP+12% (Max. 185) AGI+4\n\"Resist Sleep\"+10",ja="美味しくできた笊蕎麦。\nHP+12% (最大185) AGI+4\nレジストスリープ+10 "},
    [5729] = {id=5729,en="A delectable fruit cream thickened\nwith gelatin, then chilled and molded\ninto a scrumptious dessert.\nHP+20 INT+3\nHP recovered while healing +3",ja="冷やし固めたゼラチンの菓子。\nHP+20 INT+3 ヒーリングHP+3 "},
    [5730] = {id=5730,en="A bavarois among bavarois. Using\nthe finest ripe fruits, this dish is\nchilled to the perfect consistency.\nHP+25 INT+4\nHP recovered while healing +4",ja="美しくできたババロア。\nHP+25 INT+4 ヒーリングHP+4 "},
    [5731] = {id=5731,en="Staple of the Royal Army, this\nrefreshing dish is a hodgepodge of\nstewed vegetables, chilled before\nserving.\nAGI+5 Evasion+5\n\"Undead Killer\"+5\nHP recovered while healing +2\nMP recovered while healing +2",ja="数種類の野菜を用いた王国軍の煮込み料理。\nAGI+5 回避+5 アンデッドキラー+5\nヒーリングHP+2 ヒーリングMP+2 "},
    [5732] = {id=5732,en="Marvelously stewed, masterfully\nseasoned, perfectly chilled ratatouille.\nAGI+6 Evasion+10\n\"Undead Killer\"+10\nHP recovered while healing +3\nMP recovered while healing +3",ja="程よく煮込んだラタトゥイユ。\nAGI+6 回避+10 アンデッドキラー+10\nヒーリングHP+3 ヒーリングMP+3 "},
    [5733] = {id=5733,en="This milk is known for its distinctive\nreddish-brown color. A hard-to-procure,\nlimited-time-only product direct from\nthe M.H.M.U. ranch.",ja="茶褐色の怪しげな乳飲料。\nモグハウス管理組合直営牧場の限定生産品。"},
    [5734] = {id=5734,en="This leather pouch is used to carry\nlarge quantities of the ninja tool\nsoshi.",ja="『草子』を収納するたすき。\n多数の忍具を携帯できる。"},
    [5735] = {id=5735,en="A miraculously preserved, ancient\ncoin purse fashioned from cotton.\nIt appears to contain a few pieces\nof alexandrite.",ja="木綿布の小さな袋。\n「アレキサンドライト」がごろごろ入っている。"},
    [5736] = {id=5736,en="A miraculously preserved, ancient\ncoin purse fashioned from linen.\nIt appears to contain a considerable\nnumber of pieces of alexandrite.",ja="亜麻布の小さな袋。\n「アレキサンドライト」がざくざく入っている。"},
    [5737] = {id=5737,en="An incredibly simple dish made by\nroasting hare meat seasoned with salt.\nHP+10 STR+1\nHP recovered while healing +1",ja="野兎の肉を塩焼きにしただけの素朴な料理。\nHP+10 STR+1 ヒーリングHP+1 "},
    [5738] = {id=5738,en="An incredibly simple dish made by\nroasting lizard tail basted with honey.\nHP+5 MP+5 DEX+1\nHP recovered while healing +2\nMP recovered while healing +2",ja="トカゲの尻尾に蜂蜜をかけて焼いた素朴な料理。\nHP+5 MP+5 DEX+1 ヒーリングHP+2\nヒーリングMP+2 "},
    [5739] = {id=5739,en="An incredibly simple beverage\nmade by mixing raw egg with honey.\nMP+8 INT+1\nMP recovered while healing +1",ja="生卵に蜂蜜を加えただけの素朴な飲料。\nMP+8 INT+1 ヒーリングMP+1 "},
    [5740] = {id=5740,en="A spice coveted more for\nits sweetness than its spiciness.",ja="辛味よりも甘味を感じるスパイス。\n"},
    [5741] = {id=5741,en="An ornate flask containing a murky,\npungent liquid commonly used in the\nRuhotz Silvermines to ward off\ninsect attacks.\nIts potent aroma suppresses the\npests' hostile instincts.",ja="ルホッツ銀山で蟲除けに使われている線香。\n蟲の攻撃本能を抑制する成分が含まれている。"},
    [5742] = {id=5742,en="A bottle of rich, creamy buffalo milk,\nlovingly produced by the moogles at\nBuffalo Bonanza Ranch.",ja="濃厚な味わいの野牛の乳。\nBBQ牧場製。"},
    [5743] = {id=5743,en="A classic pizza recipe using a zesty\nmarinara sauce, and topped with\ndelectable chunks of fish and seafood.",ja="ニンニクとトマトを乗せた船乗り風ピザ。\n"},
    [5744] = {id=5744,en="Ahoy there, captain!\nYou've hauled in the ultimate in\nseafood pizzas, simply loaded with\nsucculent morsels of only the\nfinest ocean delights.",ja="美味しく焼けたマリナーラピザ。\n"},
    [5745] = {id=5745,en="A delectable cherry cream thickened\nwith gelatin, then chilled and molded\ninto a scrumptious dessert.\nHP+25 MP+10 INT+3\nHP recovered while healing +3",ja="冷やし固めた、桜桃風味のゼラチン菓子。\nHP+25 MP+10 INT+3 ヒーリングHP+3 "},
    [5746] = {id=5746,en="The sweetest, ripest cherries have\nbeen hand-picked to create a sublime\nbavarois fit for emperors and kings.\nHP+30 MP+15 INT+4\nHP recovered while healing +4",ja="美しくできたチェリーババロア。\nHP+30 MP+15 INT+4 ヒーリングHP+4 "},
    [5747] = {id=5747,en="A zesty tomato sauce flavored with\nolives and anchovies.\nPerfect for seafood dishes.",ja="オリーブやアンチョビで味付けしたトマトソース。\n"},
    [5748] = {id=5748,en="This petite perfume pouch gives off the faint scent of old timber.",ja="古びた木の香りがする、奇妙な匂い袋。\n"},
    [5749] = {id=5749,en="This petite perfume pouch gives off the displeasing scent of squashed insects.",ja="土臭い虫の香りがする、奇妙な匂い袋。\n"},
    [5750] = {id=5750,en="A rich and spicy stew made with\nchunks of coeurl meat and an\nassortment of vegetables. A popular\nration in the Republic during the Great\nWar.\nVIT+3 INT-2\nAccuracy+10% (Max. 54)\nDEF+10% (Max. 30)",ja="クァールの肉を煮込んだシチュー。\n大戦中、共和国軍の野戦食として愛された。\nVIT+3 INT-2 命中+10% (最大54)\n防+10% (最大30) "},
    [5751] = {id=5751,en="A savory bowl of goulash so piping\nhot that it could warm the bones of\nany Bastoker on even the coldest\nnights. A particularly favored dish\namong the Republic's musketeers.\nVIT+4 INT-2\nAccuracy+11% (Max. 58)\nDEF+11% (Max. 35)",ja="じっくり煮込んだ、まろやかな味のグヤーシュ。\n大戦中、共和国軍の銃士に愛された。\nVIT+4 INT-2 命中+11% (最大58)\n防+11% (最大35) "},
    [5752] = {id=5752,en="A stew of rabbit meat and assorted vegetables in a lightly seasoned broth. A popular ration in the Kingdom during the Great War.\nSTR+3 AGI+3 INT-3\nRanged Accuracy+10% (Max. 50)\nRanged Attack+15% (Max. 60)\nEnmity-3",ja="野兎の肉と野菜の煮物料理。\n大戦中、王国軍の野戦食として愛された。\nSTR+3 AGI+3 INT-3 飛命+10% (最大50)\n飛攻+15% (最大60) 敵対心-3 "},
    [5753] = {id=5753,en="This hearty pot-au-feu is overflowing with succulent chunks of meat and the freshest vegetables. A particularly favored dish among the Kingdom's archers.\nSTR+4 AGI+4 INT-3\nRanged Accuracy+11% (Max. 55)\nRanged Attack+16% (Max. 65)\nEnmity-3",ja="じっくり煮込んだ、コクのあるポトフ。\n大戦中、王国軍の長弓兵に愛された。\nSTR+4 AGI+4 INT-3 飛命+11% (最大55)\n飛攻+16% (最大65) 敵対心-3 "},
    [5754] = {id=5754,en="A vial of perfume with a Moblin Maze Mongers label. It smells of an odd blend of musk and cave dust.",ja="メイズモンガー社のラベルが貼られた香水。\n"},
    [5755] = {id=5755,en="A roasted slab of ruszor meat, nutritious and rich in flavor.",ja="滋味で知られるルスゾルのロース。\n"},
    [5756] = {id=5756,en="A crispy fried bun with a spicy green curry filling.\nVIT+1 AGI+2\nRanged Accuracy+5% (Max. 25)\nDEF+9% (Max. 160)\n\"Resist Sleep\"+3\nHP recovered while healing +2\nMP recovered while healing +1",ja="グリーンカレーを包んで揚げた惣菜パン。\nVIT+1 AGI+2 飛命+5% (最大25)\n防+9% (最大160) レジストスリープ+3\nヒーリングHP+2 ヒーリングMP+1"},
    [5757] = {id=5757,en="A crispy fried bun with a tangy yellow curry filling.\nHP+20 STR+5 AGI+2 INT-4\nAttack+20% (Max. 75)\nRanged Attack+21% (Max. 75)\n\"Resist Sleep\"+3\n\"Resist Stun\"+4\nHP recovered while healing +2\nMP recovered while healing +1",ja="イエローカレーを包んで揚げた惣菜パン。\nHP+20 STR+5 AGI+2 INT-4\n攻+21% (最大75) 飛攻+21% (最大75)\nレジストスリープ+3 レジストスタン+4\nヒーリングHP+2 ヒーリングMP+1"},
    [5758] = {id=5758,en="A crispy fried bun with a piquant black curry filling.\nDEX+2 VIT+4 INT+1\nAccuracy+5 Ranged Accuracy+5\nEvasion+5 DEF+15% (Max. 180)\n\"Resist Sleep\"+3\nHP recovered while healing +2\nMP recovered while healing +1",ja="ブラックカレーを包んで揚げた惣菜パン。\nDEX+2 VIT+4 INT+1 命中+5 飛命+5 回避+5\n防+15% (最大180) レジストスリープ+3\nヒーリングHP+2 ヒーリングMP+1 "},
    [5759] = {id=5759,en="A crispy fried bun with an aromatic red curry filling.\nHP+25 STR+7 AGI+1 INT-2\nAttack+23% (Max. 150)\nRanged Attack+23% (Max. 150)\n\"Demon Killer\"+4\n\"Resist Sleep\"+3\nHP recovered while healing +2\nMP recovered while healing +1",ja="レッドカレーを包んで揚げた惣菜パン。\nHP+25 STR+7 AGI+1 INT-2\n攻+23% (最大150) 飛攻+23% (最大150)\nデーモンキラー+4 レジストスリープ+3\nヒーリングHP+2 ヒーリングMP+1 "},
    [5760] = {id=5760,en="This delectable dish of seasoned\nground beef rolled in pickled cabbage\nleaves was a popular wartime ration\namong Republican soldiers.\nSTR+3 AGI+3 INT-5\nRanged Accuracy+8% (Max. 60)\nRanged Attack+14% (Max. 65)\nEnmity-4 \"Subtle Blow\"+5",ja="キャベツの葉で挽肉を包んで煮た料理。\n大戦中、共和国軍の陣中食として愛された。\nSTR+3 AGI+3 INT-5 飛命+8% (最大60)\n飛攻+14% (最大65) 敵対心-4 モクシャ+5 "},
    [5761] = {id=5761,en="A veritable Kaiser among kohlrouladen,\ncontaining only the finest hand-picked\ningredients and simmered to savory\nperfection.\nSTR+4 AGI+4 INT-4\nRanged Accuracy+10% (Max. 65)\nRanged Attack+16% (Max. 70)\nEnmity-5 \"Subtle Blow\"+6",ja="やわらかく煮込んだ、コールロラーデン。\n大戦中、共和国軍の砲兵に愛された。\nSTR+4 AGI+4 INT-4 飛命+10% (最大65)\n飛攻+16% (最大70) 敵対心-5 モクシャ+6 "},
    [5762] = {id=5762,en="With a generous portion of savory green curry nearly bursting from its flaky crust, this piping hot bun is a treat to all five senses.\nVIT+3 AGI+4\nRanged Accuracy+10% (Max. 25)\nDEF+13% (Max. 180)\n\"Resist Sleep\"+5\nHP recovered while healing +6\nMP recovered while heali",ja="からりと揚げたグリーンカレーパン。\nVIT+3 AGI+4 飛命+10% (最大25)\n防+13% (最大180) レジストスリープ+5\nヒーリングHP+6 ヒーリングMP+3"},
    [5763] = {id=5763,en="With a generous portion of yellow curry bursting from its crust, this piping hot bun is a treat to all five senses.\nHP+30 STR+5 VIT+2 AGI+3 INT-2\nAttack+22% (Max. 85)\nRanged Attack+22% (Max. 85)\n\"Resist Sleep\"+5\n\"Resist Stun\"+6\nHP recovered while healing +6\nMP re",ja="からりと揚げたイエローカレーパン。\nHP+30 STR+5 VIT+2 AGI+3 INT-2\n攻+22% (最大85) 飛攻+22% (最大85)\nレジストスリープ+5 レジストスタン+6\nヒーリングHP+6 ヒーリングMP+3"},
    [5764] = {id=5764,en="With a generous portion of black curry bursting from its crust, this piping hot bun is a treat to all five senses.\nDEX+4 VIT+6 INT+3 MND+1\nAccuracy+7\nRanged Accuracy+7 Evasion+7\nDEF+25% (Max. 200)\n\"Resist Sleep\"+5\nHP recovered while healing +6\nMP recovered while heal",ja="からりと揚げたブラックカレーパン。\nDEX+4 VIT+6 AGI+2 INT+3 MND+1 命中+7\n飛命+7 回避+7 防+25% (最大200)\nレジストスリープ+5 ヒーリングHP+6 ヒーリングMP+3"},
    [5765] = {id=5765,en="With a generous portion of red curry bursting from its crust, this piping hot bun is a treat to all five senses.\nHP+35 STR+7 AGI+3\nAttack+25% (Max. 150)\nRanged Attack+25% (Max. 150)\n\"Demon Killer\"+6\n\"Resist Sleep\"+5\nHP recovered while healing +6\nMP recovered while he",ja="からりと揚げたレッドカレーパン。\nHP+35 STR+7 AGI+3 攻+25% (最大150)\n飛攻+25% (最大150) デーモンキラー+6\nレジストスリープ+5 ヒーリングHP+6 ヒーリングMP+3"},
    [5766] = {id=5766,en="This popular dessert pastry is flaky at the edges, soft at the center, and stuffed with creamy butter and sweet maple sugar.\nHP+10% (Max. 10)\nMagic Accuracy+20% (Max. 25)\n\"Magic Def. Bonus\"+1",ja="新鮮なバターと甘いメープルシュガーを挟み、\n綺麗に三つ折りにした定番のクレープ。\nHP+10% (最大10) 魔命+20% (最大25) 魔防+1 "},
    [5767] = {id=5767,en="Using only the finest ingredients and pan-fried to golden perfection, this butter crepe would be a treat for the palate of the Goddess herself.\nHP+10% (Max. 15)\nMagic Accuracy+21% (Max. 30)\n\"Magic Def. Bonus\"+2",ja="美味しく焼けたバタークレープ。\nHP+10% (最大15) 魔命+21% (最大30)\n魔防+2 "},
    [5768] = {id=5768,en="This pair of strikingly stylish spectacles will allow even a unenlightened non-moogle to read the arcane glyphs of a Magian trial log.",ja="メイジャンの試練帖を読むための眼鏡。\n"},
    [5769] = {id=5769,en="The invention of a mirthful young alchemist, this compact firework is ideally suited to casual celebrations with one's friends.",ja="若手錬金術師が製造した、友への祝意を表した\n花火。"},
    [5770] = {id=5770,en="The Reraise effect of this potion\nis even stronger than that of the hi-reraiser.",ja="更に強力なリレイズの効果がある秘薬。\n"},
    [5771] = {id=5771,en="This San d'Orian crepe is flaky at the edges, soft at the center, and stuffed with scrumptious smoked ham and melted cheese.\nHP+10% (Max. 25)\nSTR+2 VIT+1\nMagic Accuracy+10\n\"Magic Def. Bonus\"+3\nHP recovered while healing +2",ja="香り高いチーズやソーセージを挟み、綺麗に\n三つ折りにしたサンドリア風のクレープ。\nHP+10% (最大25) STR+2 VIT+1 魔命+10 魔防+3 ヒーリングHP+2 "},
    [5772] = {id=5772,en="Using only the finest ham and cheese and pan-fried to golden perfection, this San d'Orian crepe would be a treat for the palate of Prince Trion himself.\nHP+10% (Max. 30)\nSTR+2 VIT+1\nMagic Accuracy+15\n\"Magic Def. Bonus\"+4\nHP recovered while healing +3",ja="美味しく焼けたハムチーズクレープ。\nHP+10% (最大30) STR+2 VIT+1 魔命+15 魔防+4 ヒーリングHP+3 "},
    [5773] = {id=5773,en="This Bastokan crepe is flaky at the edges, soft at the center, and stuffed with assorted wild mushrooms in a savory sauce.\nMP+10% (Max. 30) MND+2\nMagic Accuracy+10\n\"Magic Def. Bonus\"+5",ja="森の恵みである種々のキノコを挟み、綺麗に\n三つ折りにしたバストゥーク風のクレープ。\nMP+10% (最大30) MND+2 魔命+10 魔防+5 "},
    [5774] = {id=5774,en="Using only the finest mushrooms and pan-fried to golden perfection, this Bastokan crepe would be a treat for the palate of the president himself.\nMP+10% (Max. 35) MND+2\nMagic Accuracy+15\n\"Magic Def. Bonus\"+6",ja="美味しく焼けたキノコクレープ。\nMP+10% (最大35) MND+2 魔命+15 魔防+6 "},
    [5775] = {id=5775,en="This Windurstian crepe is flaky at the edges, soft at the center, and stuffed with rich dark chocolate.\nHP+5% (Max. 15)\nMagic Accuracy+20% (Max. 35)\n\"Magic Def. Bonus\"+1\nMP recovered while healing +2",ja="新鮮なパママや甘いチョコを挟み、綺麗に\n三つ折りにしたウィンダス風のクレープ。\nHP+5% (最大15) 魔命+20% (最大35) 魔防+1\nヒーリングMP+2 "},
    [5776] = {id=5776,en="Using only the finest chocolate and pan-fried to golden perfection, this Windurstian crepe would be a treat for the palate of the Star Sibyl herself.\nHP+5% (Max. 20)\nMagic Accuracy+21% (Max. 40)\n\"Magic Def. Bonus\"+2\nMP recovered while healing +3",ja="美味しく焼けたチョコクレープ。\nHP+5% (最大20) 魔命+21% (最大40)\n魔防+1 ヒーリングMP+3 "},
    [5777] = {id=5777,en="This Jeunoan crepe is flaky at the edges, soft at the center, and stuffed with honey-sweetened chunks of pear.\nINT+2 Magic Accuracy+20% (Max. 45)\n\"Magic Def. Bonus\"+1\nMP recovered while healing +2",ja="シナモンの風味がアクセントのペアやリンゴを\n挟み、綺麗に三つ折りにしたジュノ風のクレープ。\nINT+2 魔命+20% (最大45) 魔防+1 ヒーリングMP+2 "},
    [5778] = {id=5778,en="Using only the finest pears and pan-fried to golden perfection, this Jeunoan crepe would be a treat for the palate of the archduke himself.\nINT+2\nMagic Accuracy+21% (Max. 50)\n\"Magic Def. Bonus\"+1\nMP recovered while healing +3",ja="美味しく焼けたペアクレープ。\nINT+2 魔命+21% (最大50) 魔防+1\nヒーリングMP+3 "},
