    [5883] = {id=5883,en="A magically enhanced firework developed by the Rhinostery of Windurst.",ja="ウィンダス鼻の院が開発した、新型魔法花火。\n運悪くシャントット博士の気まぐれにつきあわされた。"},
    [5884] = {id=5884,en="A firework from a land far to the east. Said to be the latest masterwork of an up-and-coming young artisan.",ja="東方伝来の爆発型打上花火。\n若手職人が開発したという最新型。"},
    [5885] = {id=5885,en="A savory pastry stuffed full of assorted meats and vegetables.\nHP+6% (Max. 100)\nIncreases rate of combat\nskill gains by 20%",ja="さまざまな具材をくるんで焼いたパンの一種。\nHP+6% (最大100) 戦闘スキル上昇率×120%"},
    [5886] = {id=5886,en="This saltena is stuffed nearly to bursting with a delectable array of mushrooms stewed in a rich gravy.\nHP+7% (Max. 120)\nIncreases rate of combat\nskill gains by 40%",ja="数種類のキノコが入ったサルテーニャ。\nHP+7% (最大120) 戦闘スキル上昇率×140% "},
    [5887] = {id=5887,en="A scrumptious saltena stuffed full of wild vegetables, herbs, and other ingredients collected in the hills.\nHP+8% (Max. 140)\nIncreases rate of combat\nskill gains by 60%",ja="陸の食材をふんだんに使ったサルテーニャ。\nHP+8% (最大140) 戦闘スキル上昇率×160% "},
    [5888] = {id=5888,en="A scrumptious saltena stuffed full of fresh catches of fish and assorted deep sea delights.\nHP+9% (Max. 160)\nIncreases rate of combat\nskill gains by 80%",ja="海の食材をふんだんに使ったサルテーニャ。\nHP+9% (最大160) 戦闘スキル上昇率×180%"},
    [5889] = {id=5889,en="Half-moon-shaped flatbread with a pocket that can be stuffed with one's favorite ingredients. Favored in Windurst as a tasty, easily transportable snack.\nMP+6% (Max. 100)\nIncreases rate of magic\nskill gains by 20%",ja="平たい半月状のパンの一種。\n内側の空洞部分に好みの具材を入れて食べる。\nMP+6% (最大100) 魔法スキル上昇率×120% "},
    [5890] = {id=5890,en="This scrumptious pitaru sandwich is stuffed full with succulent chunks of cockatrice meat.\nMP+7% (Max. 110)\nIncreases rate of magic\nskill gains by 40%",ja="コカトリスの肉を使ったピタサンド。\nMP+7% (最大110) 魔法スキル上昇率×140% "},
    [5891] = {id=5891,en="A pitaru sandwich for the health-conscious, stuffed with light-yet-filling morsels of shrimp and butterpear.\nMP+8% (Max. 120)\nIncreases rate of magic\nskill gains by 60%",ja="エビとアボカドの組み合わせが絶妙なピタサンド。\nMP+8% (最大120) 魔法スキル上昇率×160% "},
    [5892] = {id=5892,en="Buffalo, egg, and winterflower: three great tastes that go great together.\nMP+9% (Max. 130)\nIncreases rate of magic\nskill gains by 80%",ja="3種の食材の食感が楽しいピタサンド。\nMP+9% (最大130) 魔法スキル上昇率×180% "},
    [5893] = {id=5893,en="A Near Eastern seafood\nstew that is a favorite of\nfishermen in the Gugru Blue.\nHP+90 Accuracy+90\nRanged Accuracy+90\nMagic Accuracy+90\nPet: Accuracy+70\nRanged Accuracy+70\nMagic Accuracy+70",ja="ググリュー洋の漁師が好んでいた料理を再現させた鍋料理。\nHP+90 命中+90 飛命+90 魔命+90\nペット:命中+70 飛命+70 魔命+70 "},
    [5894] = {id=5894,en="The cooking of this marine\nstewpot was strictly supervised\nto ensure that the ingredients\nwere added in the proper manner.\nHP+95 Accuracy+95\nRanged Accuracy+95\nMagic Accuracy+95\nPet: Accuracy+75\nRanged Accuracy+75\nMagic Accuracy+75",ja="美味しくつつけるように食材の投入や\n手順が厳しく監視された漁師風近東鍋。\nHP+95 命中+95 飛命+95 魔命+95\nペット:命中+75 飛命+75 魔命+75 "},
    [5895] = {id=5895,en="This variety of mushroom emits no odor.",ja="香りのない食用キノコの一種。\n"},
    [5896] = {id=5896,en="This rare species of moss may be used to rid a room of noxious odors.",ja="消臭効果があるという珍しい苔。\n"},
    [5897] = {id=5897,en="A tree root that fills the air with a most marvelous fragrance.",ja="良い香りがする樹木の根。\n"},
    [5898] = {id=5898,en="The skull of a nightmare-inducing dragon.",ja="悪夢をよびおこすドラゴンの頭骨。\n"},
    [5899] = {id=5899,en="The thighbone of a nightmare-inducing dragon.",ja="悪夢をよびおこすドラゴンの大腿骨。\n"},
    [5900] = {id=5900,en="The talon of a nightmare-inducing dragon.",ja="悪夢をよびおこすドラゴンの爪。\n"},
    [5901] = {id=5901,en="The heart of a nightmare-inducing dragon.",ja="悪夢をよびおこすドラゴンの心の臓。\n"},
    [5902] = {id=5902,en="A vial containing the blood of a captured beastman whose soul was removed.",ja="魂の囚われた獣人の血液。\n"},
    [5903] = {id=5903,en="A vial of ink from a particularly venomous species of sea monk.",ja="毒性の強い頭足類の墨。\n"},
    [5904] = {id=5904,en="A gaping hole in the middle of this wing is its most striking feature.",ja="穴のあいた黒い翼。\n"},
    [5905] = {id=5905,en="You can still feel this fragment from the shattered remains of an immortal golem twitch when you hold it.",ja="不滅の象徴とされたゴーレムの破片。\n"},
    [5906] = {id=5906,en="A page taken from a lengthy treatise on battle tactics penned by the archmage Abdhaljs.\nLv.75 All Jobs",ja="コンフリクト推進派として有名な、\n魔道士アブダルス著の戦術魔道書の一部。\n紋章官必読の書。\nLv75～ All Jobs"},
    [5907] = {id=5907,en="Easily identified by its flowering top, this vegetable is rich in both flavor and nutrients.",ja="花蕾と花茎を食す多年草。\n"},
    [5908] = {id=5908,en="Prized for its nutty flavor and melt-in-your-mouth texture, this nutritious vegetable is best consumed when it is neither too firm nor too soft to the touch.",ja="非常に栄養価の高い果実。\nただし、食べ頃には注意が必要。"},
    [5909] = {id=5909,en="A speciality of the Rarab Tail Hostelry. Marinated with Chamama's secret blend of herbs and spices.",ja="ララブのしっぽ亭名物の漬け物。\nその味付けは門外不出。"},
    [5910] = {id=5910,en="A pouch containing a sheet of heavy metal.",ja="『ヘヴィメタル』を収納したハンドバッグ。\n"},
    [5911] = {id=5911,en="Marinated for fifty years according to a secret recipe passed down for generations at the Rarab Tail Hostelry, this pickled delicacy is only for the discerning palate.",ja="ララブのしっぽ亭で代々漬け込まれてきた古漬。\n深い風味とコクがある。"},
    [5912] = {id=5912,en="This leather quiver is used to carry large quantities of gargouille arrows.",ja="『ガーゴイルアロー』を収納する武具。\n多数の矢を携帯できる。"},
    [5913] = {id=5913,en="This leather quiver is used to carry large quantities of adaman bolts.",ja="『アダマンボルト』を収納する武具。\n多数のボルトを携帯できる。"},
    [5914] = {id=5914,en="This leather pouch is used to carry large quantities of orichalcum bullets.",ja="『オリハルブレット』を収納する武具。\n多数のブレットを携帯できる。"},
    [5915] = {id=5915,en="This leather pouch is used to carry large quantities of adaman bullets.",ja="『アダマンブレット』を収納する武具。\n多数のブレットを携帯できる。"},
    [5916] = {id=5916,en="A Valentione's gift from Curilla of the San d'Orian Temple Knights. The message accompanying the exquisite confection reads, \"I shall protect you always.\"",ja="「神殿騎士団団長」クリルラから届いた\nプレゼント。\n菓子言葉『あなたを守ります』"},
    [5917] = {id=5917,en="A Valentione's gift from Regine of Regine's Magicmart. Teaches no spells whatsoever, but it sure tastes good.",ja="「ルジヌ魔法用品店」ルジヌから届いた\nプレゼント。\n※食べても魔法は覚えられません"},
    [5918] = {id=5918,en="A Valentione's gift from Ayame of the Mythril Musketeers. So sharp is the edge of the chocolate blade that it appears as if it could draw blood.",ja="「ミスリル銃士隊」アヤメから届いたプレゼント。\n侍憧れの一振りを模ったチョコレート。"},
    [5919] = {id=5919,en="This stylish Valentione's gift from fashion maven Brygid is a chocolate confection in the shape of a subligar. You'd best exercise after eating, lest it go straight to your hips!",ja="「未来のファッションリーダー」ブリジッドから\n届いたプレゼント。\nサブリストに人気のサブリガ占い付き。"},
    [5920] = {id=5920,en="A cloyingly sweet Valentione's confection from Kupipi, cleric of Heavens Tower. The rich chocolate flavor is si～mply divi～ne!",ja="「天の塔書記官」クピピから届いたプレゼント。\n食べやがれ！……なのなのです。"},
    [5921] = {id=5921,en="A Valentione's delicacy conceived by Chamama of the Rarab Tail Hostelry, this chocolate-covered pickle is said to be far more appetizing than it appears.",ja="「ララブのしっぽ亭」チャママから届いた\nプレゼント。\nピチチ垂涎のおやつ。"},
    [5922] = {id=5922,en="A crunchy and fragrant walnut cookie\nwith a hint of cinnamon.\n\"Bird Killer\"+10\n\"Resist Paralyze\"+10\nHP recovered while healing +3\nMP recovered while healing +6",ja="胡桃の入ったクッキー。\nバードキラー+10 レジストパライズ+10\nヒーリングHP+3 ヒーリングMP+6 "},
    [5923] = {id=5923,en="A scrumptious cookie featuring\nsizable chunks of roasted walnut\nand an assortment of exotic\nsugars and spices.\n\"Bird Killer\"+12\n\"Resist Paralyze\"+12\nHP recovered while healing +5\nMP recovered while healing +8",ja="美味しく焼けたクルミクッキー。\nバードキラー+12 レジストパライズ+12\nヒーリングHP+5 ヒーリングMP+8 "},
    [5924] = {id=5924,en="This salisbury steak made from\nCerberus meat emits thin wisps of\nsmoke that never seem to die.\nHP+30 STR+7 INT-5\nAttack+20% (Max. 160)\nRanged Attack+20% (Max. 160)\n\"Dragon Killer\"+5",ja="ケルベロスの挽き肉を焼いた料理。\nHP+30 STR+7 INT-5 攻+20% (最大160)\n飛攻+20% (最大160) ドラゴンキラー+5 "},
    [5925] = {id=5925,en="This unsightly salisbury steak looks as\nif it has been blackened and charred\nby the flames of the underworld.\nHP+32 STR+8 INT-6\nAttack+22% (Max. 165)\nRanged Attack+22% (Max. 165)\n\"Dragon Killer\"+5",ja="美味しく焼けたヘルズバーグ。\nHP+32 STR+8 INT-6 攻+22% (最大165)\n飛攻+22% (最大165) ドラゴンキラー+5 "},
    [5926] = {id=5926,en="An exotic black tea with the faint\nsweet aroma of dates.\nHP+20 MP+30 VIT-1\nINT+3 CHR+5",ja="ほんのりとデーツの甘みと香りがする紅茶。\nHP+20 MP+30 VIT-1 INT+3 CHR+5 "},
    [5927] = {id=5927,en="A particularly aromatic cup of date\ntea. Its delightful taste promises to\nsoothe one's soul on even the longest,\nmost arduous of journeys.\nHP+22 MP+32 INT+4 CHR+6",ja="美味しく淹れたデーツティー。\nHP+22 MP+32 INT+4 CHR+6 "},
    [5928] = {id=5928,en="A rice ball so dainty and tasty it's fit\nto be dined upon by a princess.\nHP+25 DEX+4 VIT+4 CHR+4\nEffect: Attack+60 DEF+40\n\"Triple Attack\"+1%",ja="姫様の愛情いっぱいのおにぎり。\nHP+25 DEX+4 VIT+4 CHR+4\n真の味:攻+60 防+40 トリプルアタック+1%"},
    [5929] = {id=5929,en="A himesama rice ball so perfectly\nformed one might think it was rolled\nby the loving hands of an actual\nprincess.\nHP+50 DEX+5 VIT+5 CHR+5\nEffect: Attack+60 DEF+40\n\"Triple Attack\"+2%",ja="魂をこめて握られた姫様おにぎり。\nHP+50 DEX+5 VIT+5 CHR+5\n真の味:攻+60 防+40 トリプルアタック+2%"},
    [5930] = {id=5930,en="This flavorful and spicy mushroom soup is sure to put a spring in your step.\nMP+30 MND+4\nEnmity-4\nMP recovered while healing +4",ja="踊り出すほど元気になると云うキノコのスープ。\nMP+30 MND+4 敵対心-4 ヒーリングMP+4 "},
    [5931] = {id=5931,en="A mushroom soup so savory and scrumptious that it will have you dancing through the streets in joy.\nMP+32 MND+5\nEnmity-5\nMP recovered while healing +5",ja="美味しくできたダンシングスープ。\nMP+32 MND+5 敵対心-5 ヒーリングMP+5 "},
    [5932] = {id=5932,en="Fresh-squeezed kitron juice.\n\"Refresh\"+3 [180s.]",ja="キトロンの絞り汁。\nリフレシュ+3[180秒]"},
    [5933] = {id=5933,en="Dragon fruit-flavored milk.\n\"Regen\"+6 [300s.]",ja="ドラゴンフルーツ味のミルク。\nリジェネ+6[300秒]"},
    [5934] = {id=5934,en="A crispy, crunchy cookie charmingly\ncut in the shape of a baby chocobo.\nCHR+3 Evasion+2\n\"Aquan Killer\"+10\n\"Resist Silence\"+10\nMP recovered while healing +3",ja="チョコボの雛鳥の形に焼かれたクッキー。\nCHR+3 回避+2 アクアンキラー+10\nレジストサイレス+10 ヒーリングMP+3 "},
    [5935] = {id=5935,en="A delightful dairy delicacy made with\nfarm-fresh milk from the MHMU's\nBuffalo Bonanza Ranch.\nHP+20% (Max. 20) VIT+3\nHP recovered while healing +3",ja="モーグリが作ったヨーグルト。\n野牛の乳を使った、モーグリの自信作。\nHP+20% (最大20) VIT+3 ヒーリングHP+3 "},
    [5936] = {id=5936,en="A traditional moogle firework popular since the days of the lost kingdom of Kupalika.",ja="クパリカ王国伝来とされる祝祭用の打上花火。\n"},
    [5937] = {id=5937,en="An ephemeral firework designed around the theme of fleeting beauty.",ja="物悲しい美しさの水泡花火。\n"},
    [5938] = {id=5938,en="Used in dire emergencies, this whistle calls nearby Meebles to help its bearer escape and fight another day.",ja="プログラムの途中で脱出する際、ミーブル族を呼ぶための笛。\n使用したメンバーだけが脱出することができる。"},
    [5939] = {id=5939,en="This whistle calls nearby Meebles to help the bearer's whole party escape after completing an expedition.",ja="プログラム達成後に脱出する際、ミーブル族を呼ぶための笛。\nパーティメンバー全員が脱出することができる。"},
    [5940] = {id=5940,en="The most popular souvenir from\nAdoulin, this cookie packs enough\nenergy from the dried fruit inside to\ncarry a weary trailblazer across the\nwhole continent.\n\"Aquan Killer\"+12\n\"Resist Sleep\"+10\nMP recovered while healing +5",ja="乾燥した果実の入ったクッキー。\nアドゥリン土産人気No.1。\nアクアンキラー+12 レジストスリープ+10\nヒーリングMP+5 "},
    [5941] = {id=5941,en="The third most popular souvenir from\nAdoulin, this bar of chocolate saves\nstarving pioneers' tongues by not\nbeing overly sweet.\nMND+1\nMP recovered while healing +2",ja="甘すぎないと評判の板状のチョコレート。\nアドゥリン土産人気No.3。\nMND+1 ヒーリングMP+2 "},
    [5942] = {id=5942,en="The second most popular souvenir from\nAdoulin, the flavor of this candy\nis often likened to releasing a\nwaterfall inside one's mouth.\nMND+4 CHR+4",ja="はじける泡が心地よいキャンディ。\nアドゥリン土産人気No.2。\nMND+4 CHR+4 "},
    [5943] = {id=5943,en="The faint aroma of a warm summer's\nday exudes from the lightly smoked\nflesh of this mackerel.\nVIT-3 AGI+4\nEvasion+5",ja="アジェを天日乾燥させた保存食。\nVIT-3 AGI+4 回避+5 "},
    [5944] = {id=5944,en="This carbonated beverage is made with only the cleanest and freshest spring water in all of Adoulin.",ja="アドゥリンで採れる天然の炭酸水。\n"},
    [5945] = {id=5945,en="This resplendent pulverization gives off the tantalizing scent of a newly opened treasure chest.",ja="塗布した者の姿を変える不思議な粉。\n"},
    [5946] = {id=5946,en="A hempen sack, worn and frayed by time. It bears an image of tumbling dice.",ja="『トリックダイス』の入った袋。\n"},
    [5947] = {id=5947,en="A hempen sack, worn and frayed by time. It bears an image of dream-like dust.",ja="『リミナルレジデ』の入った袋。\n"},
    [5948] = {id=5948,en="A crustacean that dances in the waters of the Senroh Sea, camouflaged by its murkily pigmented shell.",ja="センロー海周辺の海底に生息する甲殻類。\n"},
    [5949] = {id=5949,en="A type of bivalve, this shellfish can be found clinging desperately to boulders and reefs across the islands that dot Ulbuka's coastline.",ja="ウルブカ諸島の岩礁に附着する\n二枚貝の一種。"},
    [5950] = {id=5950,en="This saltwater fish makes its home in the Senroh Sea, which may just be the reason its smoked and sliced brethren taste so delicious.",ja="センロー海周辺に生息する海水魚。\n"},
    [5951] = {id=5951,en="This gigantic fish that swims off the shores off Foret de Hennetiel intimidates not only with its size, but also the vast amounts of deadly poison it stores within its body.",ja="エヌティエル水林近海に生息する\n猛毒を持つ巨大海水魚。"},
    [5952] = {id=5952,en="A poisonous freshwater fish that populates the Zoldeff River in Foret de Hennetiel.",ja="エヌティエル水林に生息する\n猛毒を持つ淡水魚。"},
    [5953] = {id=5953,en="A freshwater fish whose fins resemble the delicate wings of a dragonfly.",ja="清流に生息する淡水魚。\n"},
    [5954] = {id=5954,en="An arthropod that once clung desperately to an underwater prominence in the Senroh Sea.",ja="センロー海周辺の岩礁に附着するバーナクル。\n"},
    [5955] = {id=5955,en="Roaming the waters deep within Ulbuka's continental rifts, this freshwater fish is surprisingly elusive for its massive size.",ja="ウルブカ大陸の地下深くに生息する珍しい\n巨大淡水魚。"},
    [5957] = {id=5957,en="A long, thin fish whose scales can emit light electric pulses.",ja="電気を発する珍しい淡水魚。\n"},
    [5959] = {id=5959,en="Found mainly in estuaries, this fish is adorned with scales so refulgent that fishkeepers all over Adoulin covet its brethren.",ja="汽水域にも生息する鱗の美しい淡水魚。\nアドゥリンでは観賞用として珍重される。"},
    [5960] = {id=5960,en="A crustacean that thrives on the Ulbukan continent, possibly due to the strength of the poison it possesses, which can incapacitate creatures much larger than itself.",ja="ウルブカ大陸に生息する甲殻類。\n毒に強い。"},
    [5961] = {id=5961,en="A miniscule cephalopod that roams the Senroh Sea, protecting its life by squeezing into the tiniest of cracks.",ja="センロー海に生息している小型の頭足類。\n"},
    [5962] = {id=5962,en="This tentacle was ripped mercilessly from a frightened contortopus.",ja="ちぎれた頭足類の足。\n"},
    [5963] = {id=5963,en="One of the myriad fish that swim in the Senroh Sea near Ulbuka.",ja="センロー海沿岸に生息する海水魚。\n"},
    [5964] = {id=5964,en="The savory and juicy pulp of this popular fruit alone might be to die for, but the fruit itself actually increases people's lifespan.",ja="ウルブカ大陸で人気の果実。\n寿命が延びると云われる。"},
    [5965] = {id=5965,en="Native to the Ulbukan continent, this vegetable's leaves have nourished many a traveler for days on end.",ja="ウルブカ大陸に原産の葉を食す野菜。\n"},
    [5966] = {id=5966,en="This fruit is indigenous to the Ulbukan hinterland, and any who exert the tremendous effort required to bypass its rock-like exterior are rewarded with pulp from a succulent center.",ja="ウルブカ大陸で採れる固い殻に覆われている実。\n中はとてもジューシー。"},
    [5967] = {id=5967,en="Lore has it that those who eat this odd mushroom will inevitably fail to stay their tongues, no matter how hard they try.",ja="食べると話が止まらなくなるキノコ。\n食用には適さない。"},
    [5968] = {id=5968,en="A paella composed of bounties from\nvarious seas.\nHP+40 DEX+5 MND-1\nAccuracy+15% (Max. 80)\n\"Undead Killer\"+5",ja="様々な海の幸を贅沢に使ったパエリア。\nHP+40 DEX+5 MND-1 命中+15% (最大80)\nアンデッドキラー+5 "},
    [5969] = {id=5969,en="A paella so salty that Ulbukan\nfishermen cannot help but be reminded\nof their many trials and tribulations on\nthe Senroh Sea.\nHP+45 DEX+6\nAccuracy+16% (Max. 85)\n\"Undead Killer\"+6",ja="センロー海が口の中に広がるパエリア。\nHP+45 DEX+6 命中+16% (最大85)\nアンデッドキラー+6 "},
    [5970] = {id=5970,en="A paella made with a plethora of\nmushrooms.\nHP+40 STR-1 MND+5\nMagic Accuracy+5\n\"Undead Killer\"+5",ja="様々なキノコを贅沢に使ったパエリア。\nHP+40 STR-1 MND+5 魔命+5\nアンデッドキラー+5 "},
    [5971] = {id=5971,en="One bite of this spectacular example\nof paella releases the earthy aroma of\nUlbuka's jungle upon one's tongue.\nHP+45 MND+6\nMagic Accuracy+6\n\"Undead Killer\"+6",ja="大地の恵みを全身で感じられるパエリア。\nHP+45 MND+6 魔命+6 アンデッドキラー+6 "},
    [5972] = {id=5972,en="A paella made with heaping helpings of\nbeef.\nHP+40 STR+5 INT-1\nAttack+18% (Max. 90)\n\"Undead Killer\"+5",ja="牛肉を贅沢に使ったパエリア。\nHP+40 STR+5 INT-1 攻+18% (最大90)\nアンデッドキラー+5 "},
    [5973] = {id=5973,en="A paella that exhibits a special\nharmony between juicy beef and mild\nseafood.\nHP+45 STR+6\nAttack+19% (Max. 95)\n\"Undead Killer\"+6",ja="牛肉とシーフードの旨みが溢れ出すパエリア。\nHP+45 STR+6 攻+19% (最大95)\nアンデッドキラー+6 "},
    [5974] = {id=5974,en="A paella expertly prepared, bringing\nforth every onz of flavor present in\nthe myriad barnacles that serve as\ningredients.\nHP+40 VIT+5 MND-1 CHR-1\nDEF+25% (Max. 150)\n\"Undead Killer\"+5",ja="バーナクルを贅沢に使ったパエリア。\nHP+40 VIT+5 MND-1 CHR-1\n防+25% (最大150) アンデッドキラー+5 "},
    [5975] = {id=5975,en="Flapano's legendary barnacle paella.\nSo many ingredients were used to\ncreate this delicacy that it is wholly\nunderstandable why his restaurant runs\nout of foodstuffs when he makes a\nplate of it.\nHP+45 VIT+6\nDEF+26% (Max. 155)\n\"Undead Killer\"+6",ja="フラパノ直伝のバーナクルパエリア。\nあまりの美味しさに食材が足りなくなるのも\n頷ける。\nHP+45 VIT+6 防+26% (最大155)\nアンデッドキラー+6 "},
    [5976] = {id=5976,en="This all-natural milk made of pure\nsqueezed ulbuconuts is a favorite of\nall Adoulinians.\nVIT-2 CHR+3",ja="パームの実をそのままに豪快に飲むジュース。\nアドゥリンの定番ジュース。\nVIT-2 CHR+3 "},
    [5977] = {id=5977,en="This milk tastes even creamier than\nusual, despite the only difference\nbeing that the ulbuconut in which it\nis contained was cut cleaner.\nVIT-1 CHR+4",ja="綺麗に切れただけなのにいつもより\n美味しく感じるパームジュース。\nVIT-1 CHR+4 "},
    [5978] = {id=5978,en="A pleasurable dessert fit for any\noccasion, this felicifruit gelatin pairs\nexceedingly well with the compote\nthat sits atop it.\nMP+5% (Max. 100) INT+7\nMP recovered while healing +3",ja="フィクリカのゼリーにフィクリカのコンポートを\n乗せたデザート。\nMP+5% (最大100) INT+7 ヒーリングMP+3 "},
    [5979] = {id=5979,en="A felicifruit fashioned into one of the\nmost succulent desserts Adoulin has\nto offer, thanks to the expert hands\nof local patissiers.\nMP+6% (Max. 105) INT+8\nMP recovered while healing +4",ja="パティシエの技が光る「フィクリカゼリー」。\nとてもとても美味しい。\nMP+6% (最大105) INT+8 ヒーリングMP+4 "},
    [5980] = {id=5980,en="Though heated thoroughly, these\nbarnacles are nothing to write home\nabout.\nCHR-3 DEF+25% (Max. 130)",ja="ボイルしたバーナクル。\nCHR-3 防+25% (最大130) "},
    [5981] = {id=5981,en="Steamed expertly in their own juices,\nthese barnacles are certainly not\ntypical fare from the sea.\nCHR-2 DEF+26% (Max. 135)",ja="美味しくできたボイルバーナクル。\nCHR-2 防+26% (最大135) "},
    [5982] = {id=5982,en="An Adoulinian tradition, this skewer is\ndecked with some of the tastiest\ncatches from the Senroh Sea.\nDEX+2 VIT+3 MND-1\nDEF+25% (Max. 150)",ja="センロー海で採れる食材を刺したアドゥリン伝統の串焼。\nDEX+2 VIT+3 MND-1 防+25% (最大150) "},
    [5983] = {id=5983,en="A skewer with ingredients from the\nSenroh Sea grilled with the prowess of\na fisherman who knows his prey inside\nand out.\nDEX+3 VIT+4 DEF+26% (Max. 155)",ja="美味しく焼けたセンロー風海の串焼。\n思わず泳ぎたくなる美味しさ。\nDEX+3 VIT+4 防+26% (最大155) "},
    [5984] = {id=5984,en="Putting this plant anywhere near one's mouth is apt to cause certain death. Even grotesque gnats avoid it at all costs.",ja="食べると死に至るという毒草。\nナット族でさえも近寄らない。"},
    [5985] = {id=5985,en="Ingesting this plant induces paralysis, no matter how brawny one may be.",ja="食べると「麻痺」状態になってしまう毒草。\n"},
    [5986] = {id=5986,en="A potion developed by the Peacekeepers' Coalition to aid pioneers in their quest to colonize Ulbuka.",ja="開拓を進めるためにピースキーパー・ワークスが\n開発したポーション。"},
    [5987] = {id=5987,en="An ether developed by the Peacekeepers' Coalition to aid pioneers in their quest to colonize Ulbuka.",ja="開拓を進めるためにピースキーパー・ワークスが\n開発したエーテル。"},
    [5988] = {id=5988,en="The white magic spell Protect is inscribed on this parchment.",ja="白魔法『プロテス』を封じた羊皮紙。\n"},
    [5989] = {id=5989,en="The white magic spell Shell is inscribed on this parchment.",ja="白魔法『シェル』を封じた羊皮紙。\n"},
    [5990] = {id=5990,en="The white magic spell Stoneskin is inscribed on this parchment.",ja="白魔法『ストンスキン』を封じた羊皮紙。\n"},
    [5991] = {id=5991,en="This butterfly may be colored black as midnight, but it aids pioneers in finding the light of Vana'diel by extracting them from otherworldly skirmishes.",ja="帰巣性の強い黒い蝶。\n放つと、迷うことなく元いた所に向け飛んでいく。"},
    [5992] = {id=5992,en="Integral in opening the treasure coffers after otherworldly skirmishes, this key is shaped like a skull.",ja="「スカーム」の宝箱を開くカギ。\n"},
    [5993] = {id=5993,en="An amphibian that hops about the banks of the Ulbukan shore.",ja="センロー海沿岸の岩礁に生息する両生類。"},
    [5995] = {id=5995,en="True to its name, this estuary-dwelling species of fish has both an insatiable appetite and an undying supply of poison.",ja="食欲旺盛な猛毒を持つ巨大淡水魚。\n汽水域にも生息している。\n"},
    [5997] = {id=5997,en="A massive and legendary bivalve.",ja="伝説の巨大二枚貝。\n"},
    [5998] = {id=5998,en="This pedestrian style of seaweed soup is enjoyed by families throughout the Sacred City of Adoulin.\nHP+3% (Max. 40) VIT+3\nDEF+15% (Max. 70)\nHP recovered while healing +6",ja="アドゥリンで一般的な海藻のスープ。\nHP+3% (最大40) VIT+3 防+15% (最大70)\nヒーリングHP+6"},
    [5999] = {id=5999,en="This soup is as nostalgic as it is delicious, and many Adoulinians have returned halfway through their journeys just to taste this soup once more.\nHP+4% (Max. 45) VIT+4\nDEF+16% (Max. 75)\nHP recovered while healing +7",ja="美味しくできたアドゥリンスープ。\n懐かしさのあまり家に帰りたくなる味。\nHP+4% (最大45) VIT+4 防+16% (最大75)\nヒーリングHP+7"},
    [6001] = {id=6001,en="A diminutive clot that, through generations of evolution, has adapted to living in extremely heated environs.",ja="環境に適応して熱に強くなった\nスライム族の亜種「クロット」の小型の分身。"},
    [6002] = {id=6002,en="A pickaxe modified by the Pioneers' Coalition to aid in the excavation of resources from only the harshest of Eastern Ulbuka's mines.",ja="パイオニア・ワークスが改良した\n東ウルブカ専用のつるはし。"},
    [6003] = {id=6003,en="A pickaxe modified by the Pioneers' Coalition to aid in the excavation of resources from only the harshest of Eastern Ulbuka's mines.",ja="パイオニア・ワークスが改良した\n東ウルブカ専用のつるはし。"},
    [6004] = {id=6004,en="A hatchet modified by the Pioneers' Coalition to aid in the felling of trees in only the thickest of Eastern Ulbuka's forests.",ja="パイオニア・ワークスが改良した\n東ウルブカ専用のまさかり。"},
    [6005] = {id=6005,en="A hatchet modified by the Pioneers' Coalition to aid in the felling of trees in only the thickest of Eastern Ulbuka's forests.",ja="パイオニア・ワークスが改良した\n東ウルブカ専用のまさかり。"},
    [6006] = {id=6006,en="A sickle modified by the Pioneers' Coalition to aid in the harvesting of resources amongst only the wildest brush in Eastern Ulbuka.",ja="パイオニア・ワークスが改良した\n東ウルブカ専用の草刈鎌。"},
    [6007] = {id=6007,en="A sickle modified by the Pioneers' Coalition to aid in the harvesting of resources amongst only the wildest brush in Eastern Ulbuka.",ja="パイオニア・ワークスが改良した\n東ウルブカ専用の草刈鎌。"},
    [6008] = {id=6008,en="The flavor of this candy is often likened to pastorally strolling through a dew-covered copse.",ja="爽やかな森の香りがするキャンデー。\n"},
    [6009] = {id=6009,en="Made by the meticulous mitts of\nmoogles, this palate-pleasing pudding\ncontains milk from backwoods-bred\nbovines and eggs from the choicest of\nchickens.\nHP+7 MP+7 VIT+3",ja="モーグリが作ったプリン。\n野牛の乳と鳥の卵を使った、モーグリの自信作。\nHP+7 MP+7 VIT+3 "},
    [6010] = {id=6010,en="??!\nINT+2 CHR+3 Evasion+2 ",ja="ピヨ！\nINT+2 CHR+3 回避+2 "},
