    [6041] = {id=6041,en="SCH Lv.24\nTeaches the black magic Pyrohelix.\nDeals fire damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv24\n黒魔法『火門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる火属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6042] = {id=6042,en="SCH Lv.20\nTeaches the black magic Hydrohelix.\nDeals water damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv20\n黒魔法『水門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる水属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6043] = {id=6043,en="SCH Lv.28\nTeaches the black magic Ionohelix.\nDeals lightning damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv28\n黒魔法『雷門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる雷属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6044] = {id=6044,en="SCH Lv.26\nTeaches the black magic Cryohelix.\nDeals ice damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv26\n黒魔法『氷門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる氷属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6045] = {id=6045,en="SCH Lv.18\nTeaches the black magic Geohelix.\nDeals earth damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv18\n黒魔法『土門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる土属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6046] = {id=6046,en="SCH Lv.22\nTeaches the black magic Anemohelix.\nDeals wind damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv22\n黒魔法『風門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる風属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6047] = {id=6047,en="SCH Lv.32\nTeaches the black magic Luminohelix.\nDeals light damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv32\n黒魔法『光門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる光属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6048] = {id=6048,en="SCH Lv.30\nTeaches the black magic Noctohelix.\nDeals darkness damage that gradually reduces a target's HP. Damage dealt is greatly affected by the weather.",ja="使用制限:学Lv30\n黒魔法『闇門の計』の呪文が記された兵法書。\n効果:敵のHPを徐々に減少させる闇属性のダメージ。\n天候や曜日の影響を受ける。"},
    [6049] = {id=6049,en="SCH Lv.44\nTeaches the white magic Firestorm.\nChanges the weather around target party member to \"hot.\"",ja="使用制限:学Lv44\n白魔法『熱波の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を熱波にする。"},
    [6050] = {id=6050,en="SCH Lv.42\nTeaches the white magic Rainstorm.\nChanges the weather around target party member to \"rainy.\"",ja="使用制限:学Lv42\n白魔法『豪雨の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を雨にする。"},
    [6051] = {id=6051,en="SCH Lv.46\nTeaches the white magic Thunderstorm.\nChanges the weather around target party member to \"thundery.\"",ja="使用制限:学Lv46\n白魔法『疾雷の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を雷にする。"},
    [6052] = {id=6052,en="SCH Lv.45\nTeaches the white magic Hailstorm.\nChanges the weather around target party member to \"snowy.\"",ja="使用制限:学Lv45\n白魔法『吹雪の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を雪にする。"},
    [6053] = {id=6053,en="SCH Lv.41\nTeaches the white magic Sandstorm.\nChanges the weather around target party member to \"dusty.\"",ja="使用制限:学Lv41\n白魔法『砂塵の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を砂塵にする。"},
    [6054] = {id=6054,en="SCH Lv.43\nTeaches the white magic Windstorm.\nChanges the weather around target party member to \"windy.\"",ja="使用制限:学Lv43\n白魔法『烈風の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を風にする。"},
    [6055] = {id=6055,en="SCH Lv.48\nTeaches the white magic Aurorastorm.\nChanges the weather around target party member to \"auroras.\"",ja="使用制限:学Lv48\n白魔法『極光の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候をオーロラに\nする。"},
    [6056] = {id=6056,en="SCH Lv.47\nTeaches the white magic Voidstorm.\nChanges the weather around target party member to \"gloomy.\"",ja="使用制限:学Lv47\n白魔法『妖霧の陣』の呪文が記された兵法書。\n効果:標的のパーティメンバーの周囲の天候を妖霧にする。"},
    [6058] = {id=6058,en="SCH Lv.46\nTeaches the black magic Klimaform.\nIncreases the magic accuracy for spells of the same element as the current weather.",ja="使用制限:学Lv46\n黒魔法『虚誘掩殺の策』の呪文が記された兵法書。\n効果:天候の属性の魔法命中率をアップ。"},
    [6059] = {id=6059,en="SCH Lv.85\nTeaches the white magic Animus Augeo.\nFacilitates enmity gain for target party member.",ja="使用制限:学Lv85 \n白魔法『悪事千里の策』の呪文が記された兵法書。\n効果:標的のパーティメンバーの敵対心を上がりやすく\nする。"},
    [6060] = {id=6060,en="SCH Lv.85\nTeaches the white magic Animus Minuo.\nSuppresses enmity gain for target party member.",ja="使用制限:学Lv85 \n白魔法『暗中飛躍の策』の呪文が記された兵法書。\n効果:標的のパーティメンバーの敵対心を上がりにくく\nする。"},
    [6061] = {id=6061,en="SCH Lv.88\nTeaches the white magic Adloquium.\nGradually increases target's TP.",ja="使用制限:学Lv88 \n白魔法『鼓舞激励の策』の呪文が記された兵法書。\n効果:標的のパーティメンバーのTPを徐々に上昇。\n"},
    [6063] = {id=6063,en="A tasty treat made of iced cream and topped with an abundance of delectable fruits piled as high as its popularity.\nMP+5% (Max. 50)\nSTR-3 INT+3 MND+2 CHR+1\nMagic Accuracy+3\n\"Magic Atk. Bonus\"+6",ja="フルーツをふんだんに使った人気のパフェ。\nMP+5% (最大50) STR-3 INT+3 MND+2\nCHR+1 魔命+3 魔攻+6"},
    [6064] = {id=6064,en="An exemplar of icy elegance, this parfait is modeled after the crown that once adorned the head of Marelinne R. d'Oraguille, San d'Oria's former Sentinel Queen.\nMP+6% (Max. 55)\nSTR-2 INT+4 MND+3 CHR+2\nMagic Accuracy+4\n\"Magic Atk. Bonus\"+7",ja="旅王マレリーヌの王冠をフルーツで模した\n気品あふれるパフェ。\nMP+6% (最大55) STR-2 INT+4 MND+3\nCHR+2 魔命+4 魔攻+7"},
    [6065] = {id=6065,en="Developed by the Inventors' Coalition, this petite macaroon has a smooth, buttery flavor that puts craftsmen at ease while taking a load off.",ja="インベンター・ワークスが監修した\n小さなコーヒーマカロン。職人用のおやつ。"},
    [6066] = {id=6066,en="Developed by the Inventors' Coalition, this petite rusk has a crunchy texture that is the perfect pick-me-up for craftsmen.",ja="インベンター・ワークスが監修した\n小さなチョコラスク。職人用のおやつ。"},
    [6067] = {id=6067,en="Cleaved from the hand of a thaumaturge, this dexterous digit points the meek toward their home world.",ja="弱き者に退路を指し示すと云われる魔人の指。\n"},
    [6068] = {id=6068,en="A thick slice of grilled gabbrath meat.",ja="マグマのように熱いギャブラスの肉。\n"},
    [6069] = {id=6069,en="A sufficiently tasty soup in which the\ndorsal fin of a rockfin is boiled under\nhigh temperature for extended periods\nof time.\nAccuracy+14% (Max. 90)\nAttack+18% (Max. 80)\nRanged Accuracy+14% (Max. 90)\nRanged Attack+18% (Max. 80)\n\"Amorph Killer\"+5",ja="煮込んだロックフィンのヒレ。\n命中+14% (最大90) 攻+18% (最大80)\n飛命+14% (最大90) 飛攻+18% (最大80)\nアモルフキラー+5 "},
    [6070] = {id=6070,en="An exquisite example of boiled\nrockfin, the broth perfectly\naccentuates the marine flavors\ninherent in the beast's dorsal\nappendage.\nAccuracy+15% (Max. 95)\nAttack+19% (Max. 85)\nRanged Accuracy+15% (Max. 95)\nRanged Attack+19% (Max. 85)\n\"Amorph Killer\"+6",ja="美しくできたフカヒレ姿煮\n食感が楽しい。\n命中+15% (最大95) 攻+19% (最大85)\n飛命+15% (最大95) 飛攻+19% (最大85)\nアモルフキラー+6 "},
    [6071] = {id=6071,en="A slice of meat so hot it practically\nbubbles and boils like lava.\nSTR+8 Attack+23% (Max. 180)\nRanged Attack+23% (Max. 180)\n\"Vermin Killer\"+5",ja="厚切りで焼いたギャブラスの肉。 \nSTR+8 攻+23% (最大180)\n飛攻+23% (最大180) ヴァーミンキラー+5 "},
    [6072] = {id=6072,en="This thick steak of gabbrath meat\nerupts inside one's stomach, leaving\nan incredible warmth behind even after\nits last remains are digested.\nSTR+9 Attack+24% (Max. 185)\nRanged Attack+24% (Max. 185)\n\"Vermin Killer\"+6",ja="美味しく焼けたギャブラスの厚切り肉。 \nお腹の中に入っても冷めない。\nSTR+9 攻+24% (最大185)\n飛攻+24% (最大185) ヴァーミンキラー+6 "},
    [6073] = {id=6073,en="GEO Lv.15\nTeaches the geomancy Indi-Regen.\nGradually restores HP for\nparty members near the caster.",ja="使用制限:風Lv15\n風水魔法『インデリジェネ』が記された風水盤。\n効果:自身の周囲のパーティメンバーの\nHPを徐々に回復。"},
    [6074] = {id=6074,en="GEO Lv.1\nTeaches the geomancy Indi-Poison.\nPoisons enemies near the caster and\ngradually reduces their HP.",ja="使用制限:風Lv1\n風水魔法『インデポイズン』が記された風水盤。\n効果:自身の周囲の敵を「毒」状態にする。"},
    [6075] = {id=6075,en="GEO Lv.30\nTeaches the geomancy Indi-Refresh.\nGradually restores MP for\nparty members near the caster.",ja="使用制限:風Lv30\n風水魔法『インデリフレシュ』が記された風水盤。\n効果:自身の周囲のパーティメンバーの\nMPを徐々に回復。"},
