    [6088] = {id=6088,en="GEO Lv.4\nTeaches the geomancy Indi-Voidance.\nEnhances evasion for\nparty members near the caster.",ja="使用制限:風Lv4\n風水魔法『インデヴォイダンス』が記された\n風水盤。\n効果:自身の周囲のパーティメンバーの\n回避率をアップ。"},
    [6089] = {id=6089,en="GEO Lv.22\nTeaches the geomancy Indi-Focus.\nEnhances magic accuracy for\nparty members near the caster.",ja="使用制限:風Lv22\n風水魔法『インデフォーカス』が記された風水盤。\n効果:自身の周囲のパーティメンバーの\n魔法命中率をアップ。"},
    [6090] = {id=6090,en="GEO Lv.16\nTeaches the geomancy Indi-Attunement.\nEnhances magic evasion for\nparty members near the caster.",ja="使用制限:風Lv16\n風水魔法『インデアトゥーン』が記された風水盤。\n効果:自身の周囲のパーティメンバーの\n魔法回避率をアップ。"},
    [6091] = {id=6091,en="GEO Lv.82\nTeaches the geomancy Indi-Wilt.\nReduces attack for\nenemies near the caster.",ja="使用制限:風Lv82\n風水魔法『インデウィルト』が記された風水盤。\n効果:自身の周囲の敵の攻撃力をダウン。"},
    [6092] = {id=6092,en="GEO Lv.76\nTeaches the geomancy Indi-Frailty.\nReduces defense for\nenemies near the caster.",ja="使用制限:風Lv76\n風水魔法『インデフレイル』が記された風水盤。\n効果:自身の周囲の敵の防御力をダウン。"},
    [6093] = {id=6093,en="GEO Lv.94\nTeaches the geomancy Indi-Fade.\nReduces magic attack for\nenemies near the caster.",ja="使用制限:風Lv94\n風水魔法『インデフェイド』が記された風水盤。\n効果:自身の周囲の敵の魔法攻撃力をダウン。"},
