    [6095] = {id=6095,en="GEO Lv.58\nTeaches the geomancy Indi-Slip.\nReduces accuracy for\nenemies near the caster.",ja="使用制限:風Lv58\n風水魔法『インデスリップ』が記された風水盤。\n効果:自身の周囲の敵の命中率をダウン。"},
    [6096] = {id=6096,en="GEO Lv.52\nTeaches the geomancy Indi-Torpor.\nReduces evasion for\nenemies near the caster.",ja="使用制限:風Lv52\n風水魔法『インデトーパー』が記された風水盤。\n効果:自身の周囲の敵の回避率をダウン。"},
    [6097] = {id=6097,en="GEO Lv.70\nTeaches the geomancy Indi-Vex.\nReduces magic accuracy for\nenemies near the caster.",ja="使用制限:風Lv70\n風水魔法『インデヴェックス』が記された風水盤。\n効果:自身の周囲の敵の魔法命中率をダウン。"},
    [6098] = {id=6098,en="GEO Lv.64\nTeaches the geomancy Indi-Languor.\nReduces magic evasion for\nenemies near the caster.",ja="使用制限:風Lv64\n風水魔法『インデランゴール』が記された風水盤。\n効果:自身の周囲の敵の魔法回避力をダウン。"},
    [6099] = {id=6099,en="GEO Lv.48\nTeaches the geomancy Indi-Slow.\nReduces attack speed for\nenemies near the caster.",ja="使用制限:風Lv48\n風水魔法『インデスロウ』が記された風水盤。\n効果:自身の周囲の敵の攻撃間隔を長くする。"},
    [6100] = {id=6100,en="GEO Lv.68\nTeaches the geomancy Indi-Paralysis.\nParalyzes enemies near the caster.",ja="使用制限:風Lv68\n風水魔法『インデパライズ』が記された風水盤。\n効果:自身の周囲の敵を「麻痺」状態にする。"},
    [6101] = {id=6101,en="GEO Lv.88\nTeaches the geomancy Indi-Gravity.\nWeighs down enemies near the caster\nand lowers their movement speed.",ja="使用制限:風Lv88\n風水魔法『インデグラビデ』が記された風水盤。\n効果:自身の周囲の敵を「ヘヴィ」状態にする。"},
    [6131] = {id=6131,en="GEO Lv.93\nTeaches the geomancy Indi-Haste.\nIncreases attack speed for party members within range.",ja="使用制限:風Lv93\n風水魔法『インデヘイスト』が記された風水盤。\n効果:自身の周囲のパーティメンバーの\n攻撃間隔を短くする。"},
    [6137] = {id=6137,en="This leather quiver is used to carry large quantities of chapuli arrows.",ja="『チャプリアロー』を収納する武具。\n多数の矢を携帯できる。"},
    [6138] = {id=6138,en="This leather quiver is used to carry large quantities of mantid arrows.",ja="『マンティッドアロー』を収納する武具。\n多数の矢を携帯できる。"},
    [6139] = {id=6139,en="This leather quiver is used to carry large quantities of midrium bolts.",ja="『ミドリウムボルト』を収納する武具。\n多数のボルトを携帯できる。"},
    [6140] = {id=6140,en="This leather quiver is used to carry large quantities of damascus bolts.",ja="『ダマスクボルト』を収納する武具。\n多数のボルトを携帯できる。"},
    [6141] = {id=6141,en="This leather quiver is used to carry large quantities of oxidant bolts.",ja="『オキシドボルト』を収納する武具。\n多数のボルトを携帯できる。"},
    [6142] = {id=6142,en="This leather pouch is used to carry large quantities of midrium bullets.",ja="『ミドリウムブレット』を収納する武具。\n多数のブレットを携帯できる。"},
    [6143] = {id=6143,en="This leather pouch is used to carry large quantities of damascus bullets.",ja="『ダマスクブレット』を収納する武具。\n多数のブレットを携帯できる。"},
    [6144] = {id=6144,en="The colder the water, the more this fish thrives, for it can only be found in rivers and lakes in Ulbuka that have been frozen over.",ja="ウルブカ大陸の氷河湖に生息する淡水魚。 \n"},
    [6145] = {id=6145,en="A new hatchling from the remora, a species of fish that has managed to survive for countless eons.",ja="古代魚の幼魚。\n"},
    [6146] = {id=6146,en="A legendary fish that has bloodied the waters in which it swims since times of yore.",ja="伝説の巨大な古代魚。\n"},
    [6147] = {id=6147,en="A memo scrawled by Mikhe Aryohcha that matter-of-factly states, \"Just throw your fist at your opponent and it'll all work out.\" Adventurers say that their hand-to-hand skill increases after reading this note.",ja="ミケ・アリョーチャが書いたメモ。\n「とにかく殴るにぁりん」と書かれている。\n格闘スキルが上昇する。"},
    [6148] = {id=6148,en="A guide to the finer points of wielding a dagger, written by an anonymous individual. Adventurers note that reading it increases one's dagger skill.",ja="著者不明の短剣の教本。\n様々な状況で相手を一撃で暗殺する術が\n書かれている。\n短剣スキルが上昇する。"},
    [6149] = {id=6149,en="Ulla wrote this guide on sword wielding--from how to grip the hilt to tips on footwork--so others could follow in her footsteps. Adventurers note that reading it increases one's sword skill.",ja="後世の為にウラがキリッチに書かせた\n片手剣の教本。片手剣の握り方から\n足の出し方まで丁寧に書かれている。\n片手剣スキルが上昇する。"},
    [6150] = {id=6150,en="An account penned by Mieuseloir B Enchelles of his encounters with the Gigas in Beaucedine Glacier. Adventurers note that reading it increases one's great sword skill.",ja="ミュゼルワール・B・アンシェルの戦闘日誌。\nボスディン氷河での巨人との戦いが記されている。\n両手剣スキルが上昇する。"},
    [6151] = {id=6151,en="An account penned by Striking Bull during the Second Battle of Konschtat. It details the Republic's victory over King Raigegue the Lupine's San d'Orian army. Adventurers note that reading it increases one's axe skill.",ja="グジャカの第二次コンシュタット会戦日誌。\n共和国軍が狼王ルジーグ率いる\nサンドリア王国軍に勝利した戦いが記されている。\n片手斧スキルが上昇する。"},
    [6152] = {id=6152,en="A guide to the finer points of hacking everything in one's way to pieces with a two-handed axe, written by an anonymous individual. Adventurers note that reading it increases one's great axe skill.",ja="著者不明の両手斧の教本。\n物の壊し方が長々と記されている。\n両手斧スキルが上昇する。"},
    [6153] = {id=6153,en="A report made by Ludwig Eichberg regarding the Battle of Grauberg. It details the constant changes in the position of the front line and the withdrawal of Republic troops. Adventurers note that reading it increases one's scythe skill.",ja="ルートヴィヒ・アイヒベルクが書いた\nグロウベルグ会戦の報告書。\n戦線の推移や撤退時の戦いなどが記されている。\n両手鎌スキルが上昇する。"},
    [6154] = {id=6154,en="An article detailing the duel between  Yrvaulair S Cousseraux and Alphonimile M Aurchiat that became all the rage in San d'Oria after appearing in a popular newspaper. Adventurers note that reading it increases one's polearm skill.",ja="サンドリアで流行した大衆紙の記事。\n演習でのイルヴォレール・Ｓ・クスローと\nアルフォニミル・Ｍ・オルシャーの一騎打ちのことが\n書かれている。\n両手槍スキルが上昇する。"},
    [6155] = {id=6155,en="A diary written by Kagetora. In it he details each and every one of his ninety-eight victories and ninety-nine losses against Yomi. Adventurers note that reading it increases one's katana skill.",ja="カゲトラの日誌。\nヨミとの対戦成績が書いてある。98勝99敗。\n片手刀スキルが上昇する。"},
    [6156] = {id=6156,en="A record Noillurie kept of her personal experiences. The one that stands out the most is the battle with the colossal beast she undertook to prove herself to her order. Adventurers note that reading it increases one's great katana skill.",ja="ノユリのひんがし見聞録。\n免許皆伝の為に巨大な怪物を討伐した時のことが\n記されている。\n両手刀スキルが上昇する。"},
    [6157] = {id=6157,en="A diary written by Ferreous Coffin that describes his encounters with Orcs in the north. So many were there that his war hammer became coated with a thick layer of blood after all was said and done. Adventurers note that reading it increases one's",ja="フェリアスコフィンの日記。\n北の国で数々のオークを戦槌の錆にしたことが\n書かれている。\n片手棍スキルが上昇する。"},
    [6158] = {id=6158,en="Memoirs penned by Kayeel-Payeel. They describe in particular detail the time he received Claustrum from the Warlock Warlord Robel-Akbel. Adventurers note that reading them increases one's staff skill.",ja="カイルパイルが書き記した日誌。\n大魔元帥ロベルアクベルからクラウストルムを\n授かった日のことが詳細に書かれている。\n両手棍スキルが上昇する。"},
    [6159] = {id=6159,en="A guidebook Perih Vashai jotted down for the edification of new recruits. It discusses everything from the various ways of holding a bow to methods of judging distance. Adventurers note that reading it increases one's archery skill.",ja="ペリィ・ヴァシャイが新兵の為に書いた弓術の\n手引き。弓の構えや射程の見極め方など\n丁寧に書かれている。\n弓術スキルが上昇する。"},
    [6160] = {id=6160,en="An educational text authored by Elivira Gogol. It discusses how to dismantle, clean, and reconstruct firearms in careful detail. Adventurers note that reading it increases one's marksmanship skill.",ja="エリヴィラ・ゴーゴリが書き記した教本。\n銃の構造や組み立て方など詳細に書かれている。\n射撃スキルが上昇する。"},
    [6161] = {id=6161,en="A guide to the finer points of hurling projectile objects at opponents, written by an anonymous individual. Adventurers note that reading it increases one's throwing skill.",ja="著者不明の投てきの教本。\n遠くから相手に気がつかれずに暗殺する術が\n書かれている。\n投てきスキルが上昇する。"},
    [6162] = {id=6162,en="A memo scrawled by Mikhe Aryohcha that matter-of-factly states, \"Just throw your guard up and it'll all work out.\" Adventurers note that reading it increases one's guarding skill.",ja="ミケ・アリョーチャが書いたメモ。\n「とにかく守るにぁりん」と書かれている。\nガードスキルが上昇する。"},
    [6163] = {id=6163,en="A compilation of memories from Sonia. Of particular note are her observations on how to replicate the sheer brilliance of Annika Brilioth and the esoteric steps known as the Kriegstanz. Adventurers say that reading it increases their evasion skill.",ja="アニカ・ブリリオートに憧れた\nソニア・アルフォンソのクリークタンツの練習帳。\n回避スキルが上昇する。"},
    [6164] = {id=6164,en="An essay authored by Cerane I Virgaut, mainly concerning the night Perseus bequeathed unto her an exemplary shield. Adventurers note that reading it increases one's shield skill.",ja="セラーヌ・Ｉ・ヴィルゴの日誌。\nペルセウスから盾を預かった夜のことが\n記されている。\n盾スキルが上昇する。"},
    [6165] = {id=6165,en="A journal kept by Kagetora that delineates the extent to which he and Yomi lost themselves in their studies of the martial arts. Adventurers note that reading it increases one's parrying skill.",ja="カゲトラの日誌。\nヨミと切磋琢磨した日々が書かれている。\n受け流しスキルが上昇する。"},
    [6166] = {id=6166,en="A copy of Febrenard C Brunnaut's favorite read. The simple lyrics and enchanting meter were said to have soothed his soul. Adventurers note that reading it increases one's divine magic skill.",ja="フェブルナルド・Ｃ・ブリュノーの愛読書。\n女神アルタナの聖歌が書かれている。\n神聖魔法スキルが上昇する。"},
    [6167] = {id=6167,en="A collection of thoughts scribbled out by Ferreous Coffin on his visit to Coveffe Barrows. Adventurers note that reading it increases one's healing magic skill.",ja="フェリアスコフィンの日記。\nコヴェフ墳墓群に立ち寄った時のことが\n記されている。\n回復魔法スキルが上昇する。"},
    [6168] = {id=6168,en="A guide to the finer points of heightening the potential of one's compatriots, written by Rainemard. It also includes some tips on how to swing special swords. Adventurers note that reading it increases one's enhancing magic skill.",ja="ライニマードが書いた強化魔法の教本。\n魔法剣の扱い方が丁寧に記されている。\n強化魔法スキルが上昇する。"},
    [6169] = {id=6169,en="A collection of observations made by Rainemard on a particular exploration. It goes into such detail on so much minutiae that many admit to never finishing it. Adventurers note that reading it increases one's enfeebling magic skill.",ja="ライニマードが書いた探偵業の日誌。\n相手の癖や思考が細かに書かれている。\n弱体魔法スキルが上昇する。"},
    [6170] = {id=6170,en="A simple list of known criminals who are better off dead. Every single name is crossed out in Azima's handwriting. Adventurers note that reading it increases one's elemental magic skill.",ja="アズィマが記した賞金首の一覧。\n全ての名前に×印が書かれている。\n精霊魔法スキルが上昇する。"},
    [6171] = {id=6171,en="A guide to the finer points of insidious dark magic, as compiled by Azima. Proceeds from this tome have gone to fund her various purchases dealing with alchemical research. Adventurers note that reading it increases one's dark magic skill.",ja="アズィマが書いた暗黒魔法の教本。\nあまりに難解すぎて一部の人間にしか\n理解されなかった。\nこの本の少ない売り上げが錬金術の書籍購入資金に\nなっている。\n暗黒魔法スキルが上昇する。"},
    [6172] = {id=6172,en="A musical score composed by Lewenhart. Its notes symbolize a fragrant, early morning summer breeze. Adventurers note that reading it increases one's singing skill.",ja="ルーウェンハートが書き残した歌唱の歌詞。\n光風のエチュード。\n歌唱スキルが上昇する。"},
    [6173] = {id=6173,en="A musical score composed by Lewenhart. Its notes symbolize the damp and musty air that stagnates within an underground cave. Adventurers note that reading it increases one's string instrument skill.",ja="ルーウェンハートが書き残した弦楽器の楽譜。\n岩窟のエチュード。\n弦楽器スキルが上昇する。"},
    [6174] = {id=6174,en="A musical score composed by Lewenhart. Its notes symbolize the gently glowing beams of light that filter through the leaves of a deciduous tree in the late afternoon. Adventurers note that reading it increases one's wind instrument skill.",ja="ルーウェンハートが書き残した管楽器の楽譜。\n木漏れ日のエチュード。\n管楽器スキルが上昇する。"},
    [6175] = {id=6175,en="A meticulously drawn diagram Yomi made for Kagetora explaining how to construct certain ninja tools. Adventurers note that reading it increases one's ninjutsu skill.",ja="ヨミがカゲトラの為に書いた忍具の作り方。\n図解で丁寧に書かれている。\n忍術スキルが上昇する。"},
    [6176] = {id=6176,en="A specious work written by an unknown individual that both reads and feels like an illusion from the ancient past. It discusses the world avatars inhabit, but seems too absurd to be true. Adventurers note that reading it increases one's summoning magic sk",ja="著者不明のとても古い幻想書籍。\n神獣が住む世界のことが書かれている。\n召喚魔法スキルが上昇する。"},
    [6177] = {id=6177,en="A report written and filed by an anonymous individual. It covers the behavioral patterns and diets of almost every known family of beasts in existence. Adventurers note that reading it increases one's blue magic skill.",ja="著者不明の生物の生体研究書。\n多種多様な生物の研究が記されている。\n青魔法スキルが上昇する。"},
    [6178] = {id=6178,en="A record of what happened on the fateful day the lifestream overflowed, as kept by Hrohj Wagrehsa. Adventurers note that reading it increases one's geomancy skill.",ja="ホロージュ・ワグレッサが書き残した記録。\n龍脈の暴走を鎮めた日のことが記されている。\n風水魔法スキルが上昇する。"},
    [6179] = {id=6179,en="An essay penned by Hrohj Wagrehsa concerning the transmission of Sih Renaye's handbell and the voice of the land. Adventurers note that reading it increases one's handbell skill.",ja="ホロージュ・ワグレッサが書き残した日録。\nシィ・レナイェの風水鈴と大地の声の\n伝承について記されている。\n風水鈴スキルが上昇する。"},
    [6180] = {id=6180,en="A small wooden box that contains a few plutons.",ja="小さな木製の箱。\n「深成岩」がしょうしょう入っている。"},
    [6181] = {id=6181,en="A tiny parcel that contains a few chunks of beitetsu.",ja="小さな小包。\n「餅鉄」がしょうしょう入っている。"},
    [6182] = {id=6182,en="A small bronze box that contains a few riftborn boulders.",ja="小さな青銅の箱。\n「リフトボウルダー」がしょうしょう入っている。"},
    [6183] = {id=6183,en="A large wooden box that contains a plethora of plutons.",ja="大きな木製の箱。\n「深成岩」がざくざく入っている。"},
    [6184] = {id=6184,en="A large wooden box that contains a plethora of beitetsu.",ja="大きな木製の箱。\n「餅鉄」がざくざく入っている。"},
    [6185] = {id=6185,en="A large bronze box that contains a plethora of riftborn boulders.",ja="大きな青銅の箱。\n「リフトボウルダー」がざくざく入っている。"},
