    [6194] = {id=6194,en="A magical elixir containing ergon might extracted from the Loch of Flux in Kamihr Drifts. Temporarily enhances the effect of Subtle Blow.",ja="カミール山麓で抽出した\nエルゴンパワーを封じた魔瓶。\n一時的にモクシャが上昇する効果を得る。"},
    [6195] = {id=6195,en="A magical elixir containing ergon might extracted from the Lambent Pillar in Kamihr Drifts. Temporarily enhances the effect of Conserve MP.",ja="カミール山麓で抽出した\nエルゴンパワーを封じた魔瓶。\n一時的にコンサーブMPが上昇する効果を得る。"},
    [6196] = {id=6196,en="A magical elixir containing ergon might extracted from the Prominence of the Rime in Woh Gates. Temporarily enhances the effect of Store TP.",ja="ウォーの門で抽出した\nエルゴンパワーを封じた魔瓶。\n一時的にストアTPが上昇する効果を得る。"},
    [6197] = {id=6197,en="A magical elixir containing ergon might extracted from the Halcyon Icefall in Woh Gates. Temporarily grants a magic defense bonus.",ja="ウォーの門で抽出した\nエルゴンパワーを封じた魔瓶。\n一時的に魔法防御力が上昇する効果を得る。"},
    [6198] = {id=6198,en="A magical elixir containing ergon might extracted from the Crystalline Claw in Kamihr Drifts. Temporarily enhances the effect of Snapshot.",ja="カミール山麓で抽出した\nエルゴンパワーを封じた魔瓶。\n一時的にスナップショットが上昇する効果を得る。"},
