    [6211] = {id=6211,en="A slice of classic pizza employing a zesty marinara sauce, and topped with delectable chunks of fish and seafood.\nHP+20\nAccuracy+10% (Max. 54)\nAttack+20% (Max. 50)\n\"Undead Killer\"+5",ja="ニンニクとトマトを乗せた船乗り風ピザの一切れ。\nHP+20 命中+10% (最大54)\n攻+20% (最大50) アンデッドキラー+5 "},
    [6212] = {id=6212,en="Full stomachs ahead, Captain! You've cleaved off a heaping portion of the ultimate in seafood pizzas, simply loaded with succulent morsels of only the finest ocean delights.\nHP+25\nAccuracy+11% (Max. 58)\nAttack+21% (Max. 55)\n\"Undead Killer\"+5",ja="美味しく焼けたマリナーラピザの一切れ。\nHP+25 命中+11% (最大58)\n攻+21% (最大55) アンデッドキラー+5"},
    [6213] = {id=6213,en="A single slice of the pizza that derives its popularity from the tried-and-tested combinatorial deliciousness of cheese, basil, and tomato.\nHP+30\nAccuracy+10% (Max. 8)\nAttack+10% (Max. 10)",ja="バジルとチーズとトマトを乗せた\nカラフルなピザの一切れ。\nHP+30 命中+10% (最大8) 攻+10% (最大10)"},
    [6214] = {id=6214,en="The perfect harmony of basil and tomato adorns this slice of margherita among margheritas.\nHP+35\nAccuracy+10% (Max. 9)\nAttack+10% (Max. 11)",ja="美味しく焼けたマルゲリータピザの一切れ。\nHP+35 命中+10% (最大9) 攻+10% (最大11)"},
    [6215] = {id=6215,en="A veritable sheet of pepperoni on this slice delicately floats upon the layers of cheese and sauce below. A mainstay of any pizza repertoire.\nHP+30 STR+1\nAccuracy+9% (Max. 10)\nAttack+10% (Max. 15)",ja="ペパローニを乗せたピリ辛のピザの一切れ。\nHP+30 STR+1 命中+9% (最大10)\n攻+10% (最大15) "},
    [6216] = {id=6216,en="The width of this pepperoni slice, the consistency of its crust, the proportion of cheese to sauce. It's all here.\nHP+35 STR+2\nAccuracy+9% (Max. 11)\nAttack+10% (Max. 16)",ja="美味しく焼けたペパロニピザの一切れ。\nHP+35 STR+2 命中+9% (最大11)\n攻+10% (最大16) "},
    [6217] = {id=6217,en="A slice of an often-slighted pizza varietal that makes up for its lack of adherents with lots of salt.\nHP+30 DEX+1\nAccuracy+9% (Max. 15)\nAttack+10% (Max. 20)",ja="アンチョビを乗せた塩気のきいたピザの一切れ。\nHP+30 DEX+1 命中+9% (最大15)\n攻+10% (最大20) "},
    [6218] = {id=6218,en="Only the choicest of anchovies are given the privilege of topping this transcendental pizza slice.\nHP+35 DEX+2\nAccuracy+9% (Max. 16)\nAttack+10% (Max. 21)",ja="美味しく焼けたアンチョビピザの一切れ。\nHP+35 DEX+2 命中+9% (最大16)\n攻+10% (最大21)"},
    [6219] = {id=6219,en="Centered around the unique taste of warthog meat, this Far Eastern delicacy is accented with a hefty helping of vegetables and other bounties of the forest.\nHP+10% (Max. 50)\nAttack+10% (Max. 20)\nRanged Attack+19% (Max. 40)\nHP recovered while healing +5",ja="「野猪の肉」を中心に野菜等と共に煮ながら\nみなで食べられる東方伝来の鍋料理。\nHP+10% (最大50) 攻+10% (最大20)\n飛攻+19% (最大40) ヒーリングHP+5 "},
    [6220] = {id=6220,en="This rendition of one of the most iconic pieces of Vana'dielian cooking could barely get any better.\nHP+10% (Max. 75)\nSTR+3 MND+1\nAttack+10% (Max. 30)\nRanged Attack+19% (Max. 60)\nHP recovered while healing +7",ja="美味しくつつけるように\n食材の投入や手順が厳しく監視された猪鍋。\nHP+10% (最大75) STR+3 MND+1\n攻+10% (最大30) 飛攻+19% (最大60)\nヒーリングHP+7"},
    [6221] = {id=6221,en="This extraordinary version of the classic dish makes use of rare ingredients that take years to collect.\nHP+10% (Max. 100)\nSTR+5 MND+2\nAttack+10% (Max. 40)\nRanged Attack+19% (Max. 80)\nHP recovered while healing +9",ja="みなが美味しくつつけるように\n見事に食材の投入や手順が采配された猪鍋。\nHP+10% (最大100) STR+5 MND+2\n攻+10% (最大40) 飛攻+19% (最大80)\nヒーリングHP+9 "},
    [6222] = {id=6222,en="The polarizingly gamey flavor of this raaz meat is further emphasized by its heinous smell, which resembles that of wet leaves and yztarg dung.",ja="独特の臭味が癖になるラズの肉。"},
    [6223] = {id=6223,en="A rare and delectable frozen treat,\nthis colossal cluster of shaved ice\nwas originally whittled from ice\nshards shattered from a fallen\ncehuetzi's back.\nMP+20% (Max. 100) INT+5 MND+5\n\"Magic Atk. Bonus\"+13\n\"Lizard Killer\"+5",ja="セフエジアイスを使った雪山のようなデザート。\nMP+20% (最大100) INT+5 MND+5\n魔攻+13　リザードキラー+5"},
    [6224] = {id=6224,en="An exceedingly tasty rendition of the\niconic ice shard treat, eating it is\noften compared to a romp in freshly\nfallen snow.\nMP+25% (Max. 105) INT+6 MND+6\n\"Magic Atk. Bonus\"+14\n\"Lizard Killer\"+6",ja="美しくできた雪山の欠氷。\nMP+25% (最大105) INT+6 MND+6\n魔攻+14 リザードキラー+6"},
    [6225] = {id=6225,en="A masterfully delicious rendition of\nthe iconic ice shard treat, it pours\nlavish and exotic flavors over the\ntongue while it freezes not the brain.\nMP+30% (Max. 110) INT+7 MND+7\n\"Magic Atk. Bonus\"+15\n\"Lizard Killer\"+7",ja="パティシエの技が光る「雪山の欠氷」。 \nとてもとても美味しい。\nMP+30% (最大110) INT+7 MND+7\n魔攻+15 リザードキラー+7"},
    [6226] = {id=6226,en="Miniscule bread for miniscule beings.\nINT+1",ja="とても小さいパン。\nINT+1 "},
