    [6257] = {id=6257,en="This herbal beverage is made of juices\nsqueezed from the endless varieties of\nflora that cover Ulbuka. Contrary to\nits name, many state that it has a\nmouth-puckeringly, tongue-shrivelingly\nbitter flavor.\nMP+10 VIT-2 MND+3\nMagic Accuracy+1\n\"Magic Atk. Bonus\"+1",ja="森の植物の葉を絞ったドリンク。\nとても苦い。\nMP+10 VIT-2 MND+3 魔命+1 魔攻+1 "},
    [6258] = {id=6258,en="A delectable treat from the Far East, this simple confection consists of steamed rice rolled into a ball.\nHP+20 VIT+3\nAccuracy+14% (Max. 70)\nRanged Accuracy+14% (Max. 70)\nPet: HP+20 VIT+3\nAccuracy+14% (Max. 108)\nRanged Accuracy+14% (Max. 108)",ja="蒸したライスをついて丸めた東方伝来の料理。\nHP+20 VIT+3 命中+14% (最大70)\n飛命+14% (最大70)\nペット:HP+20 VIT+3 命中+14% (最大108)\n飛命+14% (最大108) "},
    [6259] = {id=6259,en="Rolled and steamed to a perfect consistency, this exceptionally delicious shiromochi could almost be considered art.\nHP+30 VIT+4\nAccuracy+15% (Max. 74)\nRanged Accuracy+15% (Max. 74)\nPet: HP+30 VIT+4\nAccuracy+15% (Max. 114)\nRanged Accuracy+15% (Max. 114)",ja="美味しくできた白餅。\nHP+30 VIT+4 命中+15% (最大74)\n飛命+15% (最大74)\nペット:HP+30 VIT+4 命中+15% (最大114)\n飛命+15% (最大114) "},
    [6260] = {id=6260,en="A shiromochi topped with a layer of red bean paste.\nHP+20 VIT+3\nAccuracy+10% (Max. 50)\nRanged Accuracy+10% (Max. 50)\nAttack+16% (Max. 50)\nRanged Attack+16% (Max. 50)\nPet: HP+20 VIT+3\nAccuracy+10% (Max. 75)\nRanged Accuracy+10% (Max. 75)\nAttack+16% (Max. 75)\nRanged Attack+",ja="甘く煮た東方の豆をのせた餅。\nHP+20 VIT+3 命中+10% (最大50)\n攻+16% (最大50) 飛命+10% (最大50)\n飛攻+16% (最大50)\nペット:HP+20 VIT+3 命中+10% (最大75)\n攻+16% (最大75) 飛命+10% (最大75)\n飛攻+16% (最大75) "},
    [6261] = {id=6261,en="A shiromochi with a layer of red bean paste.\nHP+30 VIT+4\nAccuracy+11% (Max. 54)\nAttack+17% (Max. 54)\nRanged Accuracy+11% (Max. 54)\nRanged Attack+17% (Max. 54)\nPet: HP+30 VIT+4\nAccuracy+11% (Max. 81)\nAttack+17% (Max. 82)\nRanged Accuracy+11% (Max. 81)\nRanged Attack",ja="美味しくできた赤餅。\nHP+30 VIT+4 命中+11% (最大54)\n攻+17% (最大54) 飛命+11% (最大54)\n飛攻+17% (最大54)\nペット:HP+30 VIT+4 命中+11% (最大81)\n攻+17% (最大82) 飛命+11% (最大81)\n飛攻+17% (最大82) "},
    [6262] = {id=6262,en="Kneaded with medicinal herbs, this verdant variation of mochi possesses a strong--but not overpowering--aroma reminiscent of spring.\nHP+20 VIT+3\nAttack+20% (Max. 72)\nRanged Attack+20% (Max. 72)\nPet: HP+20 VIT+3\nAttack+20% (Max. 113)\nRanged Attack+20% (Max. 113)",ja="薬草を練りこんだ餅。\nHP+20 VIT+3 攻+20% (最大72)\n飛攻+20% (最大72)\nペット:HP+20 VIT+3 攻+20% (最大113)\n飛攻+20% (最大113) "},
    [6263] = {id=6263,en="A kusamochi with an intense flavor.\nHP+30 VIT+4\nAttack+21% (Max. 77)\nRanged Attack+21% (Max. 77)\nPet: HP+30 VIT+4\nAttack+21% (Max. 120)\nRanged Attack+21% (Max. 120)",ja="美味しくできた草餅。\nHP+30 VIT+4 攻+21% (最大77)\n飛攻+21% (最大77)\nペット:HP+30 VIT+4 攻+21% (最大120)\n飛攻+21% (最大120) "},
    [6264] = {id=6264,en="A hempen sack, worn and frayed by time. It bears an image of a refined stone that can only be described as screams of the dead made manifest.",ja="『黒霊石+1』が入った小袋。"},
    [6265] = {id=6265,en="This leather pouch is used to carry\nlarge quantities of the ninja tool\nranka.",ja="『乱花』を収納するたすき。\n多数の忍具を携帯できる。"},
