    [6267] = {id=6267,en="Though its exterior may be rusted and scuffed with age, this box still properly holds the almost overflowing amount of bayld that has been poured into it over the years.",ja="古めかしい箱。\n「高純度ベヤルド」がずっしりと入っている。"},
    [6268] = {id=6268,en="A special type of firework from the Far East that gracefully spins 'round and 'round while unleashing sparks into the air. ",ja="東方伝来の回転花火。 \n"},
