    [6272] = {id=6272,en="This soft treat made of freshly mashed\npopotoes warms both the body and the\nsoul.\nHP+30 VIT+2 +20\nDEF+20% (Max. 145)\n\"Subtle Blow\"+8",ja="潰して揚げたポポトイモ。\nHP+30 VIT+2 耐火+20 防+20% (最大145)\nモクシャ+8 "},
    [6273] = {id=6273,en="Lightly fried to an exquisite degree,\nthis popoto treat melts on the tongue\nand fills the mouth with a savory\nexcellence.\nHP+35 VIT+3 +21\nDEF+21% (Max. 150)\n\"Subtle Blow\"+9",ja="からりと揚がったポポトフライ。\nHP+35 VIT+3 耐火+21 防+21% (最大150)\nモクシャ+9"},
    [6274] = {id=6274,en="A delightful combination of puk eggs\nand meat, this lunchtime snack is\nperfect for a picnic.\nHP+15 MP+15 STR+2 +20\nAttack+20% (Max. 85)\nRanged Attack+20% (Max. 85)\n\"Subtle Blow\"+8",ja="卵を肉で包んで揚げた料理。\nHP+15 MP+15 STR+2 耐火+20\n攻+20% (最大85) 飛攻+20% (最大85)\nモクシャ+8"},
    [6275] = {id=6275,en="The puk eggs comprising the main\ningredient of this dish have been\nboiled at just the right temperature to\nmake even the most discerning of\nchefs close their eyes and sigh in\ncontentment.\nHP+20 MP+20 STR+3 +21\nAttack+21% (Max. 90)\nRanged Attack+21% (Max. 90)\n\"S",ja="からりと揚がったスコッチエッグ。\nHP+20 MP+20 STR+3 耐火+21\n攻+21% (最大90) 飛攻+21% (最大90)\nモクシャ+9 "},
    [6276] = {id=6276,en="Deep-fried black prawns have been a\npopular treat in the Far East since\ntime immemorial.\nVIT+3 +20\nAccuracy+20% (Max. 70)\nRanged Accuracy+20% (Max. 70)\n\"Subtle Blow\"+8",ja="東方で人気のエビ料理。\nVIT+3 耐火+20 命中+20% (最大70)\n飛命+20% (最大70) モクシャ+8 "},
    [6277] = {id=6277,en="The clean vat of oil used for\ndeep-frying this shrimp left a perfect\nlight-brown breadcrumb cover draping\nthe still-warm black prawn inside.\nVIT+4 +21\nAccuracy+21% (Max. 75)\nRanged Accuracy+21% (Max. 75)\n\"Subtle Blow\"+9",ja="からりと揚がったエビフライ。\nVIT+4 耐火+21 命中+21% (最大75)\n飛命+21% (最大75) モクシャ+9 "},
