    [6459] = {id=6459,en="The soy sauce base of this ramen perfectly accentuates the firm yet pliable noodles.\nHP+55 STR+6 VIT+6 AGI+4\nAttack+11% (Max. 175)\nRanged Attack+11% (Max. 175)\n\"Resist Slow\"+15",ja="職人の魂が籠った醤油ラーメン。\nHP+55 STR+6 VIT+6 AGI+4\n攻+11% (最大175) 飛攻+11% (最大175)\nレジストスロウ+15"},
    [6460] = {id=6460,en="A miso base with a grand heaping of vegetables is both zesty and good for the blood.\nHP+100 STR+5 VIT+5\nDEF+10% (Max. 170)\nMagic Evasion+10% (Max. 50)\n\"Magic Def. Bonus\"+5\n\"Resist Slow\"+10",ja="味噌スープの中に麺を入れて様々な具材を乗せた\n東方で人気の料理。\nHP+100 STR+5 VIT+5 防+10% (最大170)\n魔回避+10% (最大50) 魔防+5\nレジストスロウ+10"},
    [6461] = {id=6461,en="Both savory and tart, this bowl of ramen could easily be sold at even a high-class establishment.\nHP+105 STR+6 VIT+6\nDEF+11% (Max. 175)\nMagic Evasion+11% (Max. 55)\n\"Magic Def. Bonus\"+6\n\"Resist Slow\"+15",ja="職人の魂が籠った味噌ラーメン。\nHP+105 STR+6 VIT+6 防+11% (最大175)\n魔回避+11% (最大55) 魔防+6\nレジストスロウ+15"},
    [6462] = {id=6462,en="Salted ramen is a simple yet traditional dish, and a perennial favorite among street vendors.\nDEX+5 VIT+5 AGI+5\nAccuracy+5% (Max. 90)\nRanged Accuracy+5% (Max. 90)\nEvasion+5% (Max. 90)\n\"Resist Slow\"+10",ja="塩スープの中に麺を入れて様々な具材を乗せた\n東方で人気の料理。\nDEX+5 VIT+5 AGI+5 命中+5% (最大90)\n飛命+5% (最大90) 回避+5% (最大90)\nレジストスロウ+10"},
    [6463] = {id=6463,en="The right amount of salt gives this ramen a special kick to shake off any vestiges of afternoon sleepiness.\nDEX+6 VIT+6 AGI+6\nAccuracy+6% (Max. 95)\nRanged Accuracy+6% (Max. 95)\nEvasion+6% (Max. 95)\n\"Resist Slow\"+15",ja="職人の魂が籠った塩ラーメン。\nDEX+6 VIT+6 AGI+6 命中+6% (最大95)\n飛命+6% (最大95) 回避+6% (最大95)\nレジストスロウ+15"},
    [6464] = {id=6464,en="Fully cooked behemoth meat that fills\nthe stomach.\nHP+40 STR+7 DEX+7 INT-3\nAttack+23% (Max. 160)\nRanged Attack+23% (Max. 160)\n\"Triple Attack\"+1%\n\"Lizard Killer\"+4\nHP recovered while healing +4",ja="厚切りで焼いたベヒーモスの肉。\nHP+40 STR+7 DEX+7 INT-3\n攻+23% (最大160) 飛攻+23% (最大160)\nトリプルアタック+1% リザードキラー+4\nヒーリングHP+4 "},
    [6465] = {id=6465,en="Perfectly cooked on the outside with\na hot red center, this juicy meal melts\nin your mouth without needing to be\naccented by sauce of any kind.\nHP+45 STR+8 DEX+8 INT-4\nAttack+24% (Max. 165)\nRanged Attack+24% (Max. 165)\n\"Triple Attack\"+2%\n\"Lizard Killer\"+5\nHP recovere",ja="美味しく焼けたベヒーモスの厚切り肉。\nあまりの美味しさに叫びそうになってしまう。\nHP+45 STR+8 DEX+8 INT-4\n攻+24% (最大165) 飛攻+24% (最大165)\nトリプルアタック+2% リザードキラー+5\nヒーリングHP+5 "},
    [6466] = {id=6466,en="Fermented soybean soup is a staple of Far Eastern cuisine.\nHP+7% (Max. 50) DEX+4 AGI+4\nAccuracy+10% (Max. 40)\nAttack+10% (Max. 40)\nRanged Accuracy+10% (Max. 40)\nRanged Attack+10% (Max. 40)",ja="東方の家庭で一般的な味噌汁。\nHP+7% (最大50) DEX+4 AGI+4\n命中+10% (最大40) 攻+10% (最大40)\n飛命+10% (最大40) 飛攻+10% (最大40)"},
    [6467] = {id=6467,en="A perfect blend of miso paste and water, this side dish warms both the body and soul with its refreshing tanginess.\nHP+8% (Max. 55) DEX+5 AGI+5\nAccuracy+11% (Max. 45)\nAttack+11% (Max. 45)\nRanged Accuracy+11% (Max. 45)\nRanged Attack+11% (Max. 45)",ja="美味しくできた味噌汁。\n身体も心もぽかぽかになる。\nHP+8% (最大55) DEX+5 AGI+5\n命中+11% (最大45) 攻+11% (最大45)\n飛命+11% (最大45) 飛攻+11% (最大45)"},
    [6468] = {id=6468,en="Sushi made of only the highest quality fish.\nHP+40 MP+20 STR+6\nDEX+7 MND-3 CHR+6\nAccuracy+10% (Max. 100)\nRanged Accuracy+10% (Max. 100)\n\"Resist Sleep\"+1",ja="様々な種類のネタで盛られた豪華なスシ。\nHP+40 MP+20 STR+6 DEX+7 MND-3\nCHR+6 命中+10% (最大100) 飛命+10% (最大100)\nレジストスリープ+1 "},
    [6469] = {id=6469,en="This dazzling dish would cost a pretty gil at any of Vana'diel's fine dining establishments.\nHP+45 MP+25 STR+7\nDEX+8 MND-4 CHR+7\nAccuracy+11% (Max. 105)\nRanged Accuracy+11% (Max. 105)\n\"Resist Sleep\"+2",ja="美味しくできた特上スシ。\nHP+45 MP+25 STR+7 DEX+8 MND-4\nCHR+7 命中+11% (最大105) 飛命+11% (最大105)\nレジストスリープ+2 "},
