    [8752] = {id=8752,en="Once a terrorizing adornment of a vicious cehuetzi's paw, this glacially frigid nail could supposedly freeze its prey's flesh while simultaneously tearing through it.",ja="重重しい冷気を漂わせるセフエジの爪。\n"},
