    [8754] = {id=8754,en="Each individual strand of fur within this coarse pelt is said to cleave its way through the surrounding air as its owner walked, creating a horrific sonic disturbance that would cause even the most stalwart Galka's legs to buckle in fright.",ja="重重しい冷気を漂わせるセフエジの皮。\n"},
    [8755] = {id=8755,en="This stony hunk of a petrified tree contains flecks of a substance that emits an unsettlingly spectral purple glow.",ja="珪化した原木のユグ石。\n紫色に輝く成分を含んでいる。 "},
    [8756] = {id=8756,en="This stony hunk of a petrified tree contains flecks of a substance that emits an unsettlingly spectral brown glow.",ja="珪化した原木のユグ石。\n茶色に輝く成分を含んでいる。 "},
    [8757] = {id=8757,en="This stony hunk of a petrified tree contains flecks of a substance that emits an unsettlingly spectral light blue glow.",ja="珪化した原木のユグ石。\n白色に輝く成分を含んでいる。 "},
    [8758] = {id=8758,en="The crystallized soul of a she-slime as red as a clown's nose. It squirms so incessantly within its mineral prison that it emits a palpable warmth.",ja="温かさを感じるクリスタルの塊。\n魔物の魂が宿っている。"},
    [8759] = {id=8759,en="The crystallized soul of a metal slime as shiny as freshly smelted silver. It squirms so incessantly within its mineral prison that it emits a palpable warmth.",ja="温かさを感じるクリスタルの塊。\n魔物の魂が宿っている。"},
    [8760] = {id=8760,en="The crystallized soul of a spriggan as purple as royal robes. It squirms so incessantly within its mineral prison that it emits a palpable warmth.",ja="温かさを感じるクリスタルの塊。\n魔物の魂が宿っている。"},
