    [8797] = {id=8797,en="This extremely valuable specimen of yggrete contains a wealth of  incomprehensible might within its tiny crystalline borders.",ja="非常に貴重なユグ石の結晶。\n未知の魔力を秘めた最高品質の一粒。"},
    [8798] = {id=8798,en="While this pure, unadulterated form of bayld can hardly withstand even the slightest interaction without crumbling, its concentrated thaumaturgical powers are nonpareil.",ja="通常のものより純度が高いベヤルド。\n靭性は低いが、凝縮された魔力を秘めている。"},
    [8799] = {id=8799,en="Often thought to crumble at the slightest touch, bayld in pure crystalline form is a rarity, and scholars across Ulbuka claim that only the most delicate hands can handle the substance.",ja="非常に希少なベヤルドの大きな結晶体。\n大自然の純潔さを表すかのように透き通っている。"},
